INSERT INTO `review` VALUES (5,1,4.00,'Being nearly 30 and never having been to a dentist sounds kind of unreal, but that\'s the truth of it.  I had some pretty high anxiety about visiting a...','2015-11-05 20:34:43','Steve C.','BqAoLk_XaAQ-BJ3wfUe1qA','http://s3-media4.fl.yelpcdn.com/photo/fzN7K0zHn4-FMxRrGjO-Kg/ms.jpg','hqzJD5CWOagogKDEPzuzfg',1),(6,1,3.00,'We signed up with Reputation Loop to counter malicious internet reviews.  They have worked hard to help us get the program working (we\'re pretty computer...','2015-10-28 13:32:25','Jim U.','OYSKMLOlcPIsz5iN3ZqpAQ','http://s3-media1.fl.yelpcdn.com/photo/VbGqxjkEyLFb0nEEGWbXbw/ms.jpg','k1dT0jtGpsTKZ6HaoNdBbA',1),(7,3,5.00,'I had a great first experience at Redmond Way, having moved to the area earlier this year. Everyone there was very friendly, and I didn\'t wait more than 5 minutes before seeing an assistant. My teeth cleaning was thorough but not painful.\n\nThe dentist has a good eye--he caught a cavity that didn\'t show on the x-ray. When it came time to fill it, I felt no pain during or the days after. Most impressive to me was that the dentist called to follow up and ask how I was doing. I\'ve never had that before, at least not at a dentist. \n\nOverall I left very impressed. There\'s a very high level of care and I can tell that the doctor-patient relationship means something to them.','2015-10-10 15:58:37','Jeffrey Turkelson','https://plus.google.com/110229010391727530931','//lh4.googleusercontent.com/-Q8MyXXoMx1k/AAAAAAAAAAI/AAAAAAAAADs/SZy131JCpmY/photo.jpg',NULL,1),(8,3,5.00,'My family just moved to this area in the past month. Before we moved, I had been going to the same dentist for 25 years. It was a little intimidating to find a new dentist, especially since I was having some tooth pain and I had been putting off a dentist visit because I didn\'t really know where to start. I checked Yelp for a dentist office with good ratings and I found Redmond Way Dentistry. \n\nI called to make an appointment and let them know that I had been having a severe toothache and they were able to get me in the next day. They were very accommodating to my schedule, too, since I needed to arrange a last minute babysitter.\n\nThe receptionist was friendly and easy to talk to. My hygienist was also extremely friendly, helpful and a fellow Coug! Dr. Shaw was very nice, knowledgeable and straight forward. I\'m really excited I found a place with such a friendly staff and a nice office.\n\nI\'ve only been once, but I have an upcoming appointment for a procedure involving dental work on my crowns, and I plan to make Redmond Way Dentistry my dentist office from here on out.','2015-10-06 19:00:56','Kaci Fowler','https://plus.google.com/104936160325603499946','//lh3.googleusercontent.com/-5Lk8iKQNqCQ/AAAAAAAAAAI/AAAAAAAASN4/qhZGpf92MTI/photo.jpg',NULL,1),(9,3,5.00,'The best dental hygienists and dentists in the area! A truly friendly, passionate, and professional team at Redmond Way Dentistry, Ive never looked forward to going to the dentist until I started going here! Best in the Pacific Northwest!!','2015-10-13 17:20:55','Zack Hart','https://plus.google.com/103631878032815914094','//lh5.googleusercontent.com/-ge0ubmwoM_g/AAAAAAAAAAI/AAAAAAAAA04/AV4xGA8tJGE/photo.jpg',NULL,1),(11,3,1.00,'My experience with RWD has been good so far. Dr. Shaw and her assistant are experienced and knowledgeable. I can feel and see the difference in Dr. Shaw\'s work and other dentists. The front desk people are very helpful and lively especially Stephenie & Gary. I recommended RWD to my friends and colleagues so, do the same to whoever is reading this.','2015-06-30 15:06:20','Raju Choudhury','https://plus.google.com/112262113289177356263',NULL,NULL,1),(12,3,5.00,'I first came to the office in April and after my 6 month check up last week I had another great experience. Dr Koogler was very kind and professional. I also appreciated how Stephanie at the front desk was able to help me with my insurance questio