zB72aUB5w/ms.jpg','7YzCEClhUtcZNIyNq2JfpQ',13),(54,3,1.00,'Took over 2 hours after the anticipated arrival time and still got my order wrong. Even when they arrived they made go to them and the \"delivery employee\" didn\'t even get out of the car to give me my food. I shrugged the time and costumer service because all I cared about was to eat my sandwich at this point. Went inside to only find out that the whole order was wrong starting with the sandwich and ending with only giving me one bag of chips after ordering two. Called them to tell them about my experience and \"Jackie\" said it was my fault for not giving an apt #, as far as the wait time goes. The employee was extremely rude and immature as she was giggling about the situation over the phone. Even had the audacity to raise her voice at me in an essence to not let me talk. She also refused to let me speak to a manager twice. After she finally had her fun she passed the phone to the supervisor and he was completely willing to help. He offered another delivery on him and apologized for everything. Good supervisor, yet that still doesn\'t take back the horrible costumer experience with his employees. \n\nPremature costumer service.\n\nYes, i re-posted one word for word, not only because this was my experience too, but because i feel like the more this story is shared the better.\n\nEmployees, such as Jackie P. should not be allowed to work at joints like these because all they do is bring the company down and make it look terrible. If you really want to act that unprofessional, why not go find yourself a job where customer service isn\'t your number one priority? \n\nFor crying out loud, with the service i was given, i was scared to eat the second (correct) sandwich brought to me, in fear that one of the employees had spit in it. ','2016-01-22 02:31:43','Anabel Mora','https://plus.google.com/108240880268309173551','//lh4.googleusercontent.com/-GsOabnHx-Nk/AAAAAAAAAAI/AAAAAAAAADU/NCkUJf3orj0/photo.jpg',NULL,1