','https://plus.google.com/111833982919945919915','//lh4.googleusercontent.com/-xkKi_HA1Nww/AAAAAAAAAAI/AAAAAAAACss/Ok2gC7jKUf8/photo.jpg',NULL,23),(121,3,5.00,'The White House is the official residence and principal workplace of the President of the United States, located at 1600 Pennsylvania Avenue NW in Washington, D.C. It has been the residence of every U.S. president since John Adams in 1800. The house was designed by Irish-born James Hoban and built between 1792 and 1800 of white-painted Aquia Creek sandstone in the Neoclassical style. When Thomas Jefferson moved into the house in 1801, he (with architect Benjamin Henry Latrobe) expanded the building outward, creating two colonnades that were meant to conceal stables and storage.\n\nHowever, in 1814, during the War of 1812, the mansion was set ablaze by the British Army in the Burning of Washington, destroying the interior and charring much of the exterior. Reconstruction began almost immediately, and President James Monroe moved into the partially reconstructed Executive Residence in October 1817. Construction continued with the addition of the South Portico in 1824 and the North in 1829. Because of crowding within the executive mansion itself, President Theodore Roosevelt had all work offices relocated to the newly constructed West Wing in 1901. Eight years later, President William Howard Taft expanded the West Wing and created the first Oval Office which was eventually moved as the section was expanded.\n\nIn the main mansion, the third-floor attic was converted to living quarters in 1927 by augmenting the existing hip roof with long shed dormers. A newly constructed East Wing was used as a reception area for social events; Jefferson\'s colonnades connected the new wings. East Wing alterations were completed in 1946, creating additional office space. By 1948, the house\'s load-bearing exterior walls and internal wood beams were found to be close to failure. Under Harry S. Truman, the interior rooms were completely dismantled and a new internal load-bearing steel frame constructed inside the walls. Once this work was completed, the interior rooms were rebuilt. The modern-day White House complex includes the Executive Residence, West Wing, East Wing, the Eisenhower Executive Office Buildingthe former State Department, which now houses offices for the President\'s staff and the Vice Presidentand Blair House, a guest residence.\n\nThe Executive Residence is made up of six storiesthe Ground Floor, State Floor, Second Floor, and Third Floor, as well as a two-story basement. The term White House is often used as a metonym for the Executive Office of the President of the United States and for the president\'s administration and advisers in general, as in \"The White House has decided that....\". The property is a National Heritage Site owned by the National Park Service and is part of the President\'s Park. In 2007, it was ranked second on the American Institute of Architects list of \"America\'s Favorite Architecture\".','2016-01-21 04:25:47','Muhammad Yoga Chomaruzaman','https://plus.google.com/116484201154211932369','//lh4.googleusercontent.com/-7OMMP635-jw/AAAAAAAAAAI/AAAAAAAABdY/uPDVm1Hd-BM/photo.jpg',NULL,24),(122,3,3.00,'Me and my Junior year class (8 students and 3 adults... only part of the class went on this trip) in High School took a trip to Washington D.C (back in 2013) and we took the public tour of The White House.\n\nSure, The White House has some historic view on people\'s life\'s... but lets face it. Its nothing special to take a tour of the first floor only, basically you are only looking at old furniture and paintings. I think the most interested thing at The White House was the Government vehicles and the Secret Service Police cars/bikes (since I\'m a car enthusiast; I love anything that moves or flys) that were outside on the street and also parked in-front of The White House.\n\nThings to know:\n- You have to do a background check before you reserve your reservation to take the tour of The White House. The wait time from the point you get in line to the entrance of The White House when you walk in is around 30 minutes - 1 hour (depending how fast you and other people get through the security checks).','2016-02-16 23:12:48','Adriel Zalez','https://plus.google.com/105437332037727956726','//lh4.googleusercontent.com/-g73SxuCUK_M/AAAAAAAAAAI/AAAAAAAAAaI/_5mpUDzQKSo/photo.jpg',NULL,24),(123,3,1.00,'We need an overthrow of the Stealth jihad obstructing justice.Violently exterminate the NAACP with extreme prejudice. Arrest and execute Jeb Bush for raping me. Tyrants like Hillary are obstructing justice making the courtroom kangaroo. I still demand adequate medical attention form an abduction by the Reagan administrations CIA. I have been having back trouble and sleeping on the floor for decades with only psychological abuse offered to me.\n','2016-03-09 07:58:01','Free Dummy','https://plus.google.com/114626811159015340534','',NULL,24),(124,3,5.00,'An outstanding facility and one to launch a NEW app upon.  Tonight President Barack Obama will be taking the \"council-power\" world stage once again for what may be his final State of the Union address.  So the media team and I have prepared a rather unique algorithm to enrich the speech writing and delivery process.  What viewing audiences can expect to see and hear at home is an immersive reality whereby tonight\'s Waxing Crescent moon will serve as a virtual  \"contact lens\" allowing us the \"means\" to render tomorrow. So picture in your mind Barack sparking a glowing arc as though he were a heroic rhinoceri having one or two upright horns speaking to an audience of cloned sea urchin children; in an orchard, about a wolf feeling arousing sexual excitement.  Yes it\'s true as Americans need to be taught the birds and the bee\'s by a higher authority since the message is apparently not getting through via other means.  So be sure to have your calculator in hand so that you 