e sandwich and ending with only giving me one bag of chips after ordering two. Called them to tell them about my experience and \"Jackie\" said it was my fault for not giving an apt #, as far as the wait time goes. The employee was extremely rude and immature as she was giggling about the situation over the phone. Even had the audacity to raise her voice at me in an essence to not let me talk. She also refused to let me speak to a manager twice. After she finally had her fun she passed the phone to the supervisor and he was completely willing to help. He offered another delivery on him and apologized for everything. Good supervisor, yet that still doesn\'t take back the horrible costumer experience with his employees. \n\nPremature costumer service.','2016-01-22 01:42:39','Luis Ramirez','https://plus.google.com/101005028981428975922','',NULL,29),(199,3,1.00,'Jackie Percher or whatever the name is made this experience the worst that I\'ve ever had with any restaurant. When contacted over the phone about an order that was made wrong all she did was argue back about the mistake that THEY made, throughout this conversation I was unable to even get in one word to the point were I even had to ask to speak. I don\'t know but to my understanding you pay someone to provide you with something, yet I was in the wrong for simply paying extra for something I wanted and not getting it LOL. When a friend called back to get further information again It was Jackie over the phone who just LAUGHED at the fact that this call was about the same order. The way this employee conducted herself was extremely unprofessional, clearly she didn\'t care in damaging Cheba Hub\'s reputation. If that\'s the kind of employee\'s y\'all hire intentionally than that\'s just plain sad. By far the worst employee I have ever dealt with, and the worst experience ever. ','2016-01-22 02:18:36','Bibiana Mora','https://plus.google.com/116947427850392461585','',NULL,29),(200,3,2.00,'Great food, Cheba Hut ALWAYS has great food. However, ordered some food at 2:30 PM and got an e-mail saying it would be delivered an hour later but didn\'t get it until 2 hours later. First of all, they\'re 5 minutes up the street, so why would it take an hour to get my food? Second, why did it turn into 4 hours??? Very disappointed. Guess I\'ll stick to having Jimmy Johns deliver me a sandwich and will only get Cheba Hut when I have time to go and get it myself.','2015-12-30 18:53:20','Angela Grim','https://plus.google.com/100162185009351021631','//lh5.googleusercontent.com/-U_S8Ud6TYn0/AAAAAAAAAAI/AAAAAAAAJ1A/hIIwAoxHYEE/photo.jpg',NULL,29),(201,3,5.00,'Dear Diary,\n\nKnow why I feel good? Cheba Hut! It\'s clean and chill, and they make my food fresh and delicious. \n\nCheba Hut\'s prices are retro, but their tunes are all over the timeline--and genre spectrum. Their cheer and attention aren\'t fake bullshit. It\'s real humanity-loving humans at their best, making it impossible for the customer to doubt they\'ve added to the life of the joint by walking in. \n\nCheba Hut chefs change up the recipes when it makes sense. It never happens without eye-poppingly ecstatic results. Okay, sometimes the most you get from these tweaks--expert and impromptu--is a slow smile across your leaned-back face. Well? Isn\'t that enough? Yep, whether by original recipe, or her dash of Worcestershire or his extra spice. \n\nOh Diary, my advice isn\'t token: don\'t be afraid I\'ve replaced you with my new Cheba Hut introversion outlet. Look how your papers are filled with more than a sentence and a half. Finally! Even amidst the beats and voices. \n\nHow did they pull that off? Could it be the brownies after all? Uh oh...\n\nIf two bucks or less\nGets you Kool Aid aplenty, \nThen how many cotton-mouths \nCould they cure--for twenty?','2016-04-04 20:49:37','Jelyrsu Bundonu','https://plus.google.com/105634039952053520040','',NULL,13),(202,3,5.00,'Dear Diary,\n\nKnow why I feel good? Cheba Hut! It\'s clean and chill