g but I\'m always getting dank blunts (it\'s a pizza sub) here man.','2016-03-29 04:11:30','Royal D II','https://plus.google.com/101248819918747458166','//lh3.googleusercontent.com/-b2YjQyoE4ls/AAAAAAAAAAI/AAAAAAAAAuI/TQOVpNC4cAw/photo.jpg',NULL,34),(241,3,5.00,'Dear Diary,\n\nKnow why I feel good? Cheba Hut! It\'s clean and chill, and they make my food fresh and delicious. \n\nCheba Hut\'s prices are retro, but their tunes are all over the timeline--and genre spectrum. Their cheer and attention aren\'t fake bullshit. It\'s real humanity-loving humans at their best, making it impossible for the customer to doubt they\'ve added to the life of the joint by walking in. \n\nCheba Hut chefs change up the recipes when it makes sense. It never happens without eye-poppingly ecstatic results. Okay, sometimes the most you get from these tweaks--expert and impromptu--is a slow smile across your leaned-back face. Well? Isn\'t that enough? Yep, whether by original recipe, or her dash of Worcestershire or his extra spice. \n\nOh Diary, my advice isn\'t token: don\'t be afraid I\'ve replaced you with my new Cheba Hut introversion outlet. Look how your papers are filled with more than a sentence and a half. Finally! Even amidst the beats and voices. \n\nHow did they pull that off? Could it be the brownies after all? Uh oh...\n\nIf two bucks or less\nGets you Kool Aid aplenty, \nThen how many cotton-mouths \nCould they cure--for twenty?','2016-04-04 20:49:37','Jelyrsu Bundonu','https://plus.google.com/105634039952053520040','',NULL,34),(242,3,1.00,'Took over 2 hours after the anticipated arrival time and still got my order wrong. Even when they arrived they made go to them and the \"delivery employee\" didn\'t even get out of the car to give me my food. I shrugged the time and costumer service because all I cared about was to eat my sandwich at this point. Went inside to only find out that the whole order was wrong starting with the sandwich and ending with only giving me one bag of chips after ordering two. Called them to tell them about my experience and \"Jackie\" said it was my fault for not giving an apt #, as far as the wait time goes. The employee was extremely rude and immature as she was giggling about the situation over the phone. Even had the audacity to raise her voice at me in an essence to not let me talk. She also refused to let me speak to a manager twice. After she finally had her fun she passed the phone to the supervisor and he was completely willing to help. He offered another delivery on him and apologized for everything. Good supervisor, yet that still doesn\'t take back the horrible costumer experience with his employees. \n\nPremature costumer service.\n\nYes, i re-posted one word for word, not only because this was my experience too, but because i feel like the more this story is shared the better.\n\nEmployees, such as Jackie P. should not be allowed to work at joints like these because all they do is bring the company down and make it look terrible. If you really want to act that unprofessional, why not go find yourself a job where customer service isn\'t your number one priority? \n\nFor crying out loud, with the service i was given, i was scared to eat the second (correct) sandwich brought to me, in fear that one of the employees had spit in it. ','2016-01-22 02:31:43','Anabel Mora','https://plus.google.com/108240880268309173551','//lh4.googleusercontent.com/-GsOabnHx-Nk/AAAAAAAAAAI/AAAAAAAAADU/NCkUJf3orj0/photo.jpg',NULL,34),(243,3,1.00,'Took over 2 hours after the anticipated arrival time and still got my order wrong. Even when they arrived they made go to them and the \"delivery employee\" didn\'t even get out of the car to give me my food. I shrugged the time and costumer service because all I cared about was to eat my sandwich at this point. Went inside to only find out that the whole order was wrong starting with the sandwich and ending with only giving me one bag of chips after ordering two. Called them to t