',NULL,24),(365,1,5.00,'Fantastic experience at Redmond Way Dentistry.\n\nThe office is very clean and the front desk Stephanie was really helpful with scheduling as well as my...','2016-02-28 15:40:50','Hiro H.','bMikmwm-diea-N2r1BhLdg','http://s3-media2.fl.yelpcdn.com/photo/rKVfiajIPMCXU4vjiJG3tQ/ms.jpg','E1x5wxhQWkIx4QcTypeNZQ',51),(366,3,5.00,'Loved it!\n\nMy last (and beloved) dentist retired and I\'ve been on the lookout for a new provider. Done! \n\nI cracked a tooth on Monday, called to schedule an appointment (given Yelp reviews) on Tuesday and was fixed by 10:30 Wednesday. Grateful.\n\nI was super impressed with the office vibe and every one of their team I encountered. \n\nSpotless, calm, efficient (read no crazy wait times), personable, approachable, reasonably priced and centrally located. The only downside is the parking lot. The practice shares the lot with Trader Joe\'s and other businesses. It can become impossible to navigate when busy.','2016-04-07 01:35:08','Lisa Martin','https://plus.google.com/108621396496800314258','',NULL,51),(367,3,5.00,'My family really likes going here and feel very comfortable with the staff and the service. The dentists and their staff are very attentive and friendly. They also care about the costs we have to pay and offer us good suggestions on different options to save and get the most value.','2016-03-21 16:00:44','Raed Jarrar','https://plus.google.com/101887915688303178345','',NULL,51),(368,3,5.00,'Switched from another dentist in Redmond because my husband was going to Redmond Way and said it was great, I loved it! Great team and a very laid back and comfortable environment with lots of friendly people.','2016-04-11 18:46:52','Pro Club Group Fitness','https://plus.google.com/112586122142468502239','//lh3.googleusercontent.com/-oZdwijfveQs/AAAAAAAAAAI/AAAAAAAAABI/nxy8L2453fs/photo.jpg',NULL,51),(369,3,1.00,'Highly don\'t recommend this place.\nI went to see this dentist based on Yelp and Google reviews. After initial exam, Dr. Koogler said i need atleast 2 crown moldings and 6+ fillings costing well over $3000. Insurance paid some and i had to pay around $1500+ from my pocket. Got everything done in one go. During the time he burned my mouth in 3 different places. I understand minor burns are expected but didn\'t he realize that the tools were malfunctioning while working on the teeth? I had 3 major burns and it was very painful which lasted for weeks. I went to see him about this and gave prescription meds. \nNo call from the dentist or the receptionist asking how am i doing as some people were praising in their reviews.\nNot only the burns, initially i was said they will put ceramic crown but the day when i went to replace fake with ceramic, i came to know that it\'s porcelain and not ceramic as the dentist was referring to use red plastic to test biting as it works well with porcelain. Couldn\'t even confront them about this as i was on anesthetic and couldn\'t talk. After they replaced the crown, i started feeling very bad pain when chewing or drinking anything. When i called the office, they said they don\'t have any opening. Seriously??? Shows how they care for their patients once they got their money. Suggested one time which didn\'t work and when asked if they have anything else, they said \"no openings, sorry\". Unbelievable!!!\nWhen i confronted them how easy it was to take my money and now they don\'t have an opening? They finally setup an appointment with another dentist. I wouldn\'t recommend this place at all. ','2016-02-23 15:52:48','Sheetal Berg','https://plus.google.com/103729663847362130014','//lh6.googleusercontent.com/-yNyw_dWX3Rc/AAAAAAAAAAI/AAAAAAAAL-g/le1um6jnb8I/photo.jpg',NULL,51),(370,3,5.00,'I had a great first experience at Redmond Way, having moved to the area earlier this year. Everyone there was very friendly, and I didn\'t wait more than 5 minutes before seeing an assistant. My teeth cleaning was thorough but not painful.\n\nThe dentist has a good eye--he caught a cavity that didn\'t show on the x-ray. When it came time to fill it, I felt no pain during or the days after. Most impressive to me was that the dentist called to follow up and ask how I was doing. I\'ve never had that before, at least not at a dentist. \n\nOverall I left very impressed. There\'s a very high level of care and I can tell that the doctor-patient relationship means something to them.','2015-10-10 15:58:37','Jeffrey Turkelson','https://plus.google.com/110229010391727530931','//lh4.googleusercontent.com/-Q8MyXXoMx1k/AAAAAAAAAAI/AAAAAAAAADs/SZy131JCpmY/photo.jpg',NULL,51),(371,1,4.00,'When in DC you have to see where the President sleeps at night!\n\nI wish I could have done the tour but each time I have come, I always miss the tour...','2016-05-04 15:45:37','Kevin W.','d8KR5c1ievS0C53h4fhEeQ','http://s3-media4.fl.yelpcdn.com/photo/C1LgQyTWkNTRxKVpqiqt3A/ms.jpg','31VuAzxc1NwyiIEOThXs7A',24),(372,1,4.00,'I had the Machaca Chimichanga ($7.85). It was a good sized portion with a crispy deep fried tortilla and tender tasty shredded beef inside. The green sauce...','2016-02-18 02:34:18','Sue C.','l-B4axUNxQ9FVVxeQm8t2A','http://s3-media1.fl.yelpcdn.com/photo/5EYemgBrVlx7oSg4uKJgxA/ms.jpg','OS8MVO_R260BqKrhbhYaGw',38),(373,3,5.00,'One of my favorite joints for chimichangas in the valley! Love their machaca or shredded beef chimis. The hot sauce they serve with chips are great for everything else you can order too!\n\nDon\'t forget to get a churro to go for dessert! They fry them fresh when you order!','2016-04-21 17:49:27','Peter Nguyen','https://plus.google.com/100365815492229583514','//lh4.googleusercontent.com/-0Pe84vphXN4/AAAAAAAAAAI/AAAAAAAADrE/AtlntxAuG2E/photo.jpg',NULL,38),(374,3,5.00,'It was really good. The salsa was bomb. ','2016-04-25 22:21:33','Dominic Otto','https://plus.google.com/101184048042938669398','//lh4.googleusercontent.com/-dcYfrRBuQyU/AAAAAAAAAAI/AAAAAAAACKM/_Vr5yx5fmg8/photo.jpg',NULL,38),(375,3,5.00,'Pollo Fundido i