 price of a dish. Highly recommended!','2016-05-09 02:33:28','Brian Mejia','https://plus.google.com/117226602549701979117','//lh3.googleusercontent.com/-r2MJOFhBOWE/AAAAAAAAAAI/AAAAAAAAACc/9Zy7p_IilC0/photo.jpg',NULL,39),(392,3,5.00,'The the deep dish is the show stopper here. I could go on and on about it but I\'ll just say that you need to try it. So just stop what you\'re doing drive here and be prepared to love it. Beer selection here is pretty good too. Some locals available.','2016-02-13 20:45:40','Ryley Thompson','https://plus.google.com/109083790559954147467','//lh5.googleusercontent.com/-7-rJ4bogFjQ/AAAAAAAAAAI/AAAAAAAAHHs/bwGGdsig5d4/photo.jpg',NULL,39),(393,3,1.00,'Waitresses wearing shorts too short. They all keep pulling shorts down any chance they get. They touch their butts when they pull the back of their shorts down and in between their legs while continuing to handle your food. I deliver their food and see it all the time while waiting. Not sanitary at all. It\'s like going to the restroom and they don\'t wash their hands. I\'m not cool with that, if you are go for it.','2016-04-23 21:12:33','Veronica Manriquez','https://plus.google.com/106291397885101187309','',NULL,39),(394,3,5.00,'One of my favorite restaurants in Tempe, with great pizza and a cool old fashioned theme, including black and white TV shows and lots of old memorabilia on the walls.  Tons of excellent food, and priced right for a date night or even just casual meals with friends.','2016-03-28 23:26:19','Rick Maffei','https://plus.google.com/102587726924326028564','//lh5.googleusercontent.com/-JJtrwbXjdB4/AAAAAAAAAAI/AAAAAAAAH0Y/P7Mwb2Ybu_I/photo.jpg',NULL,39),(395,3,5.00,'All the food is good to Great. Huge portions for the price.  Service rivals Cheesecake Factory for best in town.  They have amazing customer service on par with any high end restaurant.  I can recommend any of their salads, pasta or their Italian Gold wings are super moist and tasty. One of my favorite pizzas in the valley is their Clark Street meat pizza!  It is a little pricey but really good.','2015-09-23 16:45:39','Roger Judd','https://plus.google.com/111557715709317705491','//lh6.googleusercontent.com/-MdAtvUNZez4/AAAAAAAAAAI/AAAAAAAAG4k/RGwjblmaCzM/photo.jpg',NULL,39),(396,1,5.00,'Amazing pizza; decent prices, especially if you just want an individual pizza.  For vegetarians, the salads are beautiful--an artful blend of fresh greens,...','2016-02-29 17:20:42','James R.','OqsVrbWHCOQR8XnjxNRIrQ','http://s3-media2.fl.yelpcdn.com/photo/vyFcBva82QjsZQcW75E-2w/ms.jpg','U6Qjfj4vIUMoRPhZHKPUgg',40),(397,3,5.00,'Very nice and clean establishment. The pizza is perfect and under Chelsea salad is amazing! I will return... Enjoy bitches! ','2016-03-19 21:59:30','Bola Grande','https://plus.google.com/108907392218511101721','//lh6.googleusercontent.com/-SnMEaNOTEic/AAAAAAAAAAI/AAAAAAAAAEs/mOJRNgNveBU/photo.jpg',NULL,40),(398,3,5.00,'Joe was our waiter person and he was amazing!! He was so friendly service was perfect! And the food was absolutely delicious! 5 stars all the way and I\'ll definitely be back! Thanks so much guys for the great first experience!\n','2015-12-08 21:35:53','TIanna Hemeyer','https://plus.google.com/111325109440109759749','',NULL,40),(399,3,5.00,'Got a Calzone from here and it was very good. I arrived a couple mins early and was given a complementary fountain drink because the order wasn\'t ready yet. Staff was great and the venue was nice.','2016-02-09 02:24:03','Ahmad Darwish','https://plus.google.com/108292141683258253237','//lh3.googleusercontent.com/-Y7E5SAootBY/AAAAAAAAAAI/AAAAAAAAABQ/BqF8Kjrw6og/photo.jpg',NULL,40),(400,3,5.00,'Ordered delivery for the whole office today. Everyone loved it. Prompt delivery, and pizza was perfect.','2016-04-28 00:35:08','James Smith','https://plus.google.com/102126911222021399493','//lh5.googleusercontent.com/-Ey1X_CoYlwA/AAAAAAAAAAI/AAAAAAAAC2Y/KLu1H9jo0dQ/photo.jpg',NULL,40),(401,3,4.00,'Food was good and the service was