for around 15 minutes while thinking how long does it take to get one slice of cheese pizza. I asked the waitress/cashier if it was done and she very rudely told me it was baking. then she walked into the back and immediately came out with the pizza already wrapped in aluminum foil. apparently the pizza had been done the whole time for some reason they had me waiting. I highly suggest no one wastes their time in this establishment as the food I have tasted isn\'t good and the service speaks for itself. If you have all evening to wait for one slice of cheese pizza be my guest.','2015-10-22 17:23:41','David Morgan','https://plus.google.com/101472466244895774626','//lh6.googleusercontent.com/-bh42c3L1LOc/AAAAAAAAAAI/AAAAAAAAALo/qdFYL6kRdYc/photo.jpg',NULL,57),(407,3,4.00,'Wonderful Crispy Crust!!!\n\nBased on a recommendation I stopped in at Otto\'s for pizza today. I arrived just as they opened and there were no other customers at that point. The young lady behind the counter greeted me with a smile as I entered. I could see Otto behind her by the oven, and was glad he was making my pizza today. There is no table service, so you order at the counter. I placed my order to eat there, and picked a table to sit at. \n\nMy half Otto\'s Veggie and half Otto Philly pizza was brought to me fairly quickly, and it looked delicious! The toppings looked fresh, it was piping hot, and the pizza crust around the edges looked puffy, crisp and light. I decided to start with the Otto\'s Veggie side of the pizza.\n\nThe crust was light and crisp and thin - even at the center of the pizza! I don\'t recall ever having a crust like it. It was delicious! Beyond the crust, the balance of toppings was perfect, and the flavor was wonderful. When I finally ate my way to the puffy crispy crust at the edge, it was marvelous. That\'s the part I don\'t usually eat, but this was so good that I had to eat it. The Otto\'s Philly side of the pizza was just as good as the Veggie side, with a nice balance of toppings. \n\nBy the time I was having my third slice, I noticed that there was a line of customers from the counter all the way back to the door. I had been so absorbed with my pizza that I hadn\'t noticed them. It was a good move to arrive when they first opened because there are only a few tables, and most everyone was eating there rather than ordering to go. \n\nWith only Otto and one counter person working, I had to wait until everyone in line had placed their orders to be able to ask for a box to take the rest of my pizza with me. I think that the next time I\'ll ask to have it served in the box so that when I\'m ready to leave, I\'m all set and don\'t have to wait.\n\nAll in all, I had a great lunch. I\'d like to try some of the other items on the menu. ','2015-07-21 16:23:11','Terri S','https://plus.google.com/118230225966267285863','//lh4.googleusercontent.com/-qllUEysZFk4/AAAAAAAAAAI/AAAAAAAAABM/mVKpvaKuQrA/photo.jpg',NULL,57),(408,3,5.00,'Hands down pizza up best pizza in the world the doe sauce and family show much soul God bless  ','2016-02-07 23:51:15','mark vosburg','https://plus.google.com/106074050187300802560','',NULL,57),(409,1,5.00,'Excellent food.  Our delivery guy forgot the marinara sauce for my calzone and I told him it was okay but he insisted on running back to the store and...','2016-01-21 23:21:20','Aiden M.','OOkHR1UjryoaejOgCvbwrQ','http://s3-media4.fl.yelpcdn.com/photo/JsIS01oAUttzy8pSwYVUvQ/ms.jpg','JXbBFUDNF83OTX8qcg4xkw',42),(410,3,1.00,'Well guys, it\'s unfortunate when you\'re having a rough day and hoping for some good food so you order it. But you never get it!\n\nBasic story: Ordered delivery online, called 10 min later for confirmation cause we didn\'t recieve one. Women who answered was rude and in a rush, but apparently they did have the order AND THE PAYMENT. \n\nAfter 1 hour 45min, we make the call and ask where it is. Same evil, rude girl answers the phone and hands me over to the manager, Michael. \"The employee must have ACCIDENTALLY switched it to pickup, I\'m sorry. But here\'s your options, have it remade and delivered, give you a credit or refund.\" \n\nUmmmmmm, NO. the correct action, in my opinion, is to have it remade sent over or ill pick it up(since I\'m no longer in the middle of stuff 2hrs later) AND refund my money! Or make some kind of effort to correct this. \n\nHow are you going to be ok with a two hour wait come to find out that its sitting under heat lamps the WHOLE TIME. \n\nSo this order was for myself and my two roomies. Once I got home I called and spoke with the \"GM MICHAEL HAYDEN\" who was anything but. Yes, he felt that he solved the situation but in reality he didn\'t.  I was asking to remake it and ill go get it. \"No. I don\'t give free pizza away. Idk what happened before but you gon hav ta pay fa dis\". Literally exactly like that. (No offense intended, I\'m trying to portray the tone and attitude in his voice)\n\nSo his idea to solve it is not take responsibility, offer a \"credit\" for next time and proceed to deliver the \"old pizza\" in his words. \n\nAt the end of the day we placed an order at around 5pm and got a 4hr old pizza delivered at 9:30 pm. \n\nHorrible. My first and last time dealing with this store. ','2016-05-07 21:33:01','Mikaya Oliver','https://plus.google.com/100102061104112347869','',NULL,42),(411,3,1.00,'Without a doubt the worst fast food experience I have encountered. My bf ordered a 30 count boneless wing and they gave us bone in.  Not a big deal my bf called back let them know about the mess up and John said he could either get us a refund or he could send out a boneless wing but we had to give the bone in back. Again not a problem. The problem occurred when my boyfriend continuously called the store to check on the order it wasn\'t until 4 hours later that the manager told us to have better luck next time and hung up on him when he asked for corporates number. The manager was very rude and hung up on my bf after he just spent $23 on wings. So we wasted money and I have a whole 30 count of wings sitting in my fridge. Definitely need to learn better customer service. I usually don\'t write reviews but this really angered me to the point of doing so ','2016-02-05 06:00:22','Hanna David','https://plus.google.com/100208933925607477345','',NULL,42),(412,3,3.00,'The quality can definitely be spotty. But I\'ve never had a pizza that\'s horrible, or inedible. Love their free flavored crusts! I always get the Cajun crust, and it\'s amazing, with just the right amount of spice!','2016-04-09 01:00:35','Peter Nguyen','https://plus.google.com/100365815492229583514','//lh4.googleusercontent.com/-0Pe84vphXN4/AAAAAAAAAAI/AAAAAAAADrE/AtlntxAuG2E/photo.jpg',NULL,42),(413,3,1.00,'Horrible service! They messed up my order and sent me two pepperonI instead of a cheese and pepperoni  and told me to wait an hour for my pizza to exchange one of the pizzas. I\'m a vegetarian, so I couldn\'t even eat thw pizza I paid for. That\'s stupid since they messed up my order! Never ordering here again!','2015-12-06 20:24:48','Bri Freeman','https://plus.google.com/115807720225913825647','//lh5.googleusercontent.com/-C7KsLDC7d_M/AAAAAAAAAAI/AAAAAAAAJIw/eOR05SSisTI/photo.jpg',NULL,42),(414,3,1.00,'Its the worst thing i\'ve ever experienced. The customer service is so arrogant. Never order delivery again!!','2016-03-20 04:21:59','karthik reddy','https://plus.google.com/107359615373896907545','',NULL,42),(415,3,5.00,'Ordered pizza,wings, and fried pickles for delivery. All was very tasty and still hot. Great customer service and experience all around, will order again!','2016-05-08 21:44:34','T.D. A','https://plus.google.com/111447612912492199278','//lh4.googleusercontent.com/-28EvFVjcGRs/AAAAAAAAAAI/AAAAAAAAFAs/7inl2emEYsc/photo.jpg',NULL,58),(416,3,4.00,'Pretty good.','2016-04-22 21:07:08','Christopher Campbell','https://plus.google.com/114669681555518781164','',NULL,58),(417,3,5.00,'The cheese is amaaaaazing','2016-01-13 13:40:04','Tanner Comes','https://plus.google.com/100500701490157026375','//lh3.googleusercontent.com/-diGLjrX6CG8/AAAAAAAAAAI/AAAAAAAAAKI/pDqoMt2hG2g/photo.jpg',NULL,58),(418,1,5.00,'Favorite pizza in Tempe. Hole in the wall with tons of character. You can\'t eat in, but to be honest, you probably wouldn\'t want to. \n\nThere\'s a theory...','2016-03-11 18:35:37','Alexander A.','euGWNOWykR9fLSdsnX_jtQ','http://s3-media1.fl.yelpcdn.com/photo/PXALOBzqLDJfx3lmMKaYHQ/ms.jpg','xj88ep2EhepZHgHmw7pOXg',59),(419,3,1.00,'DONT ORDER ANYTHING ONLINE! New to the area, neighbor referred me to Oliveo\'s. Had nothing but great things to say about them, open late, and deliver. Ordered online Saturday evening, woke up sunday morning, checked with front desk security(maybe they attempted to buz my door and I just slept through it), nope. Checked mobile bank app, they certainly did take my money. I called them that afternoon to try and get a refund, cant get a hold of them. I get a phone call from their delivery guy at 5pm the next day(sunday) saying he\'s outside with my fodo. I told him I tried calling about it, couldn\'t get a hold of anyone. I was advised that it happens all the time and that someone would be contacting me so I can be refunded my money. Have called several times today(Monday) and phone just rings and rings. I normally don\'t ever leave bad reviews, I\'m just not sure how else to get a hold of anyone.','2016-05-09 18:09:37','Tim Plaza','https://plus.google.com/110953295862420486132','',NULL,59),(420,3,1.00,'Great food, however the delivery charge is slowly increasing over time.\n\nOnce upon a time the driver received the charge (or most of it)\n\nNow for the 4.50 they charge you the driver gets .50 meaning if you wish to tip the driver that extra fee is 9.50 on a $20 order!\n\nLoyal customer lost.','2016-05-13 22:07:58','teknik12k','https://plus.google.com/107489132715445936725','//lh6.googleusercontent.com/-xWnE4jTsT7c/AAAAAAAAAAI/AAAAAAAAAIQ/cuKAxBLiLxI/photo.jpg',NULL,59),(421,3,4.00,'Polite gentleman working. very chatty and kind with my kids.\nGreat pizza. ','2016-04-17 00:21:54','Elizabeth Hohn','https://plus.google.com/112126883788953830031','',NULL,59),(422,3,1.00,'Super oily on bottom of crust for pizza.  Meat on cheese steak tasted bad.  Fries on flier were steak fries and got shoestring.  Was put on hold twice while ordering and waited an hour and a half for delivery.','2016-01-30 18:08:04','Ali Lemons','https://plus.google.com/116218487944813713783','',NULL,59),(423,3,5.00,'Great service and pizza is excellent!!','2016-04-06 20:36:20','Gina Burns','https://plus.google.com/111956970987162051708','',NULL,59),(424,1,5.00,'This place is well worth the chance you are taking. Got a few $5 pizzas for the office. Pizza showed up hot and fresh. They even went out of their normal...','2015-12-27 01:27:37','Doc V.','BLo7mPbAU1kQoDl87VxSEQ','http://s3-media4.fl.yelpcdn.com/photo/gE5Rxng8B2OrVMHKuD9_tw/ms.jpg','zfjrvKxX3QIlJl4_vp427Q',60),(425,3,3.00,'We moved to Tempe a couple of months ago and have ordered Jimmy\'s at least 6 or 7 times since then. I left my first review on yelp explaining  that in truth the food really isn\'t bad, but the quality will vary depending on what you order. Some people leave reviews like this is the worst pizza in the world, and honestly I think some of them are either unrealistic and expect too much, or had a poor experience and cannot differentiate horrible food from horrible service (yes, they are mutually exclusive). \n\nFrom having ordered so many times, I can tell you this:\n\nDelivery is normally within good time, with the exception of the afternoon around 4 to 6pm, at which times I have received my food about an hour to 1.5 hrs after I ordered. I was not compensated but I did receive an apology. No, an apology does not fill your tummy, but I survived. \n\nFood is decent. Pizza is relatively comparable to all the other $5 pizza places you\'ll encounter. Personally,  think Little Caesar\'s tastes a bit better pizza wise, but they definitely don\'t have a better deal as far as special\'s and options go. Jimmy\'s pizza\'s have a good amount of cheese, they don\'t go heavy on the marinara, and the toppings are a proportionate size. The cheese doesn\'t stretch, but the flavor is decent. Understand, I\'m not a huge pizza fan but I have had some bomb pizza in the past from either authentic, or artesian pizzeria\'s, as well as hole-in-the-wall spots that would knock your socks off. Good pizza doesn\'t just fall out of the sky, nor does it cost $5, so I suggest getting your expectations together before you order. This place is good. It\'ll feed your family and fill your tummy. They\'re not trying to win the 4 star Michelin list, it\'s just simple, everyday street food at a less-than-exploitative price. \n\nWhen ordering, I personally avoid the Chicken Ranch BLT and the Cajun bread sticks. I found the chicken excruciatingly dry and felt the sandwich was under dressed, and Cajun bread sticks, though good in theory, only work if they actually taste well. The execution here wasn\'t great, like it really, really wasn\'t. Ours came without sauce which made it worse, so maybe consider a new direction with that one? Like maybe frying them or adding a specialty dipping sauce? Something.... \n\nPrice works for me. I have three teenagers and don\'t always feel like cooking, and we all know teenagers eat like goats (devour anything in their path), so personally I find Jimmy\'s to be a convenient option. Their favorite is the Buffalo Chicken Sandwich, which I can attest is actually pretty good. My kids have never complained, so I\'m good. Thanks for reading.','2016-05-11 18:31:55','Mia Enemeratu','https://plus.google.com/107487069855275467385','//lh6.googleusercontent.com/-1NYG0aVcl3c/AAAAAAAAAAI/AAAAAAAAABY/uXJ8ebIvz5s/photo.jpg',NULL,60),(426,3,4.00,' Big Jimmy Pizza is good, they have best prices in tempe and the quality of there pizza is just as good as the other pizza shops if not better  wata go big Jimmy you guys are bomb bay','2016-02-22 23:49:03','Nathan Zachary','https://plus.google.com/114846732613263994687','',NULL,60),(427,3,5.00,'Delcious pizza with good priceing and amazing chicken wings','2015-12-06 21:38:09','Dario Puente','https://plus.google.com/116209532355581564198','//lh5.googleusercontent.com/-WXwcLvoAsAg/AAAAAAAAAAI/AAAAAAAAABI/JepKVz4_05A/photo.jpg',NULL,60),(428,3,5.00,'The Pizza have\'s great flavor of the pizza sauce, The cheese is very splendid (good),\n Their crust flavors are so good and delicious.... Yummy pizza ever.','2015-08-22 17:34:57','Rhamses Barbour','https://plus.google.com/113739065834824742541','//lh3.googleusercontent.com/-_DkmHgr4M6w/AAAAAAAAAAI/AAAAAAAAAFE/TbH3qGnz8pw/photo.jpg',NULL,60),(429,3,5.00,'Me and my friends have been getting pizza here for the last 3 years of my college career. I used to live a short walk away. Now it\'s a 15 min drive and I still get my pizza here because it has the best value of any type of food in Tempe.  No other $5 pizza gives you as much (by weight: little ceasers and hungry howies are both significantly lighter). I\'ve had a meh pizza here and there over the years. But on average, I prefer the taste to most places. I always just get pizza and always carryout so keep that in mind. But they\'ve only made a mistake like twice out of dozens of pizzas. It\'s consistently ready in 10-15 min. I\'m graduating so you guys give this place some love for me when I\'m gone. Sun devil out.','2015-04-09 04:13:30','Nathan Lang','https://plus.google.com/109466423017557932004','',NULL,60),(430,1,5.00,'Dr Mojaver and his amazing staff treats you like family. He has all the latest technology and knows how to be effective in treating you. Another bonus is...','2016-03-05 13:57:47','Gregory C.','CboWkxXSMYSspYqS8ZTt9A','http://s3-media3.fl.yelpcdn.com/photo/4_-WofLpX-huOjX6AveMYg/ms.jpg','h2RfpXxbyX9G9VkUXhPQ3A',43),(431,3,5.00,'Honestly one of the best dentists I\'ve ever had!! Kind and caring staff that accommodate my busy schedule and my cowardliness :)  My daughter even likes going!\nDr. Mojaver is always around if you have questions, and the staff tries to make every appointment on-time and speedy so you\'re in and out.  I definitely recommend choosing these guys as your dentist.\nThey even donated 150 toothbrushes to my office food drive for the holidays!!\n  ','2015-12-29 16:46:57','Shannyn Bessette','https://plus.google.com/111454015901366889107','//lh6.googleusercontent.com/-ZUTDv2EDqt4/AAAAAAAAAAI/AAAAAAAAFNo/h-EqgRbACWk/photo.jpg',NULL,43),(432,3,5.00,'Dr. Mojaver and his staff  have always accommodated me and my family, even on short notice,\nWe are very pleased and would highly recommend Modern Dentistry of Torrey Hills','2016-02-15 22:34:55','John Heine','https://plus.google.com/116134455161215945699','',NULL,43),(433,3,5.00,'Dr. Mojaver and his team are the absolute best. A great experience every time we go. No one in my family ever dreads going to the dentist now!','2015-12-28 14:21:51','Drew Isaacman','https://plus.google.com/114303106825729374048','//lh3.googleusercontent.com/-ZSecZ98eriw/AAAAAAAAAAI/AAAAAAAAGcE/FzWFNcCpnvY/photo.jpg',NULL,43),(434,3,5.00,'Great experiences!  I have been multiple times... my whole family goes and finds the care most excellent.  Dr. Amir is good with my boys 11 and 13... My wife is satisfied too.  We appreciate the recommendations given by Dr. Amir, but no pressure to fix everything until absolutely necessary.  State of the art equipment, methods, interventions... The necessary concern for well being is evident... all staff present as professional and kind.  Therefore, we highly recommend Modern Dentistry for all your dental needs. ','2015-07-07 15:17:52','Randall Torres','https://plus.google.com/118115105308197481317','//lh6.googleusercontent.com/-fPv4m3eLFJU/AAAAAAAAAAI/AAAAAAAAA-M/MFuwYAPfHwE/photo.jpg',NULL,43),(435,3,5.00,'I had a terrific experience at this practice! Dr. Amir Mojaver is a kind, knowledgeable, and modern dentist and is surrounded by an accomplished staff.  I highly recommend!','2015-03-05 18:35:32','Shelley Lyford','https://plus.google.com/116520427518183811388','//lh4.googleusercontent.com/-cgXg6PrRJZY/AAAAAAAAAAI/AAAAAAAAGlo/DFPQlAjCFHg/photo.jpg',NULL,43),(436,1,5.00,'at this point if you don\'t know about this place we must of been living underneath a rock... Or really high. \n\n This place is the bomb. Come by and enjoy a...','2016-05-27 00:07:41','Shawn P.','SsYDYuT792irBRoGpcOmrA','http://s3-media3.fl.yelpcdn.com/photo/UOC7HyBLdZwG4Lag10Q0RA/ms.jpg','xmWqq3x1215FnSaLUu2G3g',23),(437,3,4.00,'Always a great sub here, first time here was in 2000, and since then they have expanded into my home state of Colorado. It was good the first time and great all the other times. Quality has improved with age.','2016-05-26 11:00:33','Brandon Gelroth','https://plus.google.com/107761347484285044939','//lh3.googleusercontent.com/-Oy-i1eHQkLU/AAAAAAAAAAI/AAAAAAAAABM/QGGXbNUgrGI/photo.jpg',NULL,23),(438,3,5.00,'First time eating here, food is awesome. I got the blunt chicken ranch and it immediately became my new favorite food. Subs probably going to make me bankrupt! Hahahaha','2016-05-21 22:48:55','Andrew Flores','https://plus.google.com/108807996999594099793','//lh4.googleusercontent.com/-edY5fdInT-c/AAAAAAAAAAI/AAAAAAAAKXk/GTIoe_2WPrk/photo.jpg',NULL,23);
