:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress Planet - http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"item\";a:50:{i:0;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"Post Status: A Day of REST is going to Boston\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=22279\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"https://poststatus.com/day-of-rest-boston/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3963:\"<p>I&#8217;m happy to announce that Post Status is teaming up with Human Made to put on <a href=\"https://adayofrest.hm/boston-2016/\">A Day of REST Boston</a>, following the <a href=\"https://poststatus.com/a-day-of-rest-review/\">successful event in London in January</a>. This iteration of A Day of REST will include both a day long conference and workshops catered to developers interested in using the WordPress REST API.</p>\n<p>Like in London, A Day of REST Boston will havespeakers from the team that is actually building the API and using it in production environments.The main event will take place <strong>October 28th, 2016</strong>at Calderwood Pavilion. Workshops will be October 27th and October 29th.</p>\n<p><strong>Organizers:</strong> A Day of REST Boston is put together by experienced industry event organizers from <a href=\"https://hmn.md/\">Human Made</a> who have organizedevents like WordCamp London 2013 and 2015, WordCamp Europe 2013, 2014, 2015, 2016, and A Day of REST London. The primary folks from the Human Made team are Siobhan McKeown, Petya Raykovska, and Zoe Beardmore. And Post Status will be co-organizing!</p>\n<p><strong>Speakers:</strong> Like in London, members of the WordPress REST API team itself will be speaking and participating in the event. Also, industry experts and developers who are actually using the REST API in production will be there. We&#8217;ll have a call for speakers available soon as well, as we&#8217;re seeking new and exciting examples of the REST API out in the wild, and the stories of the folks that made it happen.</p>\n<h3>Workshops</h3>\n<p>One of the things I&#8217;m most excited about for the Boston-based version of this event is that there will be <em>two days of workshops</em> in addition to the event, rather than a hack day. It was clear in London that there was demand for more hands-on activities to allow people (new and experienced with the API) to dig deeper.</p>\n<p>Attendees will have the opportunity to attend front end workshops tailored to WordPress developers, covering everything from JavaScript basics to in-depth explorations of specific technologies. A Day of REST is partnering with <a href=\"https://bocoup.com/\">Bocoup</a>(an incredible Boston basedagency that loves open source technology), and perhaps a few other folks, to put on outstanding workshops.</p>\n<p>If you&#8217;re interested in the event and the workshops, please help us choose the most relevant and valuable workshop topics for you. <a href=\"https://docs.google.com/forms/d/1b8RlgPxD7JaeKVgNErsbxS7vCe_9LMQLAvVaekHiFlY/viewform?c=0&w=1\">Fill out the workshop survey</a> to have your say on what should be included. One workshop day is before the main event, and the other is the day after.</p>\n<p>There will be a special limited batch of Early Bird tickets for the conference, but you have to be <a href=\"https://adayofrest.hm/boston-2016/\">subscribe for A Day of REST Boston email notifications</a>.</p>\n<h3>Post Status involvement</h3>\n<p>At A Day of REST London, I was a general media partner, covering the event and <a href=\"https://poststatus.com/resources/category/events/a-day-of-rest/\">I&#8217;m hosting the videos as we release them</a>. This time around, I&#8217;m a co-organizer. I&#8217;ll be working with sponsors, throwing the after party, and covering the event to a greater degree.</p>\n<p>If you want to sponsor A Day of REST, please <a href=\"https://poststatus.com/contact/\">contact me</a>and check out our <a href=\"https://adayofrest.hm/content/themes/ador-boston-theme/images/ADoRBoston_SponsorPackages.pdf\">sponsorship information package</a>!</p>\n<p>There will also be an opportunity for people to buy a ticket for A Day of REST that includes a <a href=\"https://poststatus.com/club/\">Post Status Club</a> membership! I hope you&#8217;ll consider this event and <a href=\"https://adayofrest.hm/boston-2016/\">sign up for updates</a>. It&#8217;s going to be a lot of fun.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Apr 2016 14:02:36 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: Giant Wapuu Among the Attendees at WordCamp London 2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53480\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"http://wptavern.com/giant-wapuu-among-the-attendees-at-wordcamp-london-2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2578:\"<p>This past weekend, hundreds of people gathered at <a href=\"https://2016.london.wordcamp.org/\">WordCamp London 2016</a> to learn about WordPress. One of the attendees who made its presence known the day of the event was a giant Wapuu. From left to right is WordPress co-creator Mike Little, Wapuu, and Jenny Wong. Notice how Wapuu has its own name badge!</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/GiantWapuuatWordCampLondon.jpg\"><img class=\"size-full wp-image-53506\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/GiantWapuuatWordCampLondon.jpg?resize=1024%2C683\" alt=\"Giant Wapuu at WordCamp London\" /></a>Giant Wapuu at WordCamp London\n<p>Tim Nash, Platform Lead for <a href=\"https://www.34sp.com/\">34SP</a>, a managed WordPress hosting company and sponsor of the event, says that the company wanted to do something unique to bring smiles to attendee&#8217;s faces.</p>\n<p>&#8220;It turns out that a Wapuu is not easy to find, but once we told it how awesome an event it was going to be and how much effort the WordCamp London organizing team was putting in, it agreed to make an appearance,&#8221; Nash said.</p>\n<p>According to reports on Twitter from attendees, Wapuu is great at giving hugs, posing for selfies, and spreading cheer.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\"><a href=\"https://twitter.com/hashtag/Wapuu?src=hash\">#Wapuu</a> inside WordCamp London <a href=\"https://twitter.com/hashtag/wcldn?src=hash\">#wcldn</a> <a href=\"https://twitter.com/hashtag/opensource?src=hash\">#opensource</a> <a href=\"https://twitter.com/hashtag/wordpress?src=hash\">#wordpress</a> <a href=\"https://twitter.com/hashtag/cms?src=hash\">#cms</a> <a href=\"https://t.co/9iQLifP4JN\">pic.twitter.com/9iQLifP4JN</a></p>\n<p>&mdash; Riccardo Severgnini (@rickysev) <a href=\"https://twitter.com/rickysev/status/718875567169396736\">April 9, 2016</a></p></blockquote>\n<p></p>\n<p>Although it looks like a stuffed animal, it&#8217;s actually a suit with someone inside. When asked who the person was inside, Nash replied that it was a secret. So where is Wapuu headed next?</p>\n<p>&#8220;Sadly with WordCamp London over, Wapuu has returned to roam the land near Manchester in the North of England until the next time it wants a holiday. Rumor has it, that it might be at <a href=\"https://2016.brighton.wordcamp.org/\">WordCamp Brighton</a> in July,&#8221; Nash said.</p>\n<p>Considering the size of airline seats, don&#8217;t expect to see giant Wapuu at WordPress events in the US anytime soon.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 12 Apr 2016 11:34:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"WPTavern: In Case You Missed It  Issue 7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=53287&preview_id=53287\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://wptavern.com/in-case-you-missed-it-issue-7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:8967:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png\" rel=\"attachment wp-att-50955\"><img class=\"size-full wp-image-50955\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png?resize=676%2C292\" alt=\"In Case You Missed It Featured Image\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/112901923@N07/16153818039\">Night Moves</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc/2.0/\">(license)</a>\n<p>Theres a lot of great WordPress content published in the community but not all of it is featured on the Tavern. This post is an assortment of items related to WordPress that caught my eye but didnt make it into a full post.</p>\n<h2>Revolution Slider Possible Cause of Data Breach</h2>\n<p>Wordfence <a href=\"https://www.wordfence.com/blog/2016/04/mossack-fonseca-breach-vulnerable-slider-revolution/\">analyzed the Mossack Fonseca website</a> and discovered that it was running a <a href=\"http://wptavern.com/critical-security-vulnerability-found-in-wordpress-slider-revolution-plugin-immediate-update-advised\">vulnerable version</a> of Revolution Slider, a popular image slider plugin for WordPress. The vulnerability allows a remote attacker to place a shell on the web server. Whether this is the point of entry for the data leak remains to be seen. While I enjoyed the article, <a href=\"https://news.ycombinator.com/item?id=11449750\">some people on Hacker News</a> ripped it apart.</p>\n<h2>State of the Woo</h2>\n<p>The second annual <a href=\"https://wooconf.com/\">WooConf</a> took place this week where Matt Mullenweg gave the State of The Woo address. Marie Dodson of Torque has <a href=\"http://torquemag.io/2016/04/state-of-the-woo-2016/\">a great post</a> with highlights from his session. The biggest take away is that Automattic plans on releasing a Jetpack like plugin for WooCommerce to handle complicated tasks like payments, shipments, taxes, and more.</p>\n<p>It&#8217;s incredible how many WooCommerce plugins are submitted to us for review. It seems like there&#8217;s a plugin that handles any nuance of WooCommerce you can think of. It&#8217;s turned into quite a cottage industry and one every product developer should consider getting into.</p>\n<h2>WordPress Importer Progress Bars</h2>\n<p>In addition to his work on the WordPress REST API, Ryan McCue is also <a href=\"https://make.wordpress.org/core/2015/11/18/wordpress-importer-redux/\">leading the efforts</a> to improve the <a href=\"https://wordpress.org/plugins/wordpress-importer/\">WordPress Importer</a>. A few days ago, he published an image on Twitter showing off status indicators. Click the play button to see the progress bars in action.</p>\n<p>This is a huge improvement considering it&#8217;s currently impossible to know the status of an import. What&#8217;s nice about this is that each item in the import file has its own progress bar. Also read the discussion on Twitter as the possibility of using this UI for other plugins like BuddyPress comes up.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">New WordPress Importer UI, coming soon. <a href=\"https://t.co/wM6cZY6BSk\">pic.twitter.com/wM6cZY6BSk</a></p>\n<p>&mdash; Ryan McCue  (@rmccue) <a href=\"https://twitter.com/rmccue/status/717610812236410880\">April 6, 2016</a></p></blockquote>\n<p></p>\n<h2>WordPress 4.5 OMG WTF BBQ Post</h2>\n<p>Before every major WordPress release, the <a href=\"https://make.wordpress.org/support/\">support team</a> publishes a post on the support forums that contains important information users and developers need to be aware of. The <a href=\"https://make.wordpress.org/support/2016/04/4-5-omg-wtf-post/\">WordPress 4.5 edition</a> is available and is considered a work in progress. Once 4.5 is released, common issues reported by users are added to the thread like plugin and theme incompatibilities.</p>\n<h2>WP Lift is For Sale</h2>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2013/10/wpliftlogo.jpg\"><img class=\"alignright wp-image-10731 size-full\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2013/10/wpliftlogo.jpg?resize=131%2C58\" alt=\"WPLift.com Logo\" /></a><a href=\"http://wplift.com\">WPLift</a>, a site dedicated to WordPress created by Oli Dale is <a href=\"http://wplift.com/weekly-wordpress-news-wplift-sale\">up for sale</a>. According to the <a href=\"https://flippa.com/6291243-wplift-com\">listing on Flippa</a>, the bidding price has reached $55K. The auction has 13 bids with 19 days left. Dale explains why he&#8217;s selling the site:</p>\n<blockquote><p>Quite simply, I have been writing about WordPress now on WPLift since 2010  I have posted just about every week day in that period and the site now contains over 990 posts, I have been finding it more of a struggle to keep up with running the site alongside ThemeFurnace and the addition of 2 children to my family! I would like someone fresh to takeover WPLift who can dedicate more time and fresh ideas to the site.</p></blockquote>\n<p>Over the years, I&#8217;ve linked to quite a few articles and discussions on the WPLift site. Whoever purchases the site, I hope they continue the great reputation that WPLift has established.</p>\n<h2>What Do Video Games and WordPress Development Have in Common?</h2>\n<p><a href=\"https://twitter.com/JJJ\">John James Jacoby</a> published a great series of Tweets using video game images to relate to software development. Here are a few of my favorites.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">When a great WordPress plugin doesn\'t have very many downloads or active installs: <a href=\"https://t.co/S0GF0p71Bg\">pic.twitter.com/S0GF0p71Bg</a></p>\n<p>&mdash; John James Jacoby (@JJJ) <a href=\"https://twitter.com/JJJ/status/716780629023670272\">April 4, 2016</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Open-sourcing WordPress plugins, and receiving and reading negative feedback: <a href=\"https://t.co/cakym9ATiB\">pic.twitter.com/cakym9ATiB</a></p>\n<p>&mdash; John James Jacoby (@JJJ) <a href=\"https://twitter.com/JJJ/status/716772882580447233\">April 3, 2016</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Oh no! My demo is showing. <a href=\"https://t.co/WVbXJZ3ULK\">pic.twitter.com/WVbXJZ3ULK</a></p>\n<p>&mdash; John James Jacoby (@JJJ) <a href=\"https://twitter.com/JJJ/status/717086881486401537\">April 4, 2016</a></p></blockquote>\n<p></p>\n<h2>Admin Theme Review</h2>\n<p>Jose Castaneda who is a volunteer on the <a href=\"https://make.wordpress.org/themes/\">Theme Review Team</a> published a YouTube video that highlights what he looks for when reviewing themes. The video should help developers consider things they may have missed before submitting it to the directory.</p>\n<div class=\"embed-wrap\"></div>\n<h2>A Small Woorld</h2>\n<p><span class=\"s1\">WooCommerce is a powerful force in the eCommerce industry and it&#8217;s reached a point where entire sites and magazines are devoted to the platform. One such digital magazine is <a href=\"https://smallwoorld.com/\">A Small Woorld</a>, a publication by the folks over at <a href=\"https://prospress.com/\">ProsPress</a>. Small Woorld features in-depth interviews with entrepreneurs using WooCommerce.<br />\n</span></p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/ASmallWoorldFrontPage.png\"><img class=\"size-full wp-image-53454\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/ASmallWoorldFrontPage.png?resize=913%2C742\" alt=\"A Small Woorld Front Page\" /></a>A Small Woorld Front Page\n<p>One of my <a href=\"https://smallwoorld.com/craft-beer-cheeky-kiwis-abroad-woocommerce-honest-brew-story/\">favorite interviews</a> from their latest issue involves <a href=\"http://honestbrew.co.uk/\">Honest Brew</a>, a company that utilizes WooCommerce to deliver craft beer to people all over the world. I highly recommend subscribing to <a href=\"https://smallwoorld.com/\">A Small Woorld</a> if you want to know how every day people are using WooCommerce to run their businesses.</p>\n<h2>8-Bit Wapuu</h2>\n<p>In what is a traditional part of this series, I end each issue by featuring a Wapuu design. For those who don&#8217;t know, Wapuu is the <a href=\"http://wapuu.jp/2015/12/12/wapuu-origins/\">unofficial mascot</a> of the WordPress project. This week, it&#8217;s 8-bit Wapuu byMelissa Sartor representing <a href=\"https://2016.sunshinecoast.wordcamp.org/2016/04/06/8-bit-wapuu/\">WordCamp Sunshine Coast</a> in Australia.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/EightBitWapuu.png\"><img class=\"size-full wp-image-53453\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/EightBitWapuu.png?resize=344%2C310\" alt=\"Eight Bit Wapuu\" /></a>Eight Bit Wapuu\n<p>That&#8217;s it for issue seven. If you recently discovered a cool resource or post related to WordPress, please share it with us in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Apr 2016 21:23:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"WPTavern: Automattic Partners with Lets Encrypt to Enable HTTPS on All WordPress.com Websites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53433\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:103:\"http://wptavern.com/automattic-partners-with-lets-encrypt-to-enable-https-on-all-wordpress-com-websites\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2615:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/green-lock.jpg\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/green-lock.jpg?resize=1024%2C538\" alt=\"photo credit: Padlock - (license)\" class=\"size-full wp-image-53435\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/92818242@N00/6080622\">Padlock</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc/2.0/\">(license)</a>\n<p>WordPress.com <a href=\"https://en.blog.wordpress.com/2016/04/08/https-everywhere-encryption-for-all-wordpress-com-sites/\" target=\"_blank\">announced</a> today that it has turned on encryption for custom domains. The network&#8217;s subdomains have been HTTPS-enabled <a href=\"http://wptavern.com/wordpress-com-to-implement-ssl-for-all-subdomains-joins-the-fight-against-mass-surveillance\" target=\"_blank\">since 2014 as part of the Reset the Net campaign</a> against mass surveillance. Today Automattic expanded HTTPS coverage to more than one million custom domains hosted on the network.</p>\n<p>Last April the company joined Mozilla, Cisco, EFF and several other organizations to <a href=\"http://wptavern.com/automattic-sponsors-lets-encrypt-initiative\" target=\"_blank\">sponsor Let&#8217;s Encrypt</a>, a new free certificate authority for the public. The project gave WordPress.com an automated way to roll out an SSL certificate to each custom domain it hosts. Users do not need to adjust any setting &#8211; encryption has been turned on automatically, which is indicated by a green lock in the browser&#8217;s address bar.</p>\n<p>According to the <a href=\"https://www.eff.org/encrypt-the-web\" target=\"_blank\">Electronic Frontier Foundation</a>, encryption offered via the new initiative will help users defend against surveillance of their content and communications, cookie theft, account hijacking, cookie and ad injection, and other forms of internet censorship.</p>\n<p>WordPress.com representatives said sites may see a performance boost and better Google rankings as a result of the switch to HTTPS. Two years ago Google <a href=\"https://webmasters.googleblog.com/2014/08/https-as-ranking-signal.html\" target=\"_blank\">announced</a> it would begin using HTTPS as a lightweight ranking signal as an incentive for website owners to switch to HTTPS. With the help of the Let&#8217;s Encrypt initiative, many of the technical barriers to adding encryption have been removed. WordPress.com&#8217;s move to provide free HTTPS for all customers helps make the web more secure as the network powers a large chunk of the world&#8217;s websites.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Apr 2016 20:23:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Silk Lite: A Free WordPress Magazine Theme for Fashion Bloggers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53393\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"http://wptavern.com/silk-lite-a-free-wordpress-magazine-theme-for-fashion-bloggers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3807:\"<p>After six months in the theme review queue, <a href=\"https://wordpress.org/themes/silk-lite/\" target=\"_blank\">Silk Lite</a> was approved for the WordPress.org directory and also passed the extra requirements to be counted among the <a href=\"https://wordpress.org/themes/tags/accessibility-ready/\" target=\"_blank\">accessibility-ready themes</a>. This magazine theme was designed with fashion bloggers in mind and features a masonry style grid of posts on the homepage.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/silk-lite.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/silk-lite.png?resize=880%2C660\" alt=\"silk-lite\" class=\"aligncenter size-full wp-image-53408\" /></a></p>\n<p>The basic color scheme for the design is black, peach and marsala (the <a href=\"http://store.pantone.com/uk/en/marsala-2015-color-of-the-year\" target=\"_blank\">Pantone color of the year in 2015</a>). Marsala, according to Pantone&#8217;s color experts, &#8220;translates easily to fashion, beauty, industrial design, home furnishings and interiors.&#8221;</p>\n<p>Silk&#8217;s typography selections combine Google Fonts &#8220;Playfair Display&#8221; for headings and Merriweather for paragraph to create elegant, readable posts. The theme also has built-in styles for intro text, highlighted text, drop caps, and a two-column text layout.</p>\n<p>You will need to install Jetpack to take advantage of the theme&#8217;s custom logo feature, although this will need to be updated when site logos are introduced in WordPress 4.5. The theme also has support for Jetpack&#8217;s Infinite scroll module to load more posts on the homepage and archive pages via the &#8220;View More Articles&#8221; button. The unique sharing button design on single posts are powered by Jetpack&#8217;s sharing module.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/silk-single-post.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/silk-single-post.png?resize=1025%2C749\" alt=\"silk-single-post\" class=\"aligncenter size-full wp-image-53425\" /></a></p>\n<p>Silk offers a menu location at the top of the header for adding links to your social network profiles. It also includes a custom sidebar widget for adding an &#8220;About Me&#8221; section  with an image background. With Jetpack&#8217;s Subscription module active, the widget that allows visitors to subscribe to your newsletter will have a custom design to match the theme.</p>\n<p>Silk includes support for four post formats: Standard, Quote, Image, Gallery, Image. It also supports Jetpack&#8217;s tiled and slideshow galleries.</p>\n<p>The customizer offers a limited number of controls, with checkboxes to enable/disable the following:</p>\n<ul>\n<li>Display single column posts on front page and archives</li>\n<li>Display the featured image on single posts</li>\n<li>Hide search button in top header bar</li>\n</ul>\n<p>The theme is translation-ready and is also compatible with WPML. Translations for the following languages are already available: German, Spanish, French, Portuguese, Norwegian, Turkish, Hebrew, Persian and Japanese.</p>\n<p>Silk Lite was created by <a href=\"https://pixelgrade.com/\" target=\"_blank\">PixelGrade</a>, a Romania-based theme shop. The team specializes in magazine themes &#8211; in fact, the PixelGrade product portfolio has more magazine themes than any other type. Full <a href=\"http://silk-help.pixelgrade.com/support/solutions/articles/4000046908-silk-user-guide\" target=\"_blank\">documentation</a> for all the theme&#8217;s features is available on the PixelGrade website. You can download <a href=\"https://wordpress.org/themes/silk-lite/\" target=\"_blank\">Silk Lite</a> from WordPress.org or via your admin themes browser.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Apr 2016 17:25:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Matt: Culinary Houston\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46412\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"https://ma.tt/2016/04/culinary-houston/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:351:\"<p>The New York Times food section has decided to &#8220;proclaim Houston one of the great eating capitals of America&#8221; and <a href=\"http://www.nytimes.com/2016/04/10/travel/houston-restaurants-where-to-eat.html\">highlighted four great restaurants in town</a>. Houston is really such a great city, it&#8217;s good to see it getting some love.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Apr 2016 16:40:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"WPTavern: My Apple News Publisher Experience Three Weeks Later\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53285\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"http://wptavern.com/my-apple-news-publisher-experience-three-weeks-later\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6879:\"<p>Back in March, I <a href=\"http://wptavern.com/how-to-connect-your-wordpress-powered-site-to-apple-news-publisher\">explained how</a> to connect WordPress powers sites to Apple News. After three weeks of being in the system, here is what I experienced.</p>\n<h2>Stuck in Limbo</h2>\n<p>After configuring the plugin and successfully getting WP Tavern approved on Apple News, I thought that articles published on the site would automatically publish to Apple News. It didn&#8217;t work out that way, at least, not at first.</p>\n<p>When checking the status of those articles in the WordPress backend, the <a href=\"https://wordpress.org/plugins/publish-to-apple-news/\">Publish to Apple News</a> plugin listed articles as Pending. Apple&#8217;s News publisher also didn&#8217;t show any drafts from WordPress or published articles.</p>\n<p>Based on some Google searches, I created and published a new article within the Apple News Publisher app. Unfortunately, it didn&#8217;t show up as a published article and because it was the first one, it had to be approved by Apple News.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/AppleNewsPublisherFirstSubmission.png\"><img class=\"size-full wp-image-53379\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/AppleNewsPublisherFirstSubmission.png?resize=635%2C310\" alt=\"Apple News Publisher First Submission\" /></a>Apple News Publisher First Submission\n<p>The first article published in Apple News was on March 21st. Between March 21st and March 31st, I was stuck in limbo. I had no idea when the article would be approved or at what point in the process I was in.</p>\n<p>With the lack of communication, I started troubleshooting the Publish to Apple News plugin thinking that something was wrong. In the plugin&#8217;s settings, there&#8217;s an option to turn debugging on which sends emails to a specified email address each time an article is published, updated, or deleted with a detailed API response.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/AppleNewsPublisherDebugOptions.png\"><img class=\"size-full wp-image-53380\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/AppleNewsPublisherDebugOptions.png?resize=691%2C250\" alt=\"Apple News Publisher Debug Options\" /></a>Apple News Publisher Debug Options\n<p>I didn&#8217;t receive any emails when articles were published leading me to believe there was a potential communication issue between the Tavern and Apple News. A few days passed by when all of a sudden, I received two emails with debug information.</p>\n<p>I checked the <a href=\"https://apple.news/TQYQeeBHDRce_JL3U0PCWGw\">Tavern&#8217;s Apple News channel</a> and discovered that the first article I published using Apple&#8217;s publishing tool was approved. Had I not checked the channel, I wouldn&#8217;t have known that it was approved. I disabled debug mode in the Publish to Apple News plugin and noticed articles published on the Tavern after the approval appeared as expected.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/PublishedArticlesInApplesNewsPublisher.png\"><img class=\"size-full wp-image-53383\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/PublishedArticlesInApplesNewsPublisher.png?resize=1025%2C757\" alt=\"Published Articles In Apples News Publisher\" /></a>Published Articles In Apples News Publisher\n<p>Apple should send an email notification when the first article is approved along with details that future articles will be published automatically.</p>\n<h2>What Articles Look Like in the Apple News App</h2>\n<p>I kept the default style settings provided by the Publish to Apple News plugin. As you can see, the articles don&#8217;t look that bad with the exception of the WordCamp Central article. For some reason, the image splits up the first sentence of the post. I&#8217;m looking into why this happens but I&#8217;ve seen it on other posts as well.</p>\n\n<a href=\"http://wptavern.com/img_8464\"><img width=\"282\" height=\"500\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8464.png?fit=282%2C500\" class=\"attachment-large size-large\" alt=\"img_8464\" /></a>\n<a href=\"http://wptavern.com/img_8466\"><img width=\"282\" height=\"500\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8466.png?fit=282%2C500\" class=\"attachment-large size-large\" alt=\"img_8466\" /></a>\n<a href=\"http://wptavern.com/img_8468\"><img width=\"282\" height=\"500\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8468.png?fit=282%2C500\" class=\"attachment-large size-large\" alt=\"img_8468\" /></a>\n<a href=\"http://wptavern.com/img_8467\"><img width=\"282\" height=\"500\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8467.png?fit=282%2C500\" class=\"attachment-large size-large\" alt=\"img_8467\" /></a>\n<a href=\"http://wptavern.com/img_8465\"><img width=\"282\" height=\"500\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/img_8465.png?fit=282%2C500\" class=\"attachment-large size-large\" alt=\"img_8465\" /></a>\n\n<p>One thing I don&#8217;t like is that if an image is used at the beginning of an article, the Apple News App displays the HTML code of the image on the article listing page instead of article text. It would be more beneficial to readers if the listing page displayed text from the article and not HTML related to images.</p>\n<h2>Apple News Publisher Analytics</h2>\n<p>According to the analytics dashboard in Apple News Publisher, some of you have subscribed to our channel. The dashboard includes stats like, unique viewers, total views, article shares, and more.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/AppleNewsAnalytics.png\"><img class=\"size-full wp-image-53404\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/AppleNewsAnalytics.png?resize=1025%2C728\" alt=\"Apple News Analytics\" /></a>Apple News Analytics\n<p>You can even dive into analytics on a per post level to determine why some articles do better than others. To view stats in a different program or to back them up, Apple News publisher allows you to download up to 30 days worth of data at once in CSV format.</p>\n<h2>The Experiment Continues</h2>\n<p>There&#8217;s not enough data to determine if publishing articles to Apple News is worth the effort. Three months from now, I&#8217;ll look at the data and publish a follow-up post with our findings. It will also include reviews from readers who are subscribed to our channel to find out what they like and dislike about consuming WP Tavern&#8217;s content through Apple News.</p>\n<p>Although the process could use some improvement, especially around communication, once the approval process is complete, the system runs automatically. Let us know in the comments what your experience has been like connecting your site to Apple News Publisher.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Apr 2016 03:51:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: AffiliateWP Passes 30K in Monthly Revenue After 2 Years in Business\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53352\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/affiliatewp-passes-30k-in-monthly-revenue-after-2-years-in-business\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4968:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/affiliatewp.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/affiliatewp.png?resize=1025%2C463\" alt=\"affiliatewp\" class=\"aligncenter size-full wp-image-53362\" /></a></p>\n<p>The team behind <a href=\"https://affiliatewp.com/\" target=\"_blank\">AffiliateWP</a> is <a href=\"https://pippinsplugins.com/affiliatewp-two-years-later/\" target=\"_blank\">celebrating its second anniversary today</a>. The plugin and its suite of add-ons has rapidly become one of the most successful products in the WordPress ecosystem under the leadership of Pippin Williamson and his team.</p>\n<p>Williamson, who is known for his yearly transparency reports, shared that AffiliateWP was the fastest of his products to reach $100,000 in annual revenue. It took just nine months for the plugin to reach that goal and in 2015 it passed $30,000 in monthly revenue.</p>\n<p>&#8220;Our first month to break $30,000 was April, 2015, when we brought in $32,904.90,&#8221; Williamson said. &#8220;Since then, we have had only 3 months that were below 30, and they were only just barely below the 30 mark.&#8221;</p>\n<p>They say that necessity is the mother of invention, and this was certainly the case with the creation of AffiliateWP. Williamson said that his customers were always asking for recommendations on affiliate plugins but at the time his team could not confidently recommend any of the existing solutions. They found most to be &#8220;unreliable, unpleasant to use, and generally not a good fit.&#8221;</p>\n<p>&#8220;After a particularly painful support ticket where it was discovered that one of our customers had paid (or not paid) thousands of dollars to the wrong people due to a bug in their affiliate tracking plugin, we decided to do something about it,&#8221; Williamson said.</p>\n<p>He worked in his spare time and late at night to develop AffiliateWP while supporting EDD and Restrict Content Pro during business hours. The product&#8217;s revenue now supports a full-time team of six people.</p>\n<p>&#8220;It humbles me to think that my little side project could go from an after-hours project to providing for the full time jobs of an entire team,&#8221; Williamson said.</p>\n<h3>AffiliateWP&#8217;s Business Model Helped it Grow Faster than EDD</h3>\n<p><a href=\"https://easydigitaldownloads.com/\" target=\"_blank\">Easy Digital Downloads</a>, Williamson&#8217;s first venture, is touted as having pioneered one of the most wildly successful business models in the WordPress ecosystem, but AffiliateWP was not built on the same model. EDD offers a free base plugin with commercial add-ons available a la carte. AffiliateWP does not have an official free product and is not directly supported by commercial extensions.</p>\n<p>Pricing for the product <a href=\"https://affiliatewp.com/pricing/\" target=\"_blank\">starts at $49 and ranges up to $449</a>, with different packages that include varying levels of support and Professional add-ons.</p>\n<p>&#8220;Utilizing this business model is without any doubt one of reasons AffiliateWP accelerated at the rate it did,&#8221; Williamson said. &#8220;This model has not only been lucrative for us, I personally think its superior in many ways to other models common throughout the WordPress ecosystem.</p>\n<p>&#8220;I like it enough that we recently chose to migrate Restrict Content Pro to the same model,&#8221; he said. &#8220;If I had the opportunity to start over with Easy Digital Downloads, I would almost certainly opt to use the same model there as well instead of selling each add-on individually.&#8221;</p>\n<p>AffiliateWP&#8217;s total revenue for 2015 was $379,078 and Williamson projects that figure to be in the neighborhood of $420,000-$450,000 for 2016.</p>\n<p>The fact that <a href=\"https://github.com/AffiliateWP/AffiliateWP\" target=\"_blank\">AffiliateWP is also available for free on GitHub</a> has not compromised the product&#8217;s success. In fact, Williamson believes it has only enhanced it. The open source plugin has received contributions from 49 different developers.</p>\n<p>&#8220;This is a stat Im particularly proud of considering AffiliateWP is a commercial product, a category of WordPress plugins that tends to get very little development from anyone outside of the core development team of the product,&#8221; Williamson said. &#8220;We chose to make AffiliateWP 100% open on GitHub with a public repository specifically to help facilitate contributions from other developers. I believe firmly that this was a good decision that has worked out quite well for us.&#8221;</p>\n<p>Williamson&#8217;s transparency about his plugin revenue serves as an inspiration to other entrepreneurs in the commercial plugin space. AffiliateWP&#8217;s success is an example of what&#8217;s possible in the WordPress product space with hard work, high quality code, and the right team.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 07 Apr 2016 20:34:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: WPWeekly Episode 229  VersionPress Goes Open Source\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=53277&preview_id=53277\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"http://wptavern.com/wpweekly-episode-229-versionpress-goes-open-source\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3127:\"<p>In this episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I discuss the news of the week, including a big move for VersionPress as it transitions into an open source project. We provide an update on the development status of bbPress and BuddyPress. We also share details of a critical security vulnerability that was patched in a popular user role management plugin. Last but not least is Marcus&#8217; plugin picks of the week.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/versionpress-transitions-into-a-free-open-source-project\">VersionPress Transitions Into a Free Open Source Project</a><br />\n<a href=\"http://wptavern.com/outdated-and-vulnerable-wordpress-and-drupal-versions-may-have-contributed-to-the-panama-papers-breach\">Outdated and Vulnerable WordPress and Drupal Versions May Have Contributed to the Panama Papers Breach</a><br />\n<a href=\"http://wptavern.com/buddypress-2-6-development-kicks-off-david-cavins-to-lead-release\">BuddyPress 2.6 Development Kicks Off, David Cavins to Lead Release</a><br />\n<a href=\"http://wptavern.com/bbpress-2-6-expected-later-this-year-two-major-features-pushed-back-to-2-7\">bbPress 2.6 Expected Later This Year, Two Major Features Pushed Back to 2.7</a><br />\n<a href=\"http://wptavern.com/wp-rest-api-team-aims-for-wordpress-4-7-for-merge-proposal\">WP REST API Team Aims for WordPress 4.7 for Merge Proposal</a><br />\n<a href=\"http://wptavern.com/user-role-editor-4-25-patches-critical-security-vulnerability\">User Role Editor 4.25 Patches Critical Security Vulnerability</a><br />\n<a href=\"http://wptavern.com/europe-tops-wordcamp-growth-in-2015-with-70-increase-in-events\">Europe Tops WordCamp Growth in 2015 with 70% Increase in Events</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/query-all-the-post-types/\">Query All The Post Types</a> provides a quick and easy way to view a list of all the post types registered in a WordPress installation.</p>\n<p><a href=\"https://wordpress.org/plugins/goworks-styler/\">GoWorks Styler</a> adds new buttons to the WordPress visual editor, allowing you to enhance posts and pages with custom colors, opacity, borders, padding, and more.</p>\n<p><a href=\"https://wordpress.org/plugins/chronological-posts/\">Chronological Posts</a> reverses the default post order throughout your site to be chronological instead of reverse-chronological.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, April 13th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #229:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 07 Apr 2016 20:11:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: Limited Edition R2-Wapuu Will Debut at WordCamp London this Weekend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53321\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/limited-edition-r2-wapuu-will-debut-at-wordcamp-london-this-weekend\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2775:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/wcldn-2016-wapuu.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/wcldn-2016-wapuu.png?resize=271%2C300\" alt=\"wcldn-2016-wapuu\" class=\"alignright size-medium wp-image-53327\" /></a>Last year WordCamp London introduced &#8220;Wapuunk,&#8221; its <a href=\"http://wptavern.com/scott-evans-on-designing-the-punk-wapuu-for-wordcamp-london-2015\" target=\"_blank\">1970&#8217;s punk style wapuu</a>, to the world, igniting a new wapuu craze for WordCamps held in the Western hemisphere. The 2015 event had commemorative stickers printed along with a Wapuunk-embroidered scarf for attendees. Shortly thereafter, nearly every WordCamp organization team began designing their own custom wapuu mascots.</p>\n<p>WordCamp London 2016 will take place this weekend at the London Metropolitan University. The event&#8217;s official wapuu will be printed on stickers and may be incorporated into other vintage London-inspired WordCamp swag.</p>\n<p>Wapuu collectors in attendance this weekend will want to arrive at the event early, as a <a href=\"http://gemmagarner.com/blog/illustration/meet-r2-wapuu/\" target=\"_blank\">limited edition R2-Wapuu</a> has also been designed in honor of the WordCamp. UK-based designers <a href=\"http://gemmagarner.com/\" target=\"_blank\">Gemma Garner</a> and <a href=\"http://scott.ee/\" target=\"_blank\">Scott Evans</a> collaborated on the R2-D2-inspired wapuu and printed a small batch of 100 stickers. Approximately 600 people are expected to attend this year&#8217;s event, so only the lucky few who hunt down Garner or Evans will receive an R2-wapuu sticker. An .svg file of the design will be sent to the official <a href=\"https://github.com/jawordpressorg/wapuu/tree/gh-pages/wapuu-archive\" target=\"_blank\">wapuu archive on GitHub</a> if you want to print your own.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/r2-wapuu.jpg\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/r2-wapuu.jpg?resize=500%2C333\" alt=\"r2-wapuu\" class=\"aligncenter size-large wp-image-53332\" /></a></p>\n<p>WordCamp London 2016 will kick off in less than 48 hours. A film crew will be <a href=\"https://2016.london.wordcamp.org/were-making-a-documentary-of-wordcamp-london-2016/\" target=\"_blank\">creating a documentary</a> about this year&#8217;s event, bringing the camera behind the scenes to capture footage that doesn&#8217;t usually make it to WordPress.tv&#8217;s educational archive. The event is nearly sold out. Last minute WordCampers hoping to attend should purchase their <a href=\"https://2016.london.wordcamp.org/tickets/\" target=\"_blank\">tickets</a>  ASAP, because there are only 45 spots remaining.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 07 Apr 2016 00:03:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:112:\"WPTavern: Outdated and Vulnerable WordPress and Drupal Versions May Have Contributed to the Panama Papers Breach\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53292\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:122:\"http://wptavern.com/outdated-and-vulnerable-wordpress-and-drupal-versions-may-have-contributed-to-the-panama-papers-breach\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6275:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/03/security.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/03/security.jpg?resize=1024%2C514\" alt=\"photo credit: Lock - (license)\" class=\"size-full wp-image-40187\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/58441544@N00/2660230441\">Lock</a> &#8211; <a href=\"https://creativecommons.org/licenses/by/2.0/\">(license)</a>\n<p>Authorities have not yet identified the hacker behind the <a href=\"http://panamapapers.sueddeutsche.de/articles/56febff0a1bb8d3c3495adf4/\" target=\"_blank\">Panama Papers</a> breach, nor have they isolated the exact attack vector. It is clear that Mossack Fonseca, the Panamanian law firm that protected the assets of the rich and powerful by setting up shell companies, had employed a dangerously loose policy towards web security and communications.</p>\n<p>The firm ran its unencrypted emails through an outdated (2009) version of <a href=\"https://owa.mossfon.com/\" target=\"_blank\">Microsoft&#8217;s Outlook Web Access</a>. Outdated open source software running the frontend of the firm&#8217;s websites is also now suspected to have provided a vector for the compromise.</p>\n<p>In <a href=\"http://panamapapers.sueddeutsche.de/articles/56febff0a1bb8d3c3495adf4/\" target=\"_blank\">initial communications</a> with German newspaper the Sddeutsche Zeitung (SZ), an anonymous source offered the data with a few conditions, saying that his/her life was in danger.</p>\n<p>&#8220;How much data are we talking about?&#8221; the SZ asked.</p>\n<p>&#8220;More than anything you have ever seen,&#8221; the source said.</p>\n<p>The Panama Papers breach is the largest data leak in history by a wide margin, with 2.6 terabytes of data, 11.5 million documents, and more than 214,000 shell companies exposed.</p>\n<p>Forbes has <a href=\"http://www.forbes.com/sites/thomasbrewster/2016/04/05/panama-papers-amazon-encryption-epic-leak/#83ff3901df59\" target=\"_blank\">identified outdated WordPress and Drupal installations</a> as security holes that may have led to the data leak.</p>\n<blockquote><p>Forbes discovered the firm ran a three-month-old version of WordPress for its <a href=\"http://www.mossfon.com/\" target=\"_blank\">main site</a>, known to contain some vulnerabilities, but more worrisome was that, according to Internet records, its <a href=\"https://portal.mossfon.com/\" target=\"_blank\">portal</a> used by customers to access sensitive data was most likely run on a three-year-old version of Drupal, 7.23.</p></blockquote>\n<p>This information is partially inaccurate, however. While looking at the site today, I found that the firm&#8217;s WordPress-powered site is currently running on version 4.1 (released in December 2014), based on <a href=\"http://mossfon.com/wp-includes/js/autosave.js\" target=\"_blank\">its version of autosave.js</a>, which is identical to the <a href=\"https://github.com/WordPress/WordPress/blob/4.1-branch/wp-includes/js/autosave.js\" target=\"_blank\">autosave.js file shipped in 4.1</a>. Since that time WordPress has had numerous critical security updates.</p>\n<p>The main site is also loading a number of outdated scripts and plugins. Its active theme is <a href=\"http://www.mossfon.com/wp-content/themes/twentyten/css/style.css\" target=\"_blank\">a three-year-old version of Twenty Eleven (1.5)</a>, which oddly resides in a directory labeled for /twentyten/.</p>\n<p>The Mossack Fonseca client portal <a href=\"https://portal.mossfon.com/CHANGELOG.txt\" target=\"_blank\">changelog.txt</a> file is public, showing that its Drupal installation hasn&#8217;t been updated for three years. Since the release of version 7.23, the software has received <a href=\"https://www.cvedetails.com/version/156577/Drupal-Drupal-7.23.html\" target=\"_blank\">25 security updates</a>, which means that the version it is running includes <a href=\"https://www.drupal.org/PSA-2014-003\" target=\"_blank\">highly critical known vulnerabilities</a> that could have given the hacker access to the server. This includes a <a href=\"https://www.drupal.org/SA-CORE-2014-005\" target=\"_blank\">2014 SQL injection vulnerability</a> known in the Drupal community as &#8220;Drupalgeddon,&#8221; which affected every site running Drupal 7.31 or below.</p>\n<p>Investigators have not confirmed if the open source software vulnerabilities were used to access the data, but it is certainly plausible given the severity of the vulnerabilities in both older versions of WordPress and Drupal.</p>\n<p>&#8220;They seem to have been caught in a time warp,&#8221;  Professor Alan Woodward, a computer security expert from Surrey University, told <a href=\"http://www.wired.co.uk/news/archive/2016-04/06/panama-papers-mossack-fonseca-website-security-problems\" target=\"_blank\">WIRED UK</a>. &#8220;If I were a client of theirs I&#8217;d be very concerned that they were communicating using such outdated technology.&#8221;</p>\n<p>If these open source software vulnerabilities provided the access point for this massive leak, then this company&#8217;s global fiasco was entirely preventable. Although many people welcome the uncovering of corruption and dirty money transactions of famous people and world leaders, the reality is that these kinds of exploits can also be carried out on well-meaning organizations that exist to protect people&#8217;s health records, financial data, and other sensitive information.</p>\n<p>This leak is not a measure of open source software&#8217;s reliability but rather underscores how low a priority some companies place on their tech departments and web security. With the rampant software vulnerabilities in this age, not updating software for years constitutes abject neglect of customers.</p>\n<p>The bottom line is that software needs to be updated. This kind of routine maintenance is as foundational to a company&#8217;s business as brushing teeth or showering is for one&#8217;s health. Law firms and companies with such a lax approach to security are either ignorant or unwilling to spend the money to maintain technology that they don&#8217;t fully understand. The Panama Papers serve as a reminder that having a competent, skilled tech department is critical for any company that deals in sensitive information.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 06 Apr 2016 19:35:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"WPTavern: VersionPress Transitions Into a Free Open Source Project\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53260\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"http://wptavern.com/versionpress-transitions-into-a-free-open-source-project\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4228:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/VersionPressFeaturedImage.png\"><img class=\"size-full wp-image-24643\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/VersionPressFeaturedImage.png?resize=650%2C200\" alt=\"Version Control Featured Image\" /></a>Version Control Featured Image\n<p><a href=\"https://twitter.com/borekb\">Borek Bernard</a> and <a href=\"https://twitter.com/JanVoracek\">Jan Vorek</a>, creators of <a href=\"http://versionpress.net/\">VersionPress</a>, <a href=\"https://blog.versionpress.net/2016/04/going-open-source/\">announced</a> that they&#8217;re transitioning the plugin into a free, open source project hosted <a href=\"https://github.com/versionpress/versionpress\">on GitHub</a>. In addition, they are releasing VersionPress 3.0 Beta, the first version released under the new model.</p>\n<h2>Open Source Is the Way Forward</h2>\n<p>In a post on the product&#8217;s site, Bernard explains that the only way for the project to be successful is to open up development to the public.</p>\n<p>&#8220;Towards the end of 2015, we started feeling it was the right time to convert the project to a fully open-sourced one,&#8221; he said.</p>\n<p>&#8220;The project started to be in good shape  had a clear direction set, most of the technical groundwork was laid, and we moved to GitHub. While we had most of WordPress core covered pretty well, there was still this huge ecosystem of WordPress plugins and themes that could cause trouble to VersionPress in millions of different ways.</p>\n<p>&#8220;In the long run, the project <em>had to</em> turn into OSS should it be successful, and fortunately, in 2015, we met investors who understood this and supported our vision,&#8221; Bernard said.</p>\n<p>The transition involved quite a bit of work migrating from Bitbucket and JIRA to GitHub. Old Wiki documents and other assets were migrated as well. In addition to the migration, old issues were translated to English and <a href=\"http://danielbachhuber.com/\">Daniel Bachhuber</a>, who maintains the <a href=\"http://wp-cli.org/\">WP-CLI project</a> audited the code. The project&#8217;s website also received a facelift.</p>\n<p>By transitioning to a public development model, Bernard hopes to tap into new resources to solve challenging problems.</p>\n<p>&#8220;We&#8217;ll need your bright minds to solve some of the more difficult issues later this year, like how to integrate with complex plugins with custom DB structures,&#8221; he said.</p>\n<p>Despite being GPL licensed, free, and open source, the plugin will not be hosted in the WordPress plugin directory anytime soon.</p>\n<p>&#8220;It stays in the &#8216;Early Access&#8217; phase where it works well in certain scenarios but there are still many incompatible plugins, themes and hosts,&#8221; Bernard said. &#8220;There&#8217;s no magic solution to this, unfortunately, and more and more plugins and scenarios will be supported over time.&#8221;</p>\n<h2>Early Access Program Discontinued</h2>\n<p>The Early Access Program, which provided initial funding to develop VersionPress beyond its crowdfunding campaign, is being discontinued.</p>\n<p>&#8220;EAP was of great help but couldn&#8217;t really fund the project, by far,&#8221; Bernard told the Tavern. While the team doesn&#8217;t have a replacement for the revenue provided by EAP, Bernard plans to build exceptional value around the core of VersionPress which he says will remain free forever.</p>\n<h2>How to Follow the Project</h2>\n<p>VersionPress 3.0 beta marks the first major release in more than five months. It includes <a href=\"https://github.com/versionpress/docs/blob/3.0-release-notes/content/en/09-release-notes/75-3.0.md\">bug fixes and a number of enhancements</a>. You can follow the project&#8217;s progress <a href=\"https://github.com/versionpress/versionpress\">on GitHub</a> where you can also <a href=\"https://github.com/versionpress/support\">receive support</a>, browse <a href=\"https://github.com/versionpress/docs\">documentation</a>, and find access to their <a href=\"https://gitter.im/versionpress/versionpress\">Gitter room</a> for real-time communication. Pull requests from the community are welcomed.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 06 Apr 2016 16:22:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: WordCamp Central Now Lets You Track an Events Status\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53258\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"http://wptavern.com/wordcamp-central-now-lets-you-track-an-events-status\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3626:\"<p>Keeping up and monitoring the progress of <a href=\"https://central.wordcamp.org/\">WordCamps</a> in and around your area is now a lot easier thanks to a new <a href=\"https://central.wordcamp.org/application-status/\">WordCamp Application status page</a>. The page indicates a WordCamp&#8217;s city, applicant&#8217;s name, recent milestone, status, and the last time it was updated.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/WordCampCentralStatusTracking.png\"><img class=\"size-full wp-image-53274\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/WordCampCentralStatusTracking.png?resize=969%2C679\" alt=\"WordCamp Central Application Status Tracking\" /></a>WordCamp Central Application Status Tracking\n<p>The application status page is the result of efforts by Ian Dunn and Konstantin Kovshenin who are improving the sites and tools organizers use to coordinate events. On the Make WordPress Community blog, Andrea Middleton <a href=\"https://make.wordpress.org/community/2016/04/05/a-new-way-to-track-the-status-of-wordcamp-applications/\">explains the changes</a> and what deputies can expect.</p>\n<p>Deputies are WordCamp Central volunteers who respond to WordCamp/meetup applications, conduct organizer orientations, and mentor organizers. They work behind the scenes to ensure events are run smoothly and adhere to the <a href=\"https://plan.wordcamp.org/become-an-organizer/representing-wordpress/\">WordPress Foundation&#8217;s guidelines</a>.</p>\n<p>It&#8217;s interesting to see how WordPress is helping the team organize submissions and streamlining the process. According to Middleton, incoming applications automatically create draft listings on WordCamp Central and receive the status &#8220;Needs Vetting.&#8221;</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/WordCampCentralApplicationProcess.png\"><img class=\"size-full wp-image-53273\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/WordCampCentralApplicationProcess.png?resize=768%2C366\" alt=\"WordCamp Central Application Processing\" /></a>WordCamp Central Application Processing\n<p>As the team moves through the process of vetting, orientation, tools, budget reviews, etc, deputies make notes in the post editor which are attached to the application. The site makes use of custom post statuses which are applied based on the application&#8217;s progress. It also adds accountability by saving a change log to each WordCamp listing that indicates when the status is changed and who changed it.</p>\n<p>While this information is specific to those who work with WordCamp organizers, it provides a glimpse into the tools and processes volunteers use to coordinate events. It&#8217;s also a neat look into how handy <a href=\"https://codex.wordpress.org/Post_Status\">custom post statuses</a> are.</p>\n<p>With all of the improvements to the backend, WordCamp and event organizers should experience fewer delays in response times. If you&#8217;re a deputy or frequent browser of WordCamp Central and have a suggestion or request to improve the site, you can share it by <a href=\"https://make.wordpress.org/community/2016/04/05/a-new-way-to-track-the-status-of-wordcamp-applications/\">leaving a comment on the announcement post</a>.</p>\n<p>By the way, community deputies are an excellent way to contribute to the WordPress project without knowing how to code. To learn more about what deputies do and how you can join the program, read the <a href=\"https://make.wordpress.org/community/handbook/community-deputy-handbook/\">community deputy handbook</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 06 Apr 2016 08:18:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"Matt: Western Microbiome\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=46402\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"https://ma.tt/2016/04/western-microbiome/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:534:\"<blockquote><p>Burgers and fries have nearly killed our ancestral microbiome.</p></blockquote>\n<p>I&#8217;ve loved reading microbiome stuff lately, here&#8217;s a good one in Nautilus, <a href=\"http://nautil.us/issue/30/identity/how-the-western-diet-has-derailed-our-evolution\">How the Western Diet Has Derailed Our Evolution</a>. For an older look from the New Yorker, <a href=\"http://www.newyorker.com/magazine/2012/10/22/germs-are-us\">check out this older one about the fascinating journey of<em>helicobacter pylori</em></a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 06 Apr 2016 07:34:48 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"WPTavern: Project Owners Can Now Block Abusive Users on GitHub\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53213\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"http://wptavern.com/project-owners-can-now-block-abusive-users-on-github\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2208:\"<p>Today GitHub <a href=\"https://github.com/blog/2146-organizations-can-now-block-abusive-users\" target=\"_blank\">announced</a> a new feature that allows project owners to block abusive users from public repositories. Users who are blocked will no longer be able to open or comment on issues or pull requests, nor will they will not be able to add or edit any of the project&#8217;s wiki pages. Blocked users are also prevented from forking any of the organization&#8217;s repositories. Blocking goes beyond a simple warning and is a serious capability for project owners to use at their discretion.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/github-blocked-users.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/github-blocked-users.png?resize=1025%2C608\" alt=\"github-blocked-users\" class=\"aligncenter size-full wp-image-53249\" /></a></p>\n<p>Many WordPress plugin authors opt to host their work on GitHub because of the burden of support on WordPress.org. When entitled users have unreasonably high expectations of the free support forum, they sometimes resort to abuse to try to force developers to assist them. At the very least, many abuse the star rating system and use it to communicate disappointment.</p>\n<p>While GitHub caters to a different type of user (usually developers), the site is not immune to abusive users. The new blocking capabilities were added to help project owners encourage positive contributions. One foul user who abuses contributors can poison the well and rob a team of its forward momentum.</p>\n<p>Open source projects often bring together a surprisingly varied array of personalities with differing opinions that can result in heated debates. On occasion, these kinds of conversations can devolve into ad hominem attacks and other unsavory comments. The definition of abuse will vary from project to project, but a definition in the project&#8217;s contributing file may help for the sake of transparency when blocking users. A record of which users have been blocked is added to the organization&#8217;s audit log, so this information is open and available to project contributors.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Apr 2016 23:33:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Europe Tops WordCamp Growth in 2015 with 70% Increase in Events\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53048\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"http://wptavern.com/europe-tops-wordcamp-growth-in-2015-with-70-increase-in-events\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4717:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/02/wordpress-swag.jpg\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/02/wordpress-swag.jpg?resize=1024%2C441\" alt=\"photo credit: Huasonic - cc\" class=\"size-full wp-image-17801\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/huasonic/3008912290/\">Huasonic</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc/2.0/\">cc</a>\n<p>During the <a href=\"http://wptavern.com/state-of-the-word-2015-javascript-and-api-driven-interfaces-are-the-future-of-wordpress\" target=\"_blank\">2015 State of the Word address</a>, Matt Mullenweg shared a few stats that demonstrate the growth of the global WordPress community. A total of 89 WordCamps with 21,000 attendees were held across 34 countries in 2015.</p>\n<p>This week WordPress community organizer Andrea Middleton <a href=\"https://make.wordpress.org/community/2016/03/30/wordcamps-in-2015-the-community-team-edition/\" target=\"_blank\">published a more thorough breakdown of 2015 stats</a>. She noted that while WordCamps have been steadily growing over the past five years, the increase is due to more numerous, smaller events. This kind of growth seems more in line with the intended purpose of WordCamps. Although a few camps stand out as large international events, most are meant to be low-key gatherings that bring together local communities.</p>\n<p>&#8220;We saw a huge jump in WordCamps held in Europe this year  from 17 in 2014 to 29 in 2015,&#8221; Middleton said. &#8220;And a whopping 18 WordPress communities organized their very first WordCamp last year.&#8221;</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">In 9 months, the Italian <a href=\"https://twitter.com/hashtag/WordPress?src=hash\">#WordPress</a> community grew from 0 to 10 meetups and a WordCamp. Standing ovations. <a href=\"https://twitter.com/hashtag/WCTRN?src=hash\">#WCTRN</a> <a href=\"https://t.co/mgXpFV22GS\">pic.twitter.com/mgXpFV22GS</a></p>\n<p>&mdash; Petya Raykovska (@petyeah) <a href=\"https://twitter.com/petyeah/status/716295889116143616\">April 2, 2016</a></p></blockquote>\n<p></p>\n<p>With a 70% increase in European WordCamp events, it no surprise that WordCamp Europe 2016 had to <a href=\"http://wptavern.com/wordcamp-europe-2016-expands-attendee-capacity-to-2200-largest-wordcamp-to-date\" target=\"_blank\">expand its attendee capacity to 2200</a>. The event will be the largest WordCamp to date.</p>\n<p>In 2015, many of the largest WordCamps were held in the US but Europe and Japan also have events ranking in the top five. The ten largest WordCamps (based on number of tickets sold) in 2015 were as follows:</p>\n<ul>\n<li>WordCamp US</li>\n<li>WordCamp Tokyo</li>\n<li>WordCamp Europe</li>\n<li>WordCamp Kansai</li>\n<li>WordCamp NYC</li>\n<li>WordCamp London</li>\n<li>WordCamp Miami</li>\n<li>WordCamp Atlanta</li>\n<li>WordCamp Orlando</li>\n</ul>\n<p>The overall number of tickets sold for WordCamps worldwide is also steadily rising, from 13,000 in 2011 to 21,000 in 2015.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/wordcamps-2015-data.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/wordcamps-2015-data.png?resize=1025%2C411\" alt=\"wordcamps-2015-data\" class=\"aligncenter size-full wp-image-53231\" /></a></p>\n<p>As the global WordPress community continues to expand, the burden on WordCamp Central grows. Overseeing WordCamps and meetups is a full time job. In 2014, the WordPress Community Team established a deputies program to share the load and expanded the number of volunteers to 30 during 2015.</p>\n<p>In the <a href=\"https://make.wordpress.org/community/2016/04/04/the-community-team-quarterly-report-january-march-2016/\" target=\"_blank\">first quarter report</a> for 2016, Middleton reported that the community team helped facilitate nine WordCamps with a total of nearly 4,500 tickets sold. WordCamp Central also signed <a href=\"https://central.wordcamp.org/news/2016/03/28/pantheon-joins-the-wordpress-global-community-sponsorship-program-in-2016/\" target=\"_blank\">Pantheon</a> and <a href=\"https://central.wordcamp.org/news/2016/03/26/godaddy-supports-wordpress-community-events-worldwide-in-2016/\" target=\"_blank\">GoDaddy</a> as global sponsors.</p>\n<p>There are already 24 WordCamps on the calendar for the April-June period and 14 more scheduled for the remaining quarters. Middleton also reported that 31 additional WordCamps have been approved are now in the pipeline at the pre-planning stage.</p>\n<p>&#8220;With WordCamp applications coming in at an average rate of 13 per month, its very likely that well see more than 100 WordCamps in 2016,&#8221; she said.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Apr 2016 20:26:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WP Mobile Apps: WordPress for Android: Version 5.2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.org/?p=3242\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://apps.wordpress.com/2016/04/05/wordpress-for-android-version-5-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3271:\"<p>Hello WordPress users!<a href=\"https://play.google.com/store/apps/details?id=org.wordpress.android\" target=\"_blank\">Version 5.2 of the WordPress for Android app</a>is now availablein the Google Play Store.</p>\n<p>In version5.2, you may notice a difference in fontin the app: we replaced the Open Sans font in theUI with Roboto,the default Android font. For those with a sharp eye, you also might notice that we&#8217;re still usingthe Merriweather font for user-generated content, like reader comments and thecontent in your post editor. (For the typographically curious, take a look atthe <a href=\"https://wordpress.com/design-handbook/typography/\">WordPress.com Design Handbook</a>.)</p>\n\n<a href=\"https://apps.wordpress.com/2016/04/05/wordpress-for-android-version-5-2/mysites-5-1-opensans-2/\"><img width=\"640\" height=\"1067\" src=\"https://apps.files.wordpress.com/2016/03/mysites-5-1-opensans1.png?w=640&h=1067\" class=\"attachment-full size-full\" alt=\"Open Sans (5.1-)\" /></a>\n<a href=\"https://apps.wordpress.com/2016/04/05/wordpress-for-android-version-5-2/mysites-5-2-roboto-2/\"><img width=\"640\" height=\"1067\" src=\"https://apps.files.wordpress.com/2016/03/mysites-5-2-roboto1.png?w=640&h=1067\" class=\"attachment-full size-full\" alt=\"Roboto (5.2+)\" /></a>\n\n<p>Version 5.2 also comes with an updated Account Settings screen. You can changeyouremail address, primary site, and web address in yourapp:</p>\n<ul>\n<li><strong>Email address:</strong> This is yourprimary email address associated with youraccount, which is not publicly displayed. If you update your email address, you will receive an email to confirm it.</li>\n<li><strong>Primary site:</strong> Your primary site is typically the one you most commonly use. You can update your primary site from a popover display with alist of all of your sites.</li>\n<li><strong>Web address:</strong>This is the URL that is shown publicly when youcomment on blogs.</li>\n</ul>\n<p>We also dropped the &#8220;auto-share&#8221; and &#8220;post signature&#8221; settings from this screen.</p>\n<p><img class=\"aligncenter size-full wp-image-3304\" src=\"https://apps.files.wordpress.com/2016/03/account-settings1.png?w=640&h=1067\" alt=\"account-settings\" width=\"640\" height=\"1067\" /></p>\n<p>We&#8217;re working hard on new features for the next versions, and you can track development progress for the next version by visiting <a href=\"https://github.com/wordpress-mobile/WordPress-Android/milestones/5.3\">our 5.3 milestone on GitHub</a>.</p>\n<h1>Thank you</h1>\n<p><a href=\"https://github.com/aforcier\">@aforcier</a>, <a href=\"https://github.com/daniloercoli\">@daniloercoli</a>, <a href=\"https://github.com/hypest\">@hypest</a>, <a href=\"https://github.com/khaykov\">@khaykov</a>, <a href=\"https://github.com/kwonye\">@kwonye</a>, <a href=\"https://github.com/maxme\">@maxme</a>, <a href=\"https://github.com/mzorz\">@mzorz</a>, <a href=\"https://github.com/nbradbury\">@nbradbury</a>, <a href=\"https://github.com/oguzkocer\">@oguzkocer</a>, <a href=\"https://github.com/tetra2000\">@tetra2000</a> and <a href=\"https://github.com/tonyr59h\">@tonyr59h</a>.</p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3242&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Apr 2016 15:30:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Maxime\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"WPTavern: User Role Editor 4.25 Patches Critical Security Vulnerability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53192\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"http://wptavern.com/user-role-editor-4-25-patches-critical-security-vulnerability\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1585:\"<p>Vladimir Garagulya, developer of the <a href=\"https://wordpress.org/plugins/user-role-editor\">User Role Editor</a> has <a href=\"https://wordpress.org/plugins/user-role-editor/changelog/\">patched a critical security vulnerability</a>. User Role Editor is used to edit, manage, and create user roles and capabilities and is active on more than 300K sites.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/UserRoleEditorScreenshot.png\"><img class=\"size-full wp-image-53194\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/UserRoleEditorScreenshot.png?resize=680%2C560\" alt=\"User Role Editor Interface\" /></a>User Role Editor Interface\n<p>User Role Editor 4.24 and below allows any registered user to gain administrator access. <a href=\"https://wordpress.org/plugins/wordfence/\">Wordfence</a>, a popular security plugin for WordPress <a href=\"https://www.wordfence.com/blog/2016/04/user-role-editor-vulnerability/?utm_source=list&utm_medium=email&utm_campaign=urole\">has more details</a> and explains why the plugin was vulnerable:</p>\n<blockquote><p>The authorwas checking if users have access to edit another user using the current_user_can function and checking for the edit_user (without an s on the end) capability on a specific user ID. A user can edit themselves, and so sending data to the plugin that supplies the current users ID to this access check would bypass the check.</p></blockquote>\n<p>Users should immediately upgrade to 4.25 to protect sites from this vulnerability.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 04 Apr 2016 21:31:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"WPTavern: WP REST API Team Aims for WordPress 4.7 for Merge Proposal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53171\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"http://wptavern.com/wp-rest-api-team-aims-for-wordpress-4-7-for-merge-proposal\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3323:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/wp-rest-api.jpg\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/04/wp-rest-api.jpg?resize=1025%2C469\" alt=\"wp-rest-api\" class=\"aligncenter size-full wp-image-43000\" /></a></p>\n<p>The WP REST API team released <a href=\"https://github.com/WP-API/WP-API/releases/tag/2.0-beta13\" target=\"_blank\">version 2.0 beta 13</a> of the feature <a href=\"https://wordpress.org/plugins/rest-api/\" target=\"_blank\">plugin</a> today. This release includes a couple of breaking changes, JavaScript client updates, and many other fixes and improvements.</p>\n<p>Developers who use the plugin in their projects can expect it to follow a more stable release cycle in the future, as beta 13 marks the last of the breaking changes. According to project lead Ryan McCue, the team plans to add new features to minor releases in the 2.x series and bugfix releases in the 2.0.x series.</p>\n<p>&#8220;Along these lines, were going to release a 2.0 final version in the coming months,&#8221; McCue said. &#8220;This will be a completely stable release with guaranteed backwards compatibility for the foreseeable future. This backwards compatibility ensures that your sites can remain up-to-date with minimal maintenance or issues with upgrading.&#8221;</p>\n<p>The beta release post also included an updated roadmap for the project. The team is not planning to put forward part two of their merge proposal, which would add the core endpoints, for WordPress 4.6. They will be holding off until WordPress 4.7 in hopes of gaining more users with the stable 2.0 release.</p>\n<blockquote><p>We believe endpoints for the main WordPress objects (posts, users, comments, terms, and taxonomies) are not enough to garner the support needed for the proposal to be accepted. Our hope is that with a stable version 2.0 release, we will attract our community members that have been waiting for the endpoints to be available in core, and submit a merge proposal for the WordPress 4.7 release cycle.</p></blockquote>\n<p>Although the greater WordPress development community is excited about the potential of the REST API, the contributor base remains relatively small and spread thin for the task of keeping pace with core. McCue, speaking on behalf of the team, said they are looking to get more help from WordPress core component maintainers as well as outside developers.</p>\n<p>&#8220;Moving forward, the API team sees our role as advisory over the API itself, with the API treated as an integral part of the component rather than maintained by a separate team,&#8221; McCue said. &#8220;Were also going to continue to work on our feature plugins (metadata, site/multisite, menus/widgets, and authentication) in parallel, and are looking for help on these as well.&#8221;</p>\n<p>With the plugin approaching its 2.0 final version on a more stable path, it is a good time for new developers to get involved. The WP REST API team plans to allocate more time for mentoring and helping developers use the API. If you want to get involved, jump in on the comments of the <a href=\"https://make.wordpress.org/core/2016/04/04/wp-rest-api-2-0-beta-13-roadmap/\" target=\"_blank\">release post</a> or join the team in the #core-restapi Slack channel.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 04 Apr 2016 19:02:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"WPTavern: Color Safe: Build Accessible Color Palettes Based on WCAG Guidelines\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53152\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/color-safe-build-accessible-color-palettes-based-on-wcag-guidelines\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2476:\"<p>Last month WordPress contributors <a href=\"http://wptavern.com/wordpress-adopts-accessibility-coding-standards-for-all-new-and-updated-code\" target=\"_blank\">approved accessibility coding standards</a> for the core handbook. All new and updated code will need to conform with <a href=\"https://www.w3.org/WAI/intro/wcag\" target=\"_blank\">WCAG 2.0 level AA guidelines</a>.</p>\n<p>With WordPress core moving firmly in the direction of accessibility, its new guidelines set the bar for themes, plugins, and websites built on top of the platform. Text and background contrast, an important factor in readability, is one of the easiest places to get started. WCAG 2.0 color requirements recommend a contrast ratio of 4.5 for small text or 3 for large text, which is 24px or 18px bold.</p>\n<p><a href=\"http://colorsafe.co/\" target=\"_blank\">Color Safe</a> is a handy web app that helps designers select color combinations that will meet WCAG 2.0 guidelines for those with different visual capabilities. You enter the background color, font family, text size and weight, and the tool generates a palette of safe options for your text color.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/color-safe.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/color-safe.png?resize=1025%2C392\" alt=\"color-safe\" class=\"aligncenter size-full wp-image-53155\" /></a></p>\n<p>The palette can be sorted by general color groups and selections can be previewed at the top of the screen. By default, the generator uses AA level guidelines. If you&#8217;re building for a company or government website that requires AAA specifications, you can select it from the dropdown and all colors generated in the palette will be in compliance.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/color-palette.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/04/color-palette.png?resize=1025%2C419\" alt=\"color-palette\" class=\"aligncenter size-full wp-image-53157\" /></a></p>\n<p>Color Safe was built by Salesforce UX engineer <a href=\"http://donielleberg.com/\" target=\"_blank\">Donielle Berg</a> and product designer <a href=\"http://adrianrapp.com\" target=\"_blank\">Adrian Rapp</a> to help designers include accessibility as part of the design process. The tool takes the guesswork out of complying with WCAG guidelines and makes it easy to visually explore accessible color combinations.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 04 Apr 2016 15:44:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"WPTavern: In Case You Missed It  Issue 6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=53139&preview_id=53139\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://wptavern.com/in-case-you-missed-it-issue-6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5496:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png\" rel=\"attachment wp-att-50955\"><img class=\"size-full wp-image-50955\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/01/ICYMIFeaturedImage.png?resize=676%2C292\" alt=\"In Case You Missed It Featured Image\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/112901923@N07/16153818039\">Night Moves</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc/2.0/\">(license)</a>\n<p>Theres a lot of great WordPress content published in the community but not all of it is featured on the Tavern. This post is an assortment of items related to WordPress that caught my eye but didnt make it into a full post.</p>\n<h2>Jen Mylo Moves on From Automattic</h2>\n<p>Jen Mylo, formerly known as Jane Wells, <a href=\"http://jenmylo.com/2016/03/23/end-of-an-era/\">announced she has left</a> her position at Automattic after eight years to pursue other opportunities. Normally, people switching or leaving jobs isn&#8217;t news but Mylo is an exception to the rule because of the impact she&#8217;s had on the WordPress project and community over those eight years.</p>\n<p>From leading the effort to redesign the <a href=\"https://wordpress.org/news/2008/12/coltrane/\">WordPress 2.7 &#8220;Coltrane&#8221;</a> backend which was code-named <a href=\"https://wordpress.org/news/2008/10/the-new-27-dashboard/\">Crazyhorse</a>, to helping WordCamp organizers behind the scenes, to the <a href=\"https://make.wordpress.org/community/2015/01/15/remembering-kim-parsell/\">Kim Parsell travel scholarship</a>. She also facilitated and helped many WordPress lead developers.</p>\n<p>Thanks Jen for everything you&#8217;ve done and contributed to the WordPress project and its community. I wish and hope for the best for you in your future endeavors.</p>\n<h2>Generous in Spirit</h2>\n<p>Carrie Dils reminds us that the WordPress community is generous of spirit. If you haven&#8217;t experienced it yet, get in touch with her and she&#8217;ll introduce you.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">The <a href=\"https://twitter.com/hashtag/WordPress?src=hash\">#WordPress</a> community is so generous of spirit. If you feel disconnected from it and want to be a part, message me &amp; I\'ll introduce you.</p>\n<p>&mdash; carrie dils (@cdils) <a href=\"https://twitter.com/cdils/status/715339254000275456\">March 31, 2016</a></p></blockquote>\n<p></p>\n<h2>How to Protect a GPL Licensed Plugin from Being Copied</h2>\n<p>There&#8217;s <a href=\"https://www.facebook.com/groups/advancedwp/permalink/1126950354033844/\">a post on the Advanced WordPress Facebook group</a> that asks, what are the best ways to protect a GPL licensed plugin from being copied? The thread has more than a dozen responses with many explaining that copying is at the core of the license. The simple answer is that you don&#8217;t.</p>\n<h2>Comparison: Working from Home vs In an Office</h2>\n<p>The Onion <a href=\"http://www.theonion.com/graphic/working-home-vs-working-office-52630?utm_medium=RSS&utm_campaign=feeds\">compares what it&#8217;s like</a> to work from home as opposed to working in an office. I think the humorous comparisons ring true for many.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/TheOnionComparesWorkFromHome.jpg\"><img class=\"size-full wp-image-53144\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/TheOnionComparesWorkFromHome.jpg?resize=960%2C1121\" alt=\"Working From Home Compared to Working In an Office\" /></a>Working From Home Compared to Working In an Office\n<h2>WordPress 4.5 Field Guide</h2>\n<p>Everything you need to know to prepare for WordPress 4.5 is in <a href=\"https://make.wordpress.org/core/2016/03/30/wordpress-4-5-field-guide/\">the field guide</a>. Thanks to Aaron Jorbin for putting the guide together as it&#8217;s a great resource for those not able to keep up with development.</p>\n<h2>Jumboji</h2>\n<p>The only thing better than emoji in core is jumbo emoji. Thankfully, <a href=\"https://wordpress.org/plugins/big-emoji-comments/\">there&#8217;s a plugin</a> available that turns emoji into almost larger than life emoji.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">I am delighted to unveil Big Emoji Comments (Jumboji) for WordPress: <a href=\"https://t.co/AcEBzmvjCV\">https://t.co/AcEBzmvjCV</a> <a href=\"https://t.co/3g6Ii8AsUg\">pic.twitter.com/3g6Ii8AsUg</a></p>\n<p>&mdash; george ephanis (@daljo628) <a href=\"https://twitter.com/daljo628/status/712822383208505344\">March 24, 2016</a></p></blockquote>\n<p></p>\n<h2>Gianuu or Italian Wapuu!</h2>\n<p>In what is a traditional part of this series, I end each issue by featuring a Wapuu design. For those who don&#8217;t know, Wapuu is the <a href=\"http://wapuu.jp/2015/12/12/wapuu-origins/\">unofficial mascot</a> of the WordPress project. Gianduu is the official mascot of <a href=\"https://2016.torino.wordcamp.org/\">WordCamp Torino 2016</a>. Gianduu is a mix between Gianuja, a famous carnival mask and Gianduiotto, a Turin confectionery tradition.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/Gianduu.png\"><img class=\"size-full wp-image-53145\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/04/Gianduu.png?resize=744%2C817\" alt=\"Gianduu\" /></a>Gianduu\n<p>That&#8217;s it for issue six. If you recently discovered a cool resource or post related to WordPress, please share it with us in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 01 Apr 2016 22:23:36 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Features-as-Plugins First Transitions Into Features-as-Projects\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53097\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"http://wptavern.com/features-as-plugins-first-transitions-into-features-as-projects\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7058:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/FeaturesAsPluginsFeaturedImage.png\"><img class=\"size-full wp-image-53129\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/04/FeaturesAsPluginsFeaturedImage.png?resize=689%2C346\" alt=\"Features as projects featured image\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/25132305@N05/3514532960\">Office Pranks</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc-sa/2.0/\">(license)</a>\n<p>Last year, I <a href=\"http://wptavern.com/the-features-as-plugins-first-model-is-a-mess\">identified key factors</a> that suggested the <strong>features-as-plugins</strong> first model was falling apart. A lack of communication, direction, buy-in from core developers, and synchronized development between plugins on Github and WordPress.org were some of the contributing factors highlighted.</p>\n<h2>Features-as-Projects</h2>\n<p>WordPress lead developer <a href=\"http://profiles.wordpress.org/helen\" target=\"_blank\">Helen Hou-Sand</a> has <a href=\"https://make.wordpress.org/core/2016/03/31/iterating-on-feature-plugins/\">outlined a new strategy</a> for the model transitioning from a <strong>features-as-plugins</strong> approach to <strong>features-as-projects. </strong></p>\n<p>&#8220;Thinking of features as plugins has strapped us in a number of ways, in large part because the &#8216;plugin&#8217; part implies a functional project from the start,&#8221;Hou-Sand said.</p>\n<p>&#8220;From observation, experienced and newer contributors alike set their initial goal to be some sort of functional plugin. As a result, by the time something is being proposed in whatever forum, theres been a fair amount of effort spent  and personal attachment developed  for something that might be headed in the wrong direction. Changing direction at that point is very demoralizing and has led to burn out and less participation.&#8221;<strong><br />\n</strong></p>\n<h2>A New Page for Featured Projects</h2>\n<p>Feature projects are listed <a href=\"https://make.wordpress.org/core/features/\">on a new page</a> which includes a brief explanation of the problems being solved. Active projects include WordPress NUX which aims to remove barriers to entry and Font Natively which switches to system fonts to load faster and provide a more native experience.</p>\n<p>Anyone can suggest a feature project but its mission statement must clearly address what problem it&#8217;s trying to solve, its goals, and how it fits into <a href=\"https://wordpress.org/about/philosophy/\">WordPress&#8217; core philosophies</a> and objective. The new page also serves as a roadmap for future feature projects.</p>\n<p>By changing their approach, the core team hopes to achieve the following individual goals.</p>\n<ul>\n<li>To attract and retain a greater range of skill sets in contributors, for example through being able to more thoroughly engage designers in early stages.</li>\n<li>Implementing methods of collecting usage information and other data.</li>\n<li>Supporting feature projects with resources for user testing and more structured feedback.</li>\n<li>Advance both contributor and general community knowledge around product design and development.</li>\n</ul>\n<p>Beginning <a href=\"http://www.timeanddate.com/worldclock/fixedtime.html?iso=20160405T1700\">Tuesday, April 5th, 2016 at 1PM Eastern Daylight Time</a>, in the <a href=\"https://make.wordpress.org/chat/\">#core Slack channel</a>, bi-weekly meetings will be held where people can propose and discuss feature projects. These meetings are also where project leaders can ask for help, provide status updates, and maintain direction.</p>\n<h2>Design and Discovery First</h2>\n<p>Perhaps one of the most important changes in the process is the focus on discovery and design first. Instead of testing features after they&#8217;re developed, this plan focuses on gathering testing and usage data from users before technical implementation occurs.</p>\n<p>&#8220;Feature design and development should come from interviews with users, developed personas, surveys of those personas, documented flows, and other fairly standard methods,&#8221;Hou-Sand said.</p>\n<p>&#8220;Proper discovery will allow for testing long before functional development begins using low-fidelity storyboards and walking through potential concepts with users, both verbally and visually. Projects should check in at a meeting when discovery results are available and continue to check in through the design process.&#8221;</p>\n<p>Even though the discovery and design phase may not lead to a full-fledged feature in core, the process should help discover pain points along the way which can translate into other improvements.</p>\n<h2>Iterating is Not Just For Software</h2>\n<p>The new model incorporates <a href=\"https://make.wordpress.org/core/2014/11/03/open-update-thread/#comment-20735\">many of the suggestions</a> by WordPress lead developer, Ryan Boren from 2014.</p>\n<ul>\n<li>Be present and up-to-date in the plugin directory.</li>\n<li>Be as ready to go on mobile as they are on desktop.</li>\n<li>Have visual records for major flows through all new interfaces on all devices.</li>\n<li>Have mature UI that isnt going to derail the release train.</li>\n<li>Have a history of posting weekly updates to make/core.</li>\n<li>Have a history of regular plugin directory updates.</li>\n<li>Have a testing audience.</li>\n<li>Publish a merge consideration post on make/core complete with visual records and other diligence.</li>\n<li>Exist for at least one release cycle. Plugins created at the beginning of a release cycle should not be considered for merge until the next release.</li>\n</ul>\n<p>It also focuses on establishing a direction for a project early on instead of people aimlessly developing it to see where it goes. It&#8217;s worth noting that <a href=\"https://make.wordpress.org/core/2016/03/31/iterating-on-feature-plugins/#comment-29594\">Boren supports </a>the changes to the model.</p>\n<p>Early feedback suggests this is a great move. Michelle Schulp, Founder of <a href=\"http://marktimemedia.com/\">Marktime Media</a>, had this to say about the changes:</p>\n<blockquote><p>Love this, not only because it a) treats WordPress more like an actual product where decisions on features should be tested and vetted before theyre built, and b) validates the design and discovery process as &#8216;important to WordPress&#8217; and saves a ton of unnecessary dev time, but also c) will help encourage those with other important talents like design/ux/ui/user testing (but not core-level development skills) to contribute.</p></blockquote>\n<p>Although I suggested renaming feature plugins to feature experiments, feature projects is pretty good name.It&#8217;s nice to see the model evolve and address many of the problems I outlined in 2015. I encourage you to <a href=\"https://make.wordpress.org/core/2016/03/31/iterating-on-feature-plugins/\">read the full post</a> and let us know what you think of the changes.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 01 Apr 2016 20:47:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"WPTavern: bbPress 2.6 Expected Later This Year, Two Major Features Pushed Back to 2.7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53134\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"http://wptavern.com/bbpress-2-6-expected-later-this-year-two-major-features-pushed-back-to-2-7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1961:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/bbpress.png\"><img class=\"aligncenter size-full wp-image-24338\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/06/bbpress.png?resize=1025%2C378\" alt=\"bbpress\" /></a>There hasn&#8217;t been a lot of news about bbPress lately but earlier this week on the project&#8217;s development blog, John James Jacoby <a href=\"https://bbpress.org/blog/2016/03/an-update-on-bbpress-2-6/\">provided a status update</a> on the progress of 2.6 and what to expect for 2.7.</p>\n<p>According to the post, the team has worked hard on 2.6 since <a href=\"https://bbpress.org/blog/2013/11/bbpress-2-5-released/\">2.5&#8217;s release</a> in 2013. Unfortunately, two highly anticipated features that were expected to be in 2.6 have been pushed back to 2.7. Jacoby explains why:</p>\n<blockquote><p>Stephen and I have been steadily improving and readying the next major version (2.6) ever since releasing 2.5.0, and while many huge featuresand neat little improvements have already landed in the development version, there are 2 features that will likely get bumped to 2.7 so we can call 2.6 done:</p>\n<ul>\n<li>bbPress as Post Comments</li>\n<li>Forums as Taxonomies</li>\n</ul>\n<p>These two features are fully architected and planned, but do not have enough progress in code for them to hold up the release of 2.6.</p></blockquote>\n<p>Users can expect to see betas and release candidates of bbPress 2.6 in the coming weeks. Jacoby notes that development on 2.7 will exclusively focus on the two missing features.</p>\n<p>As someone who is waiting on the bbPress as Post Comments feature before diving into bbPress, I&#8217;m disappointed. I&#8217;m grateful for the time and effort Jacoby, Stephen Edgar, and others put into the project but considering its release history, it may be another 1-2 years before 2.7 is a reality. I don&#8217;t know if I can wait that long.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 01 Apr 2016 20:34:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: BuddyPress 2.6 Development Kicks Off, David Cavins to Lead Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53003\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"http://wptavern.com/buddypress-2-6-development-kicks-off-david-cavins-to-lead-release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3909:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/02/buddypress-wallpapers1.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/02/buddypress-wallpapers1.png?resize=800%2C450\" alt=\"buddypress-wallpapers\" class=\"aligncenter size-full wp-image-16156\" /></a></p>\n<p>Development on BuddyPress 2.6 began this week with a meeting to set the schedule and scope for the release. The BuddyPress project recently moved to adopt <a href=\"https://make.wordpress.org/core/2015/04/01/release-leads-for-wordpress-4-3-and-4-4/\" target=\"_blank\">release leads</a> as part of the core development process.</p>\n<p>The release lead gets a sense at the beginning of the dev cycle what he/she would like to accomplish, as well as what others want and are willing to contribute,&#8221; Boone Gorges said during last week&#8217;s development meeting. &#8220;Within those parameters, there is likely lots of room for the lead to make decisions about what the focus should be.</p>\n<p><a href=\"https://twitter.com/daveycavey\" target=\"_blank\">David Cavins</a> was named release lead for the upcoming 2.6 release and <a href=\"https://profiles.wordpress.org/mercime\" target=\"_blank\">@mercime</a> will be on deck for 2.7. During <a href=\"https://wordpress.slack.com/archives/buddypress/p1459364425000688\" target=\"_blank\">this week&#8217;s meeting</a>, Cavins set a schedule for 2.6:</p>\n<ul>\n<li>Beta: May 25</li>\n<li>RC1: June 8</li>\n<li>Official Release: June 15</li>\n</ul>\n<p>Cavins said that 2.6 will focus on performance and UI polish, as many of the tickets filed for the milestone fall into those general categories. Contributors chimed in during the meeting to express interest in working on specific goals and tickets:</p>\n<ul>\n<li>A new API to manage single items navigation (<a href=\"https://buddypress.trac.wordpress.org/ticket/6534\" target=\"_blank\">#6534</a>)</li>\n<li>Incrementor-based caching for ID queries (<a href=\"https://buddypress.trac.wordpress.org/ticket/6643\" target=\"_blank\">#6643</a>)</li>\n<li>Explore implementing Behat to add a functional testing capability to the project</li>\n<li>Extend BuddyPress&#8217; use of caching to group memberships</li>\n<li>Framework for bulk data handling after updates (#<a href=\"https://buddypress.trac.wordpress.org/ticket/6841\" target=\"_blank\">6841</a>)</li>\n</ul>\n<p>Cavins is also organizing a few &#8220;<a href=\"https://bpdevel.wordpress.com/2016/03/30/bp-work-parties-april-2016/\" target=\"_blank\">BuddyPress Work Parties</a>&#8221; early in the release cycle where contributors can get together to collaborate on tickets, documentation, testing patches, and answering support questions.</p>\n<p>In addition to the new release leads concept, the BuddyPress core team is also considering implementing component maintainers, similar to the way WordPress core is organized.</p>\n<p>&#8220;It gives newcomers a sense of where to look if they have questions about a part of BP, or want to get involved in contributing,&#8221; Gorges said. &#8220;It also creates a sense of ownership for people who are already doing the practical work of triaging certain kinds of tickets, and encourages people to step up and take a role of responsibility.&#8221;</p>\n<p>BuddyPress project lead John James Jacoby said that component maintainers has been one of his personal leadership goals for BuddyPress for a long time, with individuals and eventually teams &#8220;owning&#8221; components to make them shine.</p>\n<p>&#8220;The main reasons to do it are empowering people to make decisions, and to elevate everyone&#8217;s contributions by promoting within and creating goals for contributors to graduate to, to celebrate their value,&#8221; Jacoby said.</p>\n<p>Specific maintainers and/or teams have not yet been identified but the core team is working towards making this more official to streamline contributions.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 01 Apr 2016 20:13:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"Post Status: WordPress Questions &amp; Answers  Draft podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=23159\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"https://poststatus.com/wordpress-questions-answers-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5738:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>,<a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>,and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and Brian Krogsgard.</p>\n<p><span>Today, we answer questions from Post Status community members, who asked us all sorts of stuff on the <a href=\"https://poststatus.com/ask/\">Post Status Ask</a> page. If you&#8217;d like to ask a question, be sure to go there and we&#8217;ll see if we can answer it on a future show.</span></p>\n<!--[if lt IE 9]><script>document.createElement(\'audio\');</script><![endif]-->\n<a href=\"https://audio.simplecast.com/34442.mp3\">https://audio.simplecast.com/34442.mp3</a>\n<p><a href=\"http://audio.simplecast.com/34442.mp3\">Direct Download</a></p>\n<h3>Questions &amp; Links</h3>\n<p><span>We answered the following questions:</span></p>\n<p><strong>Why WordPress?</strong></p>\n<p>In a survey I did before my PressNomics talk, the top answer for what&#8217;s important to people in regards to the WordPress world was the quality of the community. WordPress&#8217; ubiquity &#8212; powering 26% of the web &#8212; helps too.</p>\n<p><strong>What is the biggest mistake you made learning WordPress? (Or, what would you do differently?)</strong></p>\n<p>Joe and I each shared what we tend to do wrong when learning new things. We are fully on opposite ends of the spectrum. Recommended link: <a href=\"http://justbuildwebsites.com/\">Just Build Websites</a>. Also, my post on <a href=\"https://poststatus.com/learn-wordpress-development/\">learning WordPress</a>s holds up pretty well, considering I wrote it in 2014.</p>\n<p><strong>Why did a lot of web and WordPress people get upset about the Mandrill pricing changes, when we want people to value the work we&#8217;re doing ourselves?</strong></p>\n<p>We discuss what made Mandrill&#8217;s pricing changes controversial, and why we think some level of &#8220;outcry&#8221; is understandable here. Basically, Mandrill isn&#8217;t differentiated enough to warrant the new pricing, in our opinions. However, it&#8217;s obviously their right to change their pricing and structure, and the questioner has a valid point in how we value other services versus our own.</p>\n<p><strong>The WordPress REST API clearly has the attention of savvy WordPress developers, but will it really change WordPress as we know it?</strong></p>\n<p>It&#8217;s hard to know exactly how the REST API will change WordPress. It partly depends on how extensive the core inclusion of the API is. But at a minimum, the WordPress REST API plugin will be maintained and offer a new way of interacting with WordPress for anyone that wants to do so. And efforts into learning the API will definitely be transferable to using other REST APIs on the web.</p>\n<p><strong>Why isn&#8217;t the WordPress importer being worked on more intensively?</strong></p>\n<p>Good question! We talk about the state of the importer, some other options like <a href=\"https://deliciousbrains.com/wp-migrate-db-pro/\">WP Migrate DB Pro</a>, <a href=\"http://www.wpallimport.com/\">WP All Import</a>, and <a href=\"http://wp-cli.org/commands/import/\">WP CLI</a>. We also discuss how to get involved with open source development.</p>\n<p><strong>Should taxonomies have the same feature capabilities as posts in the future?</strong></p>\n<p>There&#8217;s been a lot of interesting work on taxonomies in the last several releases, and you can read more about some of that and find links going back from my <a href=\"https://poststatus.com/wordpress-4-4/\">release post for WordPress 4.4</a>. However, we think taxonomies and posts should be different. With the introduction of term meta, it is more important to consider architectural choices well in advance. Finally, the <a href=\"https://make.wordpress.org/core/tag/fields-api/\">Fields API</a> will be interesting in how it affects customizing term edit screens.</p>\n<p><strong>How should I use my own domains with Multisite?</strong></p>\n<p>This turned interesting! Fortunately, Multisite component maintainer Jeremy Felt came through while we were on the show to point us to tickets that were merged in WordPress 3.9 for <a href=\"https://core.trac.wordpress.org/ticket/27003\">enabling simpler domain mapping</a>, and in 4.3, when <a href=\"https://core.trac.wordpress.org/ticket/22383\">a better UI was introduced</a>. So, today, it&#8217;s much easier to use a custom domain in a network &#8212; within the existing WordPress Multisite options interface &#8212; versus using a tool like <a href=\"https://github.com/humanmade/Mercator\">Mercator</a>.</p>\n<hr />\n<p>In addition to these questions, we also banter on about some other things and answer a few less serious questions we got from funny listeners. And at the end, I make a pretty big announcement&#8230;</p>\n<hr />\n<p>Todays podcast is sponsored by Design Palette Pro. Design Palette Pro makes it easy to customize pretty much any Genesis theme, without touching code. Its perfect for when youre helping a friend with a website, but they dont have a full service budget and you dont have time to custom code every element. Get a great website in no time, with Design Palette Pro. Go to <a href=\"https://genesisdesignpro.com/\">GenesisDesignPro.com</a> for more information. Thank you to the team at <a href=\"http://reaktivstudios.com/\">Reaktiv Studios</a>, who builds Design Palette Pro, for being a Post Status partner.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 01 Apr 2016 19:21:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"Akismet: Akismet WordPress Plugin 3.1.10\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.akismet.com/?p=1909\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"http://blog.akismet.com/2016/04/01/akismet-wordpress-plugin-3-1-10/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1161:\"<p>Version 3.1.10 of <a href=\"http://wordpress.org/plugins/akismet/\">the Akismet plugin for WordPress</a> is now available.</p>\n<p>This update fixes a bug that could cause comments caught as spam to end up in the Pending queue. It also fixes the History entries for comments caught by WordPress&#8217;s built-in Comment Blacklist in WordPress 4.4 or later.</p>\n<p>Version 3.1.10 is confirmed compatible with WordPress 4.5, which is <a href=\"https://wordpress.org/news/2016/03/wordpress-4-5-release-candidate/\">coming soon</a>.</p>\n<p>To upgrade, visit the Updates page of your WordPress dashboard and follow the instructions. If you need to download the plugin zip file directly, links to all versions are available in <a href=\"http://wordpress.org/plugins/akismet/\">the WordPress plugins directory</a>.</p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/akismet.wordpress.com/1909/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/akismet.wordpress.com/1909/\" /></a> <img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=blog.akismet.com&blog=116920&post=1909&subd=akismet&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 01 Apr 2016 17:07:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Christopher Finke\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WPTavern: Jetpack 3.9.6 Fixes Bug that Inserts Random Vimeo Videos into Comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53075\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"http://wptavern.com/jetpack-3-9-6-fixes-bug-that-inserts-random-vimeo-videos-into-comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2109:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/11/jetpack-lego.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/11/jetpack-lego.jpg?resize=1024%2C504\" alt=\"photo credit: Tek F - cc\" class=\"size-full wp-image-33617\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/tekf/3509155200/\">Tek F</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-sa/2.0/\">cc</a>\n<p><a href=\"http://jetpack.com/2016/03/31/jetpack-3-9-5-maintenance-release/\" target=\"_blank\">Jetpack 3.9.5</a> was released yesterday with compatibilities for the upcoming WordPress 4.5 release and a handful of enhancements/bug fixes. Shortly after issuing the routine maintenance update, the Jetpack team began <a href=\"https://wordpress.org/support/topic/update-to-395-major-issue-adding-un-wanted-video-to-comments\" target=\"_blank\">receiving</a> <a href=\"https://wordpress.org/support/topic/update-to-395-major-issue-adding-un-wanted-video-to-comments\" target=\"_blank\">reports</a> of random, unwanted videos being added to the comments of posts. Any number string in the comments was automatically converted into a Vimeo video.</p>\n<p>No, this bug was not an April Fool&#8217;s Day prank, although it seemed like it. As a temporary fix, support representatives recommended that users deactivate the Shortcode Embeds module.</p>\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Were aware of an issue with numbers in comments embedding random Vimeo videos and are working to get 3.9.6 out as a fix ASAP.</p>\n<p>&mdash; Jetpack (@jetpack) <a href=\"https://twitter.com/jetpack/status/715603405432074240\">March 31, 2016</a></p></blockquote>\n<p></p>\n<p>The Jetpack team scrambled to fix the rather humorous and annoying bug, which had been introduced while fixing <a href=\"https://github.com/Automattic/jetpack/issues/3534\" target=\"_blank\">another Vimeo bug</a>. A few hours later they shipped 3.9.6 on the heels of the maintenance release. Users who updated to 3.9.5 right away will need to update again in order to avoid running into this bug.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 01 Apr 2016 04:43:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"WPTavern: WordPress.org UX Research Begins as Part of Long-Term Plan for Redesign\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53042\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"http://wptavern.com/wordpress-org-ux-research-begins-as-part-of-long-term-plan-for-redesign\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3995:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/06/survey.jpg\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/06/survey.jpg?resize=1025%2C507\" alt=\"photo credit: Lukasz Kowalewski\" class=\"size-full wp-image-44957\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/FI3UYVGNFD\">Lukasz Kowalewski</a>\n<p>WordPress.org is second only to WordPress.com in Google search results for &#8220;WordPress,&#8221; followed by the project&#8217;s download, about, and featured themes pages. Unfortunately, visitors to WordPress.org land on an outdated website that doesn&#8217;t accurately represent the vibrance of the WordPress project and its strong community. As the face of the open source project, WordPress.org is in desperate need of a redesign.</p>\n<p>Designer Hugo Baeta is currently gathering feedback on the user experience of the site as part of a long-term plan for its improvement. WordPress.org is a slow-moving machine when it comes to updates and design changes, but Baeta&#8217;s research is a solid first step towards action.</p>\n<p>&#8220;As we take on efforts of documenting and creating more polished and art directed design foundations for the WordPress project as a whole, the .org sites need to get some love as well,&#8221; Baeta said.</p>\n<p>He posted <a href=\"https://make.wordpress.org/meta/2016/03/30/wordpress-org-ux-research/\" target=\"_blank\">results of a lengthy 55-question survey</a>, summarizing anonymous feedback from 32 of WordPress&#8217; most active contributors &#8211; project leads, team reps, and highly active community members. The survey asked open-ended questions to encourage honest feedback on the site&#8217;s biggest pain-points.</p>\n<p>&#8220;This survey will help us get a better idea of the direction we need to go on a long-term plan to make improvements to WordPress.org, building a more solid and thought-out foundation so the community can grow and thrive for years to come,&#8221; Baeta said.</p>\n<p>For 81% of respondents, the primary reason they visit WordPress.org is to contribute to WordPress. Nearly all agreed that the design feels tired, old, outdated, and inconsistent. It&#8217;s not surprising, given the sample&#8217;s demographic, that most respondents rarely (if ever) visit the WordPress download page, the themes directory, hosting, or showcase pages.</p>\n<p>Overall, the survey&#8217;s participants find the current design to be inconsistent and confusing to navigate unless you are an insider. Several responses communicated frustration that the site isn&#8217;t 100% WordPress and that its underlying code prevents it from being easily updated.</p>\n<p>Survey participants offered both sharp criticism and constructive feedback. If you have the time and inclination, the <a href=\"https://make.wordpress.org/meta/2016/03/30/wordpress-org-ux-research/\" target=\"_blank\">results</a> are worth a read.</p>\n<p>WordPress.org serves two different types of users: contributors and the millions of people who use and the software. Baeta did not indicate his next step in the UX research, but it would be worthwhile to sample some first time visitors and users who frequent the pages that contributors don&#8217;t often visit.</p>\n<p>While open source software websites aren&#8217;t usually known for their cutting edge designs, many inspirational examples can be found at <a href=\"http://beautifulopen.com/\" target=\"_blank\">BeautifulOpen.com</a>. Browsing that catalogue, it&#8217;s clear that WordPress.org could greatly benefit from a brighter, more user-friendly design.</p>\n<p>Companies like Wix and Weebly, some of WordPress&#8217; commercial competitors, could never get away with having websites that don&#8217;t demonstrate the quality of their products. If WordPress is going to continue to grow past its current 26% market share, the project&#8217;s website should reflect its reputation of being easy-to-use software for creating beautiful websites.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 31 Mar 2016 21:48:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"WPTavern: WPWeekly Episode 228  Communication is Key\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=53084&preview_id=53084\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"http://wptavern.com/wpweekly-episode-228-communication-is-key\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3473:\"<p>We didn&#8217;t have a guest this week so <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I discuss the latest news and events happening in the WordPress community. We update listeners as to the status of the W3 Total Cache plugin. This segues into a conversation on whether caching plugins are necessary considering the improvements in technology in the last decade.</p>\n<p>We congratulate Rian Rietveld on winning the Heroes of Accessibility award and then dive deep into why communication is a key component of success for developers. We provide a status update on WordPress 4.5 and end the show with the plugin picks of the week.</p>\n<h2>Stories Discussed:</h2>\n<p><a href=\"http://wptavern.com/frederick-townes-confirms-w3-total-cache-is-not-abandoned\">Frederick Townes Confirms W3 Total Cache is Not Abandoned</a><br />\n<a href=\"http://wptavern.com/versions-of-wp-cli-prior-to-0-23-0-are-incompatible-with-wordpress-4-5\">Versions of WP-CLI Prior to 0.23.0 Are Incompatible with WordPress 4.5</a><br />\n<a href=\"http://wptavern.com/draft-and-save-customizer-changes-for-later-with-new-customize-snapshots-plugin\">Draft and Save Customizer Changes for Later with New Customize Snapshots Plugin</a><br />\n<a href=\"http://wptavern.com/modern-tribe-acquires-gigpress-exploring-saas-events-management-solution\">Modern Tribe Acquires GigPress, Exploring SaaS Events Management Solution</a><br />\n<a href=\"http://wptavern.com/wordpress-contributor-rian-rietveld-wins-heroes-of-accessibility-award\">WordPress Contributor Rian Rietveld Wins Heroes of Accessibility Award</a><br />\n<a href=\"http://wptavern.com/a-little-communication-goes-a-long-way\">A Little Communication Goes a Long Way</a><br />\n<a href=\"https://make.wordpress.org/core/2016/03/30/wordpress-4-5-field-guide/\">WordPress 4.5 Field Guide</a></p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/flatty-flat-admin-theme/\">Flatty &#8211; Flat Admin Theme</a> is a new Admin theme based off the flat design trend of 2015. Simply install the plugin and configure how you want the admin area to look.</p>\n<p><a href=\"https://wordpress.org/plugins/scratching-effect/\">Scratching Effect</a> allows you to easily simulate a gift card or instant lottery ticket by adding a scratchable area to your site.</p>\n<p><a href=\"https://wordpress.org/plugins/fb-instant-articles/\">Facebook Instant Articles for WP</a> adds support for Instant Articles for Facebook, which is a new way for publishers to distribute fast, interactive stories on Facebook. Instant Articles are preloaded in the Facebook mobile app so they load instantly.</p>\n<p><a href=\"https://wordpress.org/plugins/wapuufall/\">Wapuu Fall plugin</a> allows you to have falling Wapuus, similar to a falling snow plugin.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, April 6th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #228:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 31 Mar 2016 21:30:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"WPTavern: A Week of REST: WordPress REST API Developer Bootcamp Coming to the UK Late 2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=53059\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"http://wptavern.com/a-week-of-rest-wordpress-rest-api-developer-bootcamp-coming-to-the-uk-late-2016\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2086:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/bootcamp.jpg\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/bootcamp.jpg?resize=1024%2C532\" alt=\"photo credit: November Company  Confidence Course  Nov. 18, 2015 - (license)\" class=\"size-full wp-image-53064\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/59356205@N02/23194697112\">November Company  Confidence Course  Nov. 18, 2015</a> &#8211; <a href=\"https://creativecommons.org/licenses/by-nc/2.0/\">(license)</a>\n<p>A Day of REST, the first conference dedicated to the WordPress REST API, was held in London at the end of January 2016, hosted by the events team at <a href=\"https://hmn.md/\" target=\"_blank\">Human Made</a>. Attendees offered overwhelmingly positive feedback after the conference finished, with <a href=\"http://wptavern.com/a-day-of-rest-conference-successful-81-would-attend-again\" target=\"_blank\">81% of the 221 participants saying they would attend again</a>.</p>\n<p>The event&#8217;s organizers announced today that the next WP REST API conference will be held in the UK in late 2016. <a href=\"https://aweekofrest.hm/\" target=\"_blank\">A Week of REST</a> is being organized as a four-day residential developer bootcamp. As such, the 1,500 (~$2157 USD) ticket price is for an immersive experience that includes all meals, accommodation, and training.</p>\n<p>After the first conference, attendees indicated that they would be interested in a longer event that offered more advanced training. Although specific sessions have not yet been announced, organizers are focusing the bootcamp around three main learning objectives: how to leverage the WordPress REST API, creating your own API with custom endpoints, and displaying WordPress data in a frontend JavaScript application.</p>\n<p>Developers can sign up at <a href=\"https://aweekofrest.hm/\" target=\"_blank\">aweekofrest.hm</a> to indicate interest in the event and subscribe to updates from the organization team. Location and exact dates will be announced soon.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 31 Mar 2016 17:56:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Latte: A Free One-Page WordPress Theme to Showcase Your Profile\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52997\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"http://wptavern.com/latte-a-free-one-page-wordpress-theme-to-showcase-your-profile\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4485:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/latte.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/latte.png?resize=1025%2C477\" alt=\"latte\" class=\"aligncenter size-full wp-image-53014\" /></a></p>\n<p><a href=\"https://wordpress.org/themes/latte/\" target=\"_blank\">Latte</a> is a new parallax style WordPress portfolio theme created by <a href=\"http://www.hardeepasrani.com/\" target=\"_blank\">Hardeep Asrani</a>. The 19-year old developer from India already has 17 plugins and four themes to his credit on WordPress.org. We recently featured his work on the <a href=\"http://wptavern.com/write-css-in-the-customizer-with-the-advanced-css-editor-plugin\" target=\"_blank\">Advanced CSS Editor</a> plugin, which allows users to write CSS in the customizer.</p>\n<p>Latte follows suit with extensive customizer options for every section of the one-page scrolling theme. It was created for developers, designers, and freelancers who want to feature their work in a visual resume format with a profile photo, short bio, services, newsletter subscription, and more. Each of these sections are optional and can be turned on/off with a simple checkbox in the customizer.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/latte-customizer.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/latte-customizer.png?resize=1025%2C578\" alt=\"latte-customizer\" class=\"aligncenter size-full wp-image-53019\" /></a></p>\n<p>Latte theme users can choose to highlight different skills, portfolio items, blog posts, and/or services they provide. It is geared towards individuals who want to lead with their profile and keep all their relevant information on the home page.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/skills-portfolio.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/skills-portfolio.png?resize=1025%2C664\" alt=\"skills-portfolio\" class=\"aligncenter size-full wp-image-53023\" /></a></p>\n<p>In many one-page scrolling themes, blog posts become somewhat of an afterthought that don&#8217;t receive the same design attention. Latte, on the other hand, includes a simple, tasteful single post design that is harmonious with the rest of the site. A blog header image can be set in the customizer to be unique or match the rest of the site.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/latte-single-post.png\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/latte-single-post.png?resize=1025%2C647\" alt=\"latte-single-post\" class=\"aligncenter size-full wp-image-53028\" /></a></p>\n<p>If you&#8217;re not a fan of the preloader or the scrolling parallax animations, you can disable them in the customizer. The theme supports a slide-out navigation menu, which can also be disabled if you plan to keep all the content on the homepage without posting any blogs.</p>\n<p>Asrani built 100+ color control options into the theme and prides himself on its customizability. Latte&#8217;s homepage states that if you find something in the theme which is not customizable, then he will work on adding it to the theme.</p>\n<p>The services, skills, and subscribe sections are widgetized areas where the content is generated by special widgets that are included in the theme. <a href=\"https://themes.svn.wordpress.org/latte/0.6/documentation/Latte%20Documentation.pdf\" target=\"_blank\">Documentation</a> for setting up the various sections is included in the theme&#8217;s zip file. If you want to add pricing tables, a contact form, portfolio section, or a map, you&#8217;ll need to purchase the pro version. To Asrani&#8217;s credit, the free version is not cluttered by pro version &#8220;teaser&#8221; controls in the customizer.</p>\n<p>Check out the <a href=\"http://www.hardeepasrani.com/demo/latte/\" target=\"_blank\">live demo</a> to see each of the available sections in action on the page.</p>\n<p>Latte offers a welcome alternative to clunky, confusing page builders or drag-and-drop editors. With everything in the customizer, the user doesn&#8217;t have to hunt around for how to edit its many sections. If you want a simple one-page theme to showcase your profile and services, you&#8217;d be hard pressed to find one more customizable than Latte. <a href=\"https://wordpress.org/themes/latte/\" target=\"_blank\">Download</a> it for free from WordPress.org or via your admin themes browser.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 30 Mar 2016 19:04:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"WPTavern: A Little Communication Goes a Long Way\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52977\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"http://wptavern.com/a-little-communication-goes-a-long-way\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4926:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/01/CommunicationFeaturedImage.jpg\"><img class=\"size-full wp-image-15569\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/01/CommunicationFeaturedImage.jpg?resize=637%2C200\" alt=\"Communication Featured Image\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/elycefeliz/3224486233/\">elycefeliz</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-nd/2.0/\">cc</a>\n<p>Whether you manage WordPress plugins, themes, or a service, a key component to keeping users happy is communication. Users and especially paying customers want to know what&#8217;s going on. Going an extended period of time without communicating leads to doubt, a feeling of abandonment, and speculation.</p>\n<p>Communicating is not hard and these days, developers have more ways than ever to keep users and customers informed. If you&#8217;re experiencing writer&#8217;s block or don&#8217;t know what to write about, here are a few ideas.</p>\n<ul>\n<li>New Features</li>\n<li>Major Bug Fixes</li>\n<li>White Papers</li>\n<li>User Testimonials/Reviews</li>\n<li>Major Changes or Announcements</li>\n</ul>\n<p>The key is to maintain a cycle where you communicate, users and customers provide feedback, and implement the feedback into continued improvements. While it doesn&#8217;t always work this way, it&#8217;s an ideal strategy that keeps developers and users on the same page.</p>\n<h2>Controlling The Flow of Information</h2>\n<p>Ideally, a news site is not the first place users should discover what&#8217;s going on with a particular project. Blogs attached to a project&#8217;s site are an excellent way to keep insiders and outsiders informed. By utilizing Facebook, Twitter, change logs, and a blog, you control the flow of information and what you want people to know.</p>\n<p>Speaking of change logs, last year, <a href=\"http://wptavern.com/wordpress-plugin-developers-need-to-communicate-better-in-change-logs\">I offered advice</a> on what information to include and how to differentiate between the changes. Users read change logs and should be an important part of any developer&#8217;s communication strategy.</p>\n<h2>How Much Communication?</h2>\n<p>There&#8217;s no set rule on how much you should communicate but with all the options available, there&#8217;s no excuse not to push out a few updates a week. However, this all depends on how many users you have, how much development activity is going on, etc. Sometimes, there&#8217;s nothing to report and that&#8217;s fine. When it becomes concerning is when there is a lack of communication after a month or more.</p>\n<h2>Communication Can Make or Break a Business</h2>\n<p>Most of what I&#8217;ve discussed so far deals with software development. However, there is one aspect of communication that can make or break a business and that&#8217;s during a security issue.</p>\n<p>If your plugin, theme, or service experiences a security issue, the best thing to do is own it, be as transparent as possible, and inform users immediately. A great example is when <a href=\"https://ithemes.com/2014/09/23/important-security-update-for-all-customers/\">iThemes experienced a security breach</a> in late 2014, that affected approximately 60,000 customers.</p>\n<p>iThemes CEO Cory Miller could have swept the breach under the rug and fix things behind the scenes but instead, chose to <a href=\"http://wptavern.com/ithemes-suffers-security-breach-customers-urged-to-reset-passwords\">immediately inform customers</a>. In his post, he explains what happened, takes full responsibility, and explains what they&#8217;re going to do to make things right.</p>\n<p>As the company learned more about the breach, they shared that information with customers and the public. Thanks to Millers honest approach of attacking the issue head on, a lot of upset customers pledged their support for the company.</p>\n<h2>Be Honest</h2>\n<p>If iThemes chose to keep the breach under wraps for as long as possible, chances are that at some point it would be exposed likely causing the company irreparable damage. Humans are not perfect and security vulnerabilities happen, but it&#8217;s how they&#8217;re handled that can make or break a business.</p>\n<p>Be honest with yourself and to those giving you money. Nothing good happens by ignoring customers or setting unrealistic expectations.</p>\n<p>As the user and customer base of plugins, themes, and services increases, so does the impact of communication. You don&#8217;t have to write a thesis every week but it&#8217;s nice to know that the developers behind a project have a pulse, especially if it&#8217;s for something people are paying for.</p>\n<p>If communication is something you&#8217;re struggling with, let us know in the comments. If you develop a popular theme or plugin, let us know what your strategy is for keeping people informed.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 29 Mar 2016 23:24:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"WPTavern: Keep Track of Your WordPress.org Themes and Plugins with WP Dev Dashboard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52662\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"http://wptavern.com/keep-track-of-your-wordpress-org-themes-and-plugins-with-wp-dev-dashboard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4595:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/controls.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/controls.jpg?resize=960%2C443\" alt=\"photo credit: 	Drew Patrick Miller\" class=\"size-full wp-image-52988\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/2724C9A9DE\">	Drew Patrick Miller</a>\n<p>The official <a href=\"https://wordpress.org/plugins/\" target=\"_blank\">plugin directory</a> is arguably the best place to host a plugin if you&#8217;re looking for the widest distribution, but it&#8217;s also one of the most inhospitable for developers. A current meta team <a href=\"https://make.wordpress.org/meta/2016/02/25/plugin-directory-v3/\" target=\"_blank\">initiative</a> is focused on improving search, including prioritizing translated plugins for international users, and streamlining plugin submission, among other improvements. This <a href=\"http://wptavern.com/the-wordpress-plugin-directory-is-getting-a-makeover\" target=\"_blank\">major overhaul</a> is slated to be finished at the end of June 2016.</p>\n<p>In the meantime, WordPress.org plugin author <a href=\"http://mickeykaycreative.com/\" target=\"_blank\">Mickey Kay</a> has created a plugin that he intends to be the go-to resource for plugin and theme authors looking for a better management experience. The <a href=\"https://wordpress.org/plugins/wp-dev-dashboard/\" target=\"_blank\">WP Dev Dashboard</a> plugin offers statistics for all of your WordPress.org plugins and themes in one convenient dashboard, along with a list of unresolved support requests.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/wp-dev-dashboard.gif\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/wp-dev-dashboard.gif?resize=1025%2C814\" alt=\"wp-dev-dashboard\" class=\"aligncenter size-full wp-image-52980\" /></a></p>\n<p>In a post titled &#8220;<a href=\"http://mickeykay.me/2016/03/model-for-new-wordpress-plugin-directory/\" target=\"_blank\">A model for the new WordPress plugin directory</a>,&#8221; Kay identifies some of the common pain points that developers experience with the existing directory: &#8220;dependency on SVN instead of Git, inconsistent search results, inclusion of obsolete information, obfuscation of more important statistics, etc.&#8221;</p>\n<p>Kay built WP Dev Dashboard to assist those who are trying to manage numerous extensions on WordPress.org, a process that currently requires drilling down into each plugin/theme to view data and support requests.</p>\n<p>&#8220;If I had to sum up the main problem I&#8217;m trying to solve, it&#8217;d be something like this: As a developer, and now maintainer of 16 plugins, it&#8217;s become all too easy for me to lose track of support requests, outdated core WP compatibility, and last updated dates,&#8221; Kay said.</p>\n<p>&#8220;The current directory requires developers to manually click through to each plugin via their &#8220;<a href=\"https://profiles.wordpress.org/mcguive7/#content-plugins\" target=\"_blank\">dashboard</a>&#8221; to check these stats. Plus, there are no options for notifications and/or other helpful automated features that would make my life much simpler.&#8221;</p>\n<p>When he first released the plugin, he planned to launch a free, hosted service that could automatically send out regular notifications for things like unresolved tickets and daily/weekly/monthly download counts. The hosted service would provide a centralized command center for managing WordPress.org-hosted extensions.</p>\n<p>&#8220;I haven&#8217;t built anything yet as there&#8217;s so much talk about building out a better solution natively within WordPress.org,&#8221; Kay said. &#8220;My strong preference would be for the new plugin directory efforts to incorporate ideas like these to create a better, more seamless experience for both end users and developers.&#8221;</p>\n<p>One of the items on the roadmap for the second milestone is the creation of a &#8220;<a href=\"https://meta.trac.wordpress.org/ticket/1571\" target=\"_blank\">Plugin Author Admin</a>.&#8221; Kay hopes that his implementation could serve as an inspiration for what WordPress.org could provide for developers with the existing Plugin API.</p>\n<p>&#8220;The base functionality is already there as part of WordPress core, and all of the data is readily available via the existing Plugin API,&#8221; Kay said. &#8220;I think plugin authors stand to gain a ton from an updated admin/dashboard experience, and with 40,000+ plugins and counting, thats a lot of happy points.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 29 Mar 2016 21:10:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WPTavern: WordPress Contributor Rian Rietveld Wins Heroes of Accessibility Award\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52962\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"http://wptavern.com/wordpress-contributor-rian-rietveld-wins-heroes-of-accessibility-award\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2407:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/rian.jpg\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/rian.jpg?resize=760%2C382\" alt=\"rian\" class=\"aligncenter size-full wp-image-52968\" /></a></p>\n<p>The 31st Annual <a href=\"http://www.csun.edu/cod/conference/2016/sessions/\" target=\"_blank\">International Technology and Persons with Disabilities Conference</a> was held in San Diego, California, last week. Every year thousands of attendees gather to share knowledge and best practices for technology that removes barriers for people with disabilities.</p>\n<p>This year <a href=\"http://www.rianrietveld.com/\" target=\"_blank\">Rian Rietveld</a> was recognized by <a href=\"http://Knowbility.org\" target=\"_blank\">Knowbility.org</a> for her accessibility contributions to WordPress core. She took first place in the Individual Achievement category of the Heroes of Accessibility Awards. Rietveld&#8217;s nomination read as follows:</p>\n<blockquote><p>She leads the push to make WordPress core accessible and is a knowledgeable, dedicated, and effective advocate for accessibility in the global WordPress community. Her achievements in 2015 were significant and are having a major impact on the core accessibility of the application that is used to build more than 25% of all the websites in the world.</p></blockquote>\n<p>Other finalists included <a href=\"http://www.karlgroves.com/\" target=\"_blank\">Karl Groves</a>, developer of <a href=\"http://wptavern.com/access-monitor-plugin-tests-wordpress-sites-for-accessibility-compliance\" target=\"_blank\">Tenon.io</a>, and <a href=\"https://twitter.com/mostgood\" target=\"_blank\">Sally Shephard</a>, an iOS developer and accessibility educator. A <a href=\"http://events.tvworldwide.com/Events/CSUN2016/TabId/1294/VideoId/2223/Knowbilitys-Second-Annual-Community-Heroes-Of-Accessibility-Awards.aspx\" target=\"_blank\">video of the awards ceremony</a> is available on the event&#8217;s website and you can see Rietveld&#8217;s award announced starting from the 6:50 timestamp.</p>\n<p>In addition to her core contributions, Rietveld provides accessibility auditing and consultancy for WordPress plugin and theme developers. After learning that she had won, Rietveld said the award was &#8220;a huge encouragement to continue working on WordPress accessibility together with the team.&#8221;</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 29 Mar 2016 18:15:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"WPTavern: Modern Tribe Acquires GigPress, Exploring SaaS Events Management Solution\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52870\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"http://wptavern.com/modern-tribe-acquires-gigpress-exploring-saas-events-management-solution\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4434:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/gigpress.jpg\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/gigpress.jpg?resize=960%2C505\" alt=\"photo credit: Antoine Beauvillain\" class=\"size-full wp-image-52906\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/P6IFK1ELC6\">Antoine Beauvillain</a>\n<p><a href=\"http://tri.be/\" target=\"_blank\">Modern Tribe</a>, a top digital agency with a <a href=\"https://profiles.wordpress.org/moderntribe/#content-plugins\" target=\"_blank\">collection</a> of popular plugins on WordPress.org, announced that it has <a href=\"http://tri.be/blog/welcoming-gigpress-to-modern-tribe/\" target=\"_blank\">acquired GigPress</a>. With 20,000+ active installs and more than 260,000 downloads, <a href=\"https://wordpress.org/plugins/gigpress/\" target=\"_blank\">GigPress</a> is one of the most widely used plugins for musicians and performers who want to manage events with WordPress.</p>\n<p>Despite the plugin&#8217;s solid placement in the WordPress events niche, GigPress creator Derek Hogue is passing the keys over to Modern Tribe as an alternative to letting it &#8220;slowly die of neglect.&#8221; In his <a href=\"http://gigpress.com/blog/2016/03/gigpress-joins-modern-tribe/\" target=\"_blank\">acquisition announcement</a>, Hogue said:</p>\n<blockquote><p>Eventually I started using other CMS more often than not, so my passion and impetus for improving GigPress fell off a cliff.</p>\n<p>For several years I kept GigPress alive via mostly bug fixes and compatibility updates. Last year I finally decided that the best hope for bringing my baby from its extended adolescence into adulthood would be to find it a new home.</p></blockquote>\n<p>Hogue assured users that GigPress will continue to be a free, open-source plugin but with better support and a brighter future. He confessed that he was not able to sufficiently monetize the plugin to make it worth his time.</p>\n<p>&#8220;You can give away your plugin for free all day long, but as soon as you hit a certain scale, support becomes a burden,&#8221; Hogue said. &#8220;Creating revenue from plugins in WordPress takes an infrastructure which is prohibitive for many small developers.&#8221;</p>\n<p>Modern Tribe, however, has fresh plans for GigPress and has already added some compatibilities for its <a href=\"https://theeventscalendar.com/product/wordpress-events-calendar/\" target=\"_blank\">Events Calendar</a> and <a href=\"https://theeventscalendar.com/product/wordpress-event-tickets-plus/\" target=\"_blank\">Event Tickets Plus</a> plugins.</p>\n<p>&#8220;GigPress has a big foothold in a really important vertical and a strong user base,&#8221; said Modern Tribe CEO Shane Pearlman. &#8220;One of our former team members made the introduction a few months back and exploring it together, the team was excited.&#8221;</p>\n<p>Pearlman and his team see GigPress as a key addition to their suite of event management plugins but are still considering different paths for monetizing it.</p>\n<p>&#8220;Were definitely going to start serving specific verticals, with live music and touring artists being one of those,&#8221; Pearlman said. &#8220;Whether thats directly through the evolution of the GigPress product, or introduction of complementary products is still in planing. Our first step is to gracefully integrate our <a href=\"https://wordpress.org/plugins/event-tickets/\" target=\"_blank\">Event Tickets</a> plugin so that bands and venues can sell tickets through the WP commerce platform of choice.&#8221;</p>\n<p>Pearlman said that as one of the principal players in the events management space, Modern Tribe plans to go beyond calendars and tickets. The team is looking into a SaaS model for its growing suite of event management plugins.</p>\n<p>&#8220;We are actively exploring the nuances of a SaaS solution,&#8221; he said. &#8220;We have an internal business plan showdown in progress and another strategic acquisition conversation in play.&#8221; Pearlman would not elaborate on the company&#8217;s next acquisition.</p>\n<p>The good news for those using GigPress is that Modern Tribe plans to build a profitable business on it, which will help to fund the support and future development of the open source plugin. If you&#8217;ve been waiting for help and updates in the past, chances are the experience of using GigPress will soon be greatly improved.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 28 Mar 2016 23:29:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"WPTavern: HeroPress Publishes Essays From 18 Countries in its First Year\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52918\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"http://wptavern.com/heropress-publishes-essays-from-18-countries-in-its-first-year\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3247:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/heropress.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/heropress.jpg?resize=956%2C423\" alt=\"heropress\" class=\"aligncenter size-full wp-image-37733\" /></a><br />\n<a href=\"http://heropress.com/\">HeroPress.com, </a>where inspirational essays are published each week from people across the world is one year old. In a <a href=\"http://heropress.com/one-year/\">post celebrating the milestone</a>, Topher DeRosia highlights some of the site&#8217;s accomplishments throughout 2015.</p>\n<p>Authors from <a href=\"http://heropress.com/contributor-map/\">eighteen countries</a> have published essays including, Lebanon, Nepal, New Zealand, Nigeria, and more. There are twice as many men as women with published essays, something DeRosia says he is working on, &#8220;That tilts SLIGHTLY better in the coming weeks, but not enough, so Im looking for the voices and wisdom of more women,&#8221; he said.</p>\n<p>DeRosia thanked his family for their support and <a href=\"https://x-team.com/profile/dave-rosen/\">Dave Rosen</a>, Founder of web development firm <a href=\"https://x-team.com/about/\">X-Team</a>, for facilitating the idea and allowing him to manage the site despite <a href=\"http://wptavern.com/heropress-fails-to-attract-backers-cancels-kickstarter-campaign-ahead-of-deadline\">failing to reach his crowdfunding goal</a> in early 2015.</p>\n<p>To learn about the site&#8217;s origin and its future, I invite you to listen to our one hour interview with DeRosia. In it, he describes what inspired him to create the site and shares a personal story of someone who couldnt submit an essay because theyre spending all of their time trying to stay alive.</p>\n<div class=\"audio-shortcode-wrap\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/heropress.jpg?resize=175%2C131\" alt=\"HeroPress Publishes Essays From 18 Countries in its First Year\" class=\"landscape cw-greater thumbnail post-thumbnail audio-image\" /><!--[if lt IE 9]><script>document.createElement(\'audio\');</script><![endif]-->\n<a href=\"http://wptavern.com/wp-content/uploads/2016/03/EPISODE-227-The-HeroPress-Story-with-Topher-DeRosia.mp3\">http://wptavern.com/wp-content/uploads/2016/03/EPISODE-227-The-HeroPress-Story-with-Topher-DeRosia.mp3</a></div><div class=\"media-shortcode-extend\"><div class=\"media-info audio-info\"><ul class=\"media-meta\"><li><span class=\"prep\">Run Time</span><span class=\"data\">1:09:57</span></li><li><span class=\"prep\">Artist</span><span class=\"data\">Jeff Chandler and Marcus Couch</span></li><li><span class=\"prep\">Album</span><span class=\"data\">WordPress Weekly</span></li><li><span class=\"prep\">Track</span><span class=\"data\">227</span></li><li><span class=\"prep\">File Type</span><span class=\"data\">MP3</span></li><li><span class=\"prep\">File Name</span><span class=\"data\"><a href=\"http://wptavern.com/wp-content/uploads/2016/03/EPISODE-227-The-HeroPress-Story-with-Topher-DeRosia.mp3\">EPISODE-227-The-HeroPress-Story-with-Topher-DeRosia.mp3</a></span></li><li><span class=\"prep\">Mime Type</span><span class=\"data\">audio/mpeg</span></li></ul></div><button class=\"media-info-toggle\">Audio Info</button></div>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 28 Mar 2016 23:28:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WPTavern: Add Child Theme Support to Any WordPress Theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52912\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"http://wptavern.com/add-child-theme-support-to-any-wordpress-theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2736:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/child-theme.jpg\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/child-theme.jpg?resize=960%2C562\" alt=\"photo credit: Leeroy\" class=\"size-full wp-image-52929\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/R0C7A5M4WB\">Leeroy</a>\n<p>If you&#8217;re a developer, you may take for granted how easy it is for you to create a child theme for storing customizations separate from the parent theme. This one seemingly simple task can pose a significant hurdle for your average WordPress user. Without understanding the best practice of creating a child theme, users resort to cramming all changes into the active theme. This puts them in a vulnerable position when security updates are available but they cannot update without overwriting their changes.</p>\n<p><a href=\"https://twitter.com/mgibbs189\" target=\"_blank\">Matt Gibbs</a>, lead developer of <a href=\"https://facetwp.com/\" target=\"_blank\">FacetWP</a>, has created a little project to help users with creating child themes. &#8220;<a href=\"https://github.com/FacetWP/use-child-theme\" target=\"_blank\">Use Child Theme</a>&#8221; is a simple drop-in PHP class that theme developers can use to alert their users to activate a child theme and automatically create one for them.</p>\n<div class=\"embed-wrap\"></div>\n<p>&#8220;Normally, themes have to point users to a child theme documentation page or link to a pre-built child theme zip,&#8221; Gibbs said. &#8220;Most users don&#8217;t even bother.&#8221;</p>\n<p>Gibbs said the Use Child Theme project was built to make it easy for theme authors to support it. The project was also an offshoot of his experiences supporting FacetWP.</p>\n<p>&#8220;I do a lot of plugin support, and this issue keeps coming up over and over,&#8221; Gibbs said. &#8220;Users are on super old theme versions and they&#8217;re afraid to upgrade because they&#8217;ve modified the parent theme at one point, and don&#8217;t want to lose changes.&#8221;</p>\n<p>The idea behind <a href=\"https://github.com/FacetWP/use-child-theme\" target=\"_blank\">Use Child Theme</a> is to automatically create a child theme for someone who otherwise might not know how to create one. It&#8217;s not a plugin but rather a tool that theme developers can opt to include with just one line in functions.php:</p>\n<pre class=\"brush: php; light: true; title: ; notranslate\">include( dirname( __FILE__ ) . \'/use-child-theme.php\' );</pre>\n<p>WordPress theme developers, is this a method you would consider using to prompt users to activate a child theme? Or would you rather rely on links to documentation and/or a download link to a pre-built child theme?</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 28 Mar 2016 21:27:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"WPTavern: Take the Mental Health in Tech 2016 Survey\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52889\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"http://wptavern.com/take-the-mental-health-in-tech-2016-survey\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2517:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/mental-health-in-tech-2016.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/mental-health-in-tech-2016.png?resize=1025%2C528\" alt=\"mental-health-in-tech-2016\" class=\"aligncenter size-full wp-image-52893\" /></a></p>\n<p>Ed Finkler is on a mission to raise mental health awareness in the tech community with his <a href=\"https://osmihelp.org/\" target=\"_blank\">Open Source Mental Illness</a> (OSMI) campaign. In 2013 Finkler started speaking at conferences and gathering information on mental health in the tech workplace. His goal is to provide resources and documentation that companies can use to create more supportive environments for those dealing with mental health disorders.</p>\n<p>As part of the organization&#8217;s ongoing research, Finkler and the team at OSMI have authored <a href=\"https://cojfunkatroncom.typeform.com/to/Ao6BTw\" target=\"_blank\">a survey open to anyone working in the IT/tech community</a>. Respondents are not required to have a mental health issue in order to participate. The responses are recorded as anonymous and the survey does not collect any personal information.</p>\n<p>The bulk of the questions in the 10-minute survey gather information about employee&#8217;s perceptions of their co-workers and employer&#8217;s stance on dealing with mental health issues in the workplace. It asks if employers provide education on mental health topics, if there would be negative consequences of discussing these disorders in the workplace, and what kinds of benefits employers offer for treating mental health issues.</p>\n<p>After the survey concludes, OSMI will release the stats and information collected under a <a href=\"https://creativecommons.org/licenses/by-sa/4.0/\" target=\"_blank\">Creative Commons Attribution-ShareAlike 4.0 International license</a>.</p>\n<p>Finkler, who has suffered from depression, anxiety, and ADHD, is working to combat the associated shame and stigma by speaking openly about mental illness at tech conferences, including Open Source Bridge, Connect-JS, and Laracon US. In May, he will be speaking at <a href=\"https://2016.minneapolis.wordcamp.org/\" target=\"_blank\">WordCamp Minneapolis</a>. Check out <a href=\"https://channel9.msdn.com/Shows/Code+To+Live/Open-Sourcing-Mental-Health\" target=\"_blank\">Josh Holmes&#8217; interview with Finkler</a> in a recent episode of Code to Live to find out more about how he started OSMI.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 28 Mar 2016 18:10:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"Akismet: Akismet WordPress Plugin 3.1.9\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.akismet.com/?p=1907\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"http://blog.akismet.com/2016/03/28/akismet-wordpress-plugin-3-1-9/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:937:\"<p>Version 3.1.9 of <a href=\"http://wordpress.org/plugins/akismet/\">the Akismet plugin for WordPress</a> is now available.</p>\n<p>This update adds compatibility that allows Akismet to be auto-configured, and it fixes a bug where some comment data wouldn&#8217;t get included in the Akismet API request.</p>\n<p>To upgrade, visit the Updates page of your WordPress dashboard and follow the instructions. If you need to download the plugin zip file directly, links to all versions are available in <a href=\"http://wordpress.org/plugins/akismet/\">the WordPress plugins directory</a>.</p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/akismet.wordpress.com/1907/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/akismet.wordpress.com/1907/\" /></a> <img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=blog.akismet.com&blog=116920&post=1907&subd=akismet&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 28 Mar 2016 18:05:24 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Christopher Finke\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"Post Status: WordPress and SaaS  Draft podcast\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://poststatus.com/?p=23047\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"https://poststatus.com/wordpress-saas-draft-podcast/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2569:\"<p>Welcome to the Post Status <a href=\"https://poststatus.com/category/draft\">Draft podcast</a>, which you can find <a href=\"https://itunes.apple.com/us/podcast/post-status-draft-wordpress/id976403008\">on iTunes</a>,<a href=\"http://www.stitcher.com/podcast/krogsgard/post-status-draft-wordpress-podcast\">Stitcher</a>,and <a href=\"http://simplecast.fm/podcasts/1061/rss\">via RSS</a> for your favorite podcatcher. Post Status Draft is hosted by Joe Hoyle &#8212; the CTO of Human Made &#8212; and Brian Krogsgard.</p>\n<p><span>Software as a service (SaaS) is often viewed as a holy grail for successful online business. The ability to generate recurring revenue that doesnt require hours-for-dollars is attractive to most entrepreneurs.</span></p>\n<p><span>WordPress can be a helpful tool to get a lot of SaaS functionality out of the box. In todays episode, we discuss WordPress and SaaS in two contexts: one, using WordPress as a technology basis for a SaaS in another industry, and two, creating a SaaS catered to the WordPress world.</span></p>\n<a href=\"https://audio.simplecast.com/33745.mp3\">https://audio.simplecast.com/33745.mp3</a>\n<p><a href=\"http://audio.simplecast.com/33745.mp3\">Direct Download</a></p>\n<h3>Links</h3>\n<p><span>We mentioned the following SaaS products, and probably some others too.</span></p>\n<ul>\n<li><span><a href=\"http://www.happytables.com/\">Happy Tables</a></span></li>\n<li><span><a href=\"http://restaurantengine.com/\">Restaurant Engine</a></span></li>\n<li><span><a href=\"https://eventsmart.com/\">Event Smart</a></span></li>\n<li><span><a href=\"http://faithmade.com/\">Faithmade</a></span></li>\n<li><span><a href=\"http://varsitynewsnetwork.com/\">Varsity News Network</a></span></li>\n<li><a href=\"https://www.imagely.com/\">Imagely</a></li>\n<li><span><a href=\"http://rainmakerplatform.com/\">Rainmaker</a></span></li>\n<li><span><a href=\"https://wordpress.com/\">WordPress.com</a></span></li>\n<li><span><a href=\"http://optinmonster.com/\">OptinMonster</a></span></li>\n<li><span><a href=\"https://ithemes.com/sync/\">iThemes Sync</a></span></li>\n<li><span><a href=\"https://wpremote.com/\">WP Remote</a></span></li>\n<li><span><a href=\"https://akismet.com/\">Akismet</a> </span></li>\n<li><span><a href=\"https://vaultpress.com/\">VaultPress</a></span></li>\n</ul>\n<p>Todays podcast is sponsored by WP Migrate DB Pro by <a href=\"https://deliciousbrains.com/\">Delicious Brains</a>, the tool that makes syncing your databases effortless. Check out WP Migrate DB Pro and all their other great products on their website.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 26 Mar 2016 17:44:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Katie Richards\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"WPTavern: Draft and Save Customizer Changes for Later with New Customize Snapshots Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52655\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"http://wptavern.com/draft-and-save-customizer-changes-for-later-with-new-customize-snapshots-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6422:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/snapshots.jpg\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/snapshots.jpg?resize=750%2C446\" alt=\"photo credit: Chantel Lucas\" class=\"size-full wp-image-52875\" /></a>photo credit: <a href=\"https://stocksnap.io/photo/410Y7ES74I\">Chantel Lucas</a>\n<p>As the WordPress customizer becomes more widely adopted by theme and plugin developers, users often have a host of live preview options to play with when personalizing their sites. Different combinations can produce wildly different designs. What if you could save a preview of customizations before going live with it? This is the idea behind the new <a href=\"https://wordpress.org/plugins/customize-snapshots/\" target=\"_blank\">Customize Snapshots</a> plugin from Weston Ruter, Derek Herman, and the team at <a href=\"https://xwp.co/\" target=\"_blank\">XWP</a>.</p>\n<p>Customize Snapshots lets you draft and preview customizer states that can be shared via a private URL that the plugin generates. Users who are not authenticated can preview snapshots on the frontend without loading the customizer. Authenticated users will be able to load the snapshot inside the customizer to make further edits or publish the draft.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/customize-snapshot.gif\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2016/03/customize-snapshot.gif?resize=1025%2C525\" alt=\"customize-snapshot\" class=\"aligncenter size-full wp-image-52864\" /></a></p>\n<p>You may not be able to see it in the demo above, but snapshots can be saved with a scope of full or dirty, according to the plugin details page:</p>\n<ul>\n<li><strong>Full:</strong> will playback all the settings during preview [changeset]</li>\n<li><strong>Dirty:</strong> will only playback the ones that were marked dirty when the snapshot was taken [snapshot]</li>\n</ul>\n<p>&#8220;Snapshots was written as a feature plugin to implement a key feature that the <a href=\"https://make.wordpress.org/core/2015/01/26/customizer-transactions-proposal/\" target=\"_blank\">Customizer Transactions proposal</a> will make possible,&#8221; Weston Ruter said. Ruter is the Technology Director at XWP and a co-maintainer of WordPress&#8217; core customizer component. He said the plugin was also developed specifically for a client&#8217;s project requirements.</p>\n<p>&#8220;Customize Snapshots stores the Customizer state in a custom post type,&#8221; he said. &#8220;You can access the frontend of the site with the UUID for the snapshot added as a URL parameter to load the site with that Customizer state applied. So this makes it possible to preview Customizer changes on other devices entirely.&#8221;</p>\n<h3>Coming Soon: Schedule Customizier Changes to Go Live at a Future Date</h3>\n<p>WordPress core lacks the ability to schedule out changes to content that has already been published. The only option for editing published posts is to push changes live. This is also the same for the customizer, but the XWP team is aiming to add scheduling to Customize Snapshots.</p>\n<p>&#8220;The idea here, though not implemented yet in the feature plugin, is that you could also schedule a snapshot (aka transaction) to go live at a certain time,&#8221; Ruter said. &#8220;So you could bundle up a bunch of changes in the Customizer and &#8216;Save &amp; Publish&#8217; at a scheduled time, like Sunday at midnight.&#8221;</p>\n<p>With transactions added to the customizer, users could build up a large &#8216;changeset&#8217; as a draft, including things like building new pages, adding a collection of widgets, and updating menu items. The entire set of changes can then be scheduled to go live at the same time.</p>\n<p>&#8220;On the other side of that coin, it allows for there to be revision history for changes made in the Customizer,&#8221; Ruter said. &#8220;And this will work seamlessly with the <a href=\"https://github.com/xwp/wp-customize-posts\" target=\"_blank\">Customize Posts</a> feature plugin &#8211; the goal being to let the author do as much as possible during a Customizer session, for all changes to be previewed together, submitted for review and iteration, and staged for publishing at some point in time.&#8221;</p>\n<p>Ruter said he sees Customize Snapshots as another take on the common desire to build out content on a staging environment, preview changes, and then promote those changes to production.</p>\n<p>&#8220;This is a hard problem to solve, and lots of plugins are available with solutions, like WP-CFM, Ramp, and others,&#8221; he said. &#8220;But in the Customizer it&#8217;s something you can get for free because of its model, and you don&#8217;t need multiple environments. You just need to indicate which snapshot/transaction state you want to preview.&#8221;</p>\n<p>If you previously had a difficult time grasping the technical details of Ruter&#8217;s <a href=\"https://make.wordpress.org/core/2015/01/26/customizer-transactions-proposal/\" target=\"_blank\">customizer transactions proposal</a>, the Customize Snapshots plugin is a perfect example of the kind of functionality that transactions would enable. The feature plugin is an adaptation of his proposed changes that implement the more fundamental transactions construct.</p>\n<p>Customize Snapshots adds to <a href=\"https://profiles.wordpress.org/xwp/#content-plugins\" target=\"_blank\">XWP&#8217;s collection of plugins</a> that extend the customizer in innovative ways and intersect with <a href=\"https://make.wordpress.org/core/2015/09/23/outlining-a-possible-roadmap-for-the-customizer/\" target=\"_blank\">the framework&#8217;s long-term roadmap</a>. Occasionally, this will also tie into client work, as with the case of Customize Snapshots.</p>\n<p>&#8220;We try to propose Customizer solutions for client projects as a way to fund Customizer advances, but we also believe in the Customizer and would be working on it regardless,&#8221; Ruter said.</p>\n<p><a href=\"https://wordpress.org/plugins/customize-snapshots/\" target=\"_blank\">Customize Snapshots</a> makes the customizer a more collaborative environment within WordPress. If you need to make a large number of changes and share a preview with others, this plugin will help you do that. The ability to see snapshots in the admin and schedule changes will make it even more useful in the future.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 25 Mar 2016 20:52:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"WPTavern: Get Your Widgets Ready for WordPress 4.5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52812\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"http://wptavern.com/get-your-widgets-ready-for-wordpress-4-5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2255:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/07/testing.jpg\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/07/testing.jpg?resize=960%2C474\" alt=\"testing\" class=\"aligncenter size-full wp-image-46092\" /></a></p>\n<p>WordPress 4.5 is right around the corner with the <a href=\"https://wordpress.org/news/2016/03/wordpress-4-5-release-candidate/\" target=\"_blank\">first release candidate</a> now available for download. It includes <a href=\"https://core.trac.wordpress.org/log/trunk?action=stop_on_copy&mode=stop_on_copy&rev=37077&stop_rev=37026&limit=120&verbose=on\" target=\"_blank\">49 changes</a> from the last beta &#8211; improvements to the new custom logo feature, a minor update to jQuery, updates to inline documentation, and fixes for various small bugs.</p>\n<p>The upcoming release is packed full of <a href=\"https://make.wordpress.org/core/2016/03/10/customizer-improvements-in-4-5/\" target=\"_blank\">improvements to the customizer</a>: selective refresh, support for setting-less controls, and device preview. Plugin and theme authors who want to be on the cutting edge of the customizer&#8217;s new capabilities will want to review Weston Ruter&#8217;s post on <a href=\"https://make.wordpress.org/core/2016/03/22/implementing-selective-refresh-support-for-widgets/\" target=\"_blank\">Implementing Selective Refresh Support for Widgets</a>. All of the default WordPress themes and core widgets will ship with selective refresh in 4.5, but the feature is opt-in for plugins and themes.</p>\n<p>For most themes with standard sidebars, adding selective refresh is as simple as including one line to declare theme support:</p>\n<pre class=\"brush: php; light: true; title: ; notranslate\">add_theme_support( \'customize-selective-refresh-widgets\' );</pre>\n<p>Adding support for widgets is a bit more involved, depending on whether the widget uses JavaScript for initialization. Ruter&#8217;s post includes a tutorial for how to add selective refresh in either scenario. The <a href=\"https://make.wordpress.org/core/version-4-5-project-schedule/\" target=\"_blank\">target release date for 4.5</a> is April 12, 2016, so plugin and theme developers still have three weeks to add support.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 25 Mar 2016 16:18:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WPTavern: Versions of WP-CLI Prior to 0.23.0 Are Incompatible with WordPress 4.5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52830\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"http://wptavern.com/versions-of-wp-cli-prior-to-0-23-0-are-incompatible-with-wordpress-4-5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1873:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/12/restful-wp-cli.png\"><img class=\"aligncenter size-full wp-image-49286\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/12/restful-wp-cli.png?resize=1025%2C459\" alt=\"restful-wp-cli\" /></a>Daniel Bachhuber, maintainer of <a href=\"http://wp-cli.org/\">WP-CLI</a>, a popular command line interface utility for managing WordPress sites, <a href=\"http://wp-cli.org/blog/version-0.23.0.html\">has released</a> version 0.23.0. This release includes a number of bug fixes, improvements, and features, but the most important thing to note is that earlier versions of WP-CLI will not work with WordPress 4.5.</p>\n<p>According to Bachhuber, WordPress 4.5 loads a file in wp-settings.php and since WP-CLI uses a custom wp-settings-cli.php file, 0.23.0 and above are the only versions compatible with WordPress 4.5. Bachhuber created a <a href=\"https://core.trac.wordpress.org/ticket/34936\">new ticket on Trac</a> to start a discussion on using wp-settings.php instead of the custom file.</p>\n<p>&#8220;WP-CLI uses a custom wp-settings-cli.php to load WordPress, instead of wp-settings.php,&#8221;Bachhuber said. &#8220;While I appreciate the <a class=\"ext-link\" href=\"http://wp-cli.org/blog/how-wp-cli-loads-wordpress.html\">historical justifications</a> for the bootstrap process, it would be much better if WP-CLI could use wp-settings.php because, occasionally, there are <a class=\"ext-link\" href=\"http://wp-cli.org/blog/versions-0.21.1-and-0.20.4.html\">substantial problems</a> arising from needing to maintain a fork.&#8221;</p>\n<p>To see a full list of changes with detailed explanations on how to use new features such as installing community commands from the package index, check out the <a href=\"http://wp-cli.org/blog/version-0.23.0.html\">release post</a>.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 24 Mar 2016 21:59:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: WPWeekly Episode 227  The HeroPress Story with Topher DeRosia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=52825&preview_id=52825\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"http://wptavern.com/wpweekly-episode-227-the-heropress-story-with-topher-derosia\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2102:\"<p>In this episode of WordPress Weekly, <a href=\"http://marcuscouch.com/\">Marcus Couch</a> and I are joined by <a href=\"https://topher1kenobe.com/\">Topher DeRosia</a> to learn about the origins of <a href=\"http://heropress.com/\">HeroPress</a>. DeRosia explains his motivation for creating the site and why despite not reaching his crowdfunding goal, decided to press on.</p>\n<p>We also discuss the impact the essays are having on people across the world and whether or not HeroPress is accomplishing <a href=\"http://heropress.com/about/\">its mission</a>. Last but not least, DeRosia shares a personal story of someone who couldn&#8217;t write an essay for the site because they&#8217;re spending all of their time trying to stay alive.</p>\n<h2>Plugins Picked By Marcus:</h2>\n<p><a href=\"https://wordpress.org/plugins/media-from-ftp/\">Media from FTP</a> allows you to import items into the WordPress media library that are uploaded via FTP.</p>\n<p class=\"shortdesc\"><a href=\"https://wordpress.org/plugins/wp-open-last-modified/\">WP Open Last Modified </a>adds the last modified date and the current revision of your post/page using the [last_modified_date] shortcode.</p>\n<p><a href=\"https://wordpress.org/plugins/advanced-wp-reset/\">Advanced WordPress Reset</a> is a convenient way to restore WordPress back to a fresh install without having to go through the traditional installation process.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, March 30th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #227:</strong><br />\n</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 24 Mar 2016 20:56:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"WP Mobile Apps: WordPress for iOS: Version 6.0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://apps.wordpress.org/?p=3229\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://apps.wordpress.com/2016/03/24/wordpress-for-ios-version-6-0/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2905:\"<p>Hello, WordPress users!<a href=\"https://itunes.apple.com/us/app/wordpress/id335703880?mt=8&uo=6&at=&ct=\">Version 6.0 of the WordPress for iOSapp</a>is now availablein the AppStore.</p>\n<h1>What&#8217;s New:</h1>\n<p><strong>Delete sites from theapp!</strong> We know, we know, creating WordPress.com sites can get addictive. But if you feel like decluttering your dashboard, you can now delete a site (or two) directly from the app.</p>\n\n<a href=\"https://apps.wordpress.com/img_2103/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/03/img_2103.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"It\'s now possible to delete sites from within the app.\" /></a>\n<a href=\"https://apps.wordpress.com/img_2104/\"><img width=\"169\" height=\"300\" src=\"https://apps.files.wordpress.com/2016/03/img_2104.png?w=169&h=300\" class=\"attachment-medium size-medium\" alt=\"You can choose to keep all your content when deleting a site.\" /></a>\n\n<p><strong>More improvements.</strong>Several magical<a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?utf8=&q=is%3Aclosed+is%3Aissue+milestone%3A6.0+label%3A%22%5BType%5D+Enhancement%22+\">behind-the-scenes improvements</a>to make sure our codebase is stronger than ever.</p>\n<p><strong>Bug fixes.</strong>As usual, we squashed some bugs, butthere weren&#8217;tmany this time around. Keep an eye on<a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?utf8=&q=is%3Aclosed+is%3Aissue+milestone%3A6.0+label%3A%22%5BType%5D+Bug%22+\">the complete list of bugs here</a>.</p>\n<h1>Thank You!</h1>\n<p>Thanks to all of the contributors who worked on this release:<br />\n<a href=\"https://github.com/aerych\">@aerych</a>, <a href=\"https://github.com/alexcurylo\">@alexcurylo</a>, <a href=\"https://github.com/astralbodies\">@astralbodies</a>, <a href=\"https://github.com/diegoreymendez\">@diegoreymendez</a>, <a href=\"https://github.com/frosty\">@frosty</a>, <a href=\"https://github.com/hugobaeta\">@hugobaeta</a>, <a href=\"https://github.com/jleandroperez\">@jleandroperez</a>, <a href=\"https://github.com/koke\">@koke</a>, <a href=\"https://github.com/kurzee\">@kurzee</a>, <a href=\"https://github.com/kwonye\">@kwonye</a>, <a href=\"https://github.com/mattmiklic\">@mattmiklic</a>, <a href=\"https://github.com/maxme\">@maxme</a>, <a href=\"https://github.com/oguzkocer\">@oguzkocer</a>, <a href=\"https://github.com/sendhil\">@sendhil</a> and <a href=\"https://github.com/SergioEstevao\">@SergioEstevao</a>..</p>\n<p>You can track the development progress for the next updateby visiting<a href=\"https://github.com/wordpress-mobile/WordPress-iOS/issues?q=is%3Aopen+is%3Aissue+milestone%3A6.1\" target=\"_blank\">our 6.1 milestone on GitHub</a>. Until next time!</p><img alt=\"\" border=\"0\" src=\"https://pixel.wp.com/b.gif?host=apps.wordpress.com&blog=108068616&post=3229&subd=apps&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 24 Mar 2016 12:48:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"diegoreymendez\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"WPTavern: Cast of Silicon Valley Nails The Meaning of Automattic on The First Try\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52809\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"http://wptavern.com/cast-of-silicon-valley-nails-the-meaning-of-automattic-on-the-first-try\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1475:\"<p><a href=\"http://www.hbo.com/silicon-valley\">Silicon Valley</a> is a comedic television series on HBO about a group of six engineers who create a startup company in Silicon Valley. <a href=\"http://www.wired.com/\">Wired.com</a> sat down with the cast and gave them the names to real startup companies to see if they could guess what they do.</p>\n<p>Among the names mentioned is <a href=\"https://automattic.com/\">Automattic</a>. Fast forward to <a href=\"https://youtu.be/5Y64UeNeiOM?t=1m14s\">1:14</a> to watch Kumail Nanjiani, who plays <a href=\"http://www.hbo.com/silicon-valley/cast-and-crew/kumail-nanjiani/index.html\">Dinesh</a> on the show, correctly guess the meaning of the name on his first try, &#8220;Automattic with two T&#8217;s is a company ran by a dude named Matt,&#8221; he says. His response to being told he&#8217;s correct is pretty funny.</p>\n<p>Warning, the video contains strong language and is not safe for work.</p>\n<div class=\"embed-wrap\"></div>\n<p>Automattic, founded in 2005, is the driving force behind WordPress.com and a handful of other services like Akismet, Gravatar, VaultPress, IntenseDebate, Polldaddy, and more.</p>\n<p>While many people are confused between WordPress the software project and WordPress.com, the reason for two T&#8217;s in Automattic was guessed correctly on the first try by someone who is not deeply involved in the community. There&#8217;s something mildly humorous about that.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 23 Mar 2016 23:45:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"WPTavern: Restrict BuddyPress Signups by Email Domain\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52202\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"http://wptavern.com/restrict-buddypress-signups-by-email-domain\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2637:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/02/mailboxes.jpg\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/02/mailboxes.jpg?resize=1024%2C496\" alt=\"mailboxes\" class=\"aligncenter size-full wp-image-39214\" /></a></p>\n<p>Spam is one of the most discouraging things about managing a BuddyPress-powered social network. Since WordPress itself is already a magnet for spam signups and comments, BuddyPress is subject to the same and then some. With an ordinary WordPress site you can block most of it fairly well, but with BuddyPress you often have to wade through signups to verify that real humans aren&#8217;t getting blocked.</p>\n<p>One of the best ways to cut down on the avalanche of unwanted signups is to restrict them by email domain. <a href=\"https://wordpress.org/plugins/bp-rsed/\" target=\"_blank\">BP Restrict Signup by Email Domain</a> is a plugin that allows you to whitelist an email domain or set of domains that will be required for registration on the site. You can also set an error message and create a custom message to appear on the registration page.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/email-address-restrictions.png\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/email-address-restrictions.png?resize=566%2C862\" alt=\"email-address-restrictions\" class=\"aligncenter size-full wp-image-52791\" /></a></p>\n<p>The plugin was created by BuddyPress contributing developer Ray Hoh for the <a href=\"http://commons.gc.cuny.edu/\" target=\"_blank\">CUNY Academic Commons</a>. It&#8217;s part of a suite of plugins recommended by the <a href=\"http://commonsinabox.org/\" target=\"_blank\">Commons In A Box (CBOX)</a> free software project. The university uses the plugin to ensure that anyone signing up to the Academic Commons will have a CUNY email address. You can see it in action on the <a href=\"http://commons.gc.cuny.edu/register/\" target=\"_blank\">registration page</a>.</p>\n<p>BP Restrict Signup by Email Domain works on both single site and multisite installations of WordPress. It has been tested with the latest version of BuddyPress (2.5) but should also be compatible back to version 1.6.</p>\n<p>Not every social site can afford to limit email domains, but this plugin works well for academic sites, nonprofit or other types of organizations, or any community that excludes all but a few set email domains. <a href=\"https://wordpress.org/plugins/bp-rsed/\" target=\"_blank\">BP Restrict Signup by Email Domain</a> is open source on WordPress.org and is actively maintained for use on CUNY.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 23 Mar 2016 23:09:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"WPTavern: Frederick Townes Confirms W3 Total Cache is Not Abandoned\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52766\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"http://wptavern.com/frederick-townes-confirms-w3-total-cache-is-not-abandoned\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7219:\"<p><a href=\"https://wordpress.org/plugins/w3-total-cache/\">W3 Total Cache</a> is a free, caching WordPress plugin created by <a href=\"https://profiles.wordpress.org/fredericktownes/\">Frederick Townes</a> that&#8217;s active on more than one million sites. While the plugin&#8217;s core functionality is free to use, there&#8217;s a handful of services users can buy from within the plugin such as enhanced support to server and site configurations.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/W3TCUpsells.png\"><img class=\"size-full wp-image-52768\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2016/03/W3TCUpsells.png?resize=1025%2C700\" alt=\"W3 Total Cache Upsells\" /></a>W3 Total Cache Upsells\n<p>A recent post by Scott Tuchman on the <a href=\"https://www.facebook.com/groups/advancedwp/permalink/1116520665076813/\">Advanced WordPress Facebook group</a> cites that the plugin hasn&#8217;t been updated in more than seven months and is not compatible with WordPress 4.4.2. Out of 44 reports, 34 people say W3 Total Cache 0.9.4.1 doesn&#8217;t work with WordPress 4.4.2.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/W3TCBroken.png\"><img class=\"size-full wp-image-52769\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/W3TCBroken.png?resize=884%2C626\" alt=\"W3 Total Cache Not Compatible With WordPress 4.4.2\" /></a>W3 Total Cache Not Compatible With WordPress 4.4.2\n<p>The plugin was recently updated with the <a href=\"https://plugins.trac.wordpress.org/changeset/1375883/w3-total-cache\">only change</a> being the readme.txt file which states it has been tested up to WordPress 4.5. A cursory glance at the support forums indicates <a href=\"https://wordpress.org/support/topic/how-come-the-version-0941-now-says-updated-on-mar-21\">some users</a> are <a href=\"https://wordpress.org/support/topic/compatible-up-to-45-but-no-update-since-9-months-ago\">not pleased</a> with the simple update.</p>\n<h2>A Rocky Year</h2>\n<p>In 2015, a disgruntled customer who purchased services from <a href=\"http://www.w3-edge.com/\">W3 Edge</a>, <a href=\"https://www.reddit.com/r/Wordpress/comments/2r7un1/my_experience_with_what_its_like_with_w3_total/\">described their negative experience</a> in a post on the WordPress subreddit. The complaints include, a lack of communication, not receiving purchased services, and project delays. Mike McAlister, of <a href=\"https://arraythemes.com/\">Array Themes</a>, told the Tavern about his experience with W3 Edge.</p>\n<blockquote><p>In 2014, I signed up for the premium version of W3 Total Cache to unlock some of the advanced caching features. The email confirmation said that the license would auto-renew unless cancelled, so I contacted them right away with my request to cancel the auto-renewal. I didn&#8217;t hear anything back and wrongly assumed this was taken care of.</p>\n<p>Fast forward one year and I get an email out of nowhere that my W3 license had been renewed. I immediately contacted W3 with details of my order and politely requested a solution, but never heard a response.</p>\n<p>I wrote a total of four emails and several tweets directed at W3 Edge and its founder, Frederick Townes, with not a single response throughout the ordeal. Like many others, I had to resort to calling the bank and filing a dispute to get my money back, which dragged the issue out for several months.</p></blockquote>\n<p>At the end of the Reddit thread, W3 Edge <a href=\"https://www.reddit.com/r/Wordpress/comments/2r7un1/my_experience_with_what_its_like_with_w3_total/cqag9sw\">responded to the criticism</a> and admitted that the company let users down with its lack of engagement. It also admitted to having a small team and the challenges involved with its support model.</p>\n<p>&#8220;One of the largest lessons learned is that there&#8217;s a lot to get right especially with a small team,&#8221; W3 Edge said. &#8220;We&#8217;ve made some changes to the team recently and we&#8217;re working to rectify experiences like the ones noted here. Since its the customer experience that matters and not intentions, I apologize for the negative experiences. Our mission remains to enable independent publishers with great software and solutions.&#8221;</p>\n<h2>W3 Total Cache Status Update</h2>\n<p>The company&#8217;s <a href=\"https://twitter.com/w3edge/with_replies?lang=en\">official Twitter account</a> has been inactive since April of 2015 and the <a href=\"https://www.w3-edge.com/weblog/\">last post published</a> on its blog was 10 months ago. Combined with the lack of plugin updates, it&#8217;s understandable why customers and users are concerned with the plugin&#8217;s status.</p>\n<p>Frederick Townes, founder of W3 Edge, issued the following statement to the Tavern.</p>\n<blockquote><p>Since the last update, development and other operations have been ongoing. There have been several hundred bug fixes based on user feedback, more than 100 improvements and numerous major improvements. Weve added tens of thousands of unit tests for the various bugs and improvements in an attempt to allow us to release more updates faster in the future.</p>\n<p>Were also working on a new services and support model, which is more exclusive in an attempt to reduce the volume of service requests and misaligned customer / subscriber expectations.</p>\n<p>Our goal is unchanged, to create easy ways for publishers and developers to increase WordPress performance and tune user-experience in self-hosted environments. As we work towards leaving beta and moving towards a 1.0 release (and making our GitHub repository public rather than private) our goal is to offer hosted services that use automation to simplify the performance optimization process in the future.</p></blockquote>\n<p>I spoke to Townes for an hour on Skype and he comes across as a sincere, concerned business owner who is struggling to find a system that works for the amount of support volume he and his team are dealing with. I asked what keeps him motivated to continue working on W3 Total Cache, &#8220;I love solving complex problems which is what W3 Total Cache does,&#8221; Townes replied.</p>\n<p>I can only imagine how heavy the burdens are maintaining a free plugin that&#8217;s active on more than a million sites. Joost de Valk, founder of <a href=\"https://yoast.com/\">Yoast.com</a>, and lead developer of <a href=\"https://wordpress.org/plugins/wordpress-seo/\">WordPress SEO</a>, a plugin active on more than one million sites shared some of the <a href=\"https://yoast.com/yoast-seo-3-0-release-a-recap/\">lessons he learned</a> after users experienced issues upgrading to 3.0.</p>\n<h2>Have The Changes Worked?</h2>\n<p>While researching for this article, I requested feedback from thousands of people to learn what recent customers are experiencing with the company but no one responded. This can mean any number of things but it&#8217;s difficult to determine whether the changes mentioned in the Reddit thread have improved the situation without getting feedback from recent customers.</p>\n<p>If you&#8217;ve recently purchased services from W3 Edge, please share your experience with us in the comments.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 23 Mar 2016 20:42:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: GitHub Issue and Pull Request Templates: Choose Your Own Adventure\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52746\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"http://wptavern.com/github-issue-and-pull-request-templates-choose-your-own-adventure\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2633:\"<p>Last month GitHub <a href=\"http://wptavern.com/github-introduces-issue-and-pull-request-templates\" target=\"_blank\">introduced issue and pull request templates</a> in response to the <a href=\"http://wptavern.com/open-source-project-maintainers-confront-github-with-open-letter-on-issue-management\" target=\"_blank\">&#8220;Dear GitHub&#8221; letter of complaints</a> from open source project maintainers. The new templates let maintainers streamline contributions to be more structured and meaningful for the project.</p>\n<p>Creating issue and pull request templates could be a boring addition to your project&#8217;s task list, or you can have a little fun with <a href=\"https://twitter.com/TalAter\" target=\"_blank\">Tal Ater</a>&#8216;s new <a href=\"https://www.talater.com/open-source-templates/\" target=\"_blank\">open source template generator</a>. It leads you on a whimsical journey inspired by Lewis Carroll and H.P. Lovecraft while creating templates for your project.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/issue-pull-request-generator.png\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2016/03/issue-pull-request-generator.png?resize=1025%2C485\" alt=\"issue-pull-request-generator\" class=\"aligncenter size-full wp-image-52757\" /></a></p>\n<p>The generator lets you build your templates in the style of a Choose Your Own Adventure book. At every step you make selections that will help structure the final templates. For example, you can choose whether or not to focus on bug reports, or prioritize new features/improvements, or make room for both in your issues template.</p>\n<p>In a post titled &#8220;<a href=\"http://www.theopensourcer.com/2016/learning-to-ship-through-ridiculousness/\" target=\"_blank\">Learn to Ship Faster by Embracing Ridiculousness</a>,&#8221; Ater explains how he built the project over three days as an exercise to help him learn to let go and ship imperfect products:</p>\n<blockquote><p>The projects own imperfections are by definition its greatest strengths. Is it user friendly? About as friendly as a mad hatter. Does the writing make sense? Absolutely not. Did I get it from idea to shipping in 3 days? Abso-freaking-lutely.</p></blockquote>\n<p>The result is a fun little time machine that transports you back to childhood while outputting some useful templates for your open source projects. They may require a bit of additional tweaking for your particular use, but Ater&#8217;s <a href=\"https://www.talater.com/open-source-templates/#/\" target=\"_blank\">generator</a> gives you an easy way to get started.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 23 Mar 2016 16:32:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: WordPress Theme Review Team Moves Towards Automating Review Process\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=52730\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"http://wptavern.com/wordpress-theme-review-team-moves-towards-automating-review-process\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2402:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/red-pen.jpg\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/red-pen.jpg?resize=1024%2C500\" alt=\"photo credit: pollas - cc\" class=\"size-full wp-image-37241\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/pollas/526544001/\">pollas</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-sa/2.0/\">cc</a>\n<p>Getting a theme approved for the WordPress directory can sometimes take months, depending on the number of corrections required and reviewers available to handle the queue. As part of a larger plan to make things more efficient, the WordPress Theme Review Team is making progress towards automating many of the time-consuming checks involved in reviewing submissions and updates.</p>\n<p><a href=\"https://twitter.com/grapplerulrich\" target=\"_blank\">Ulrich Pogson</a>, who is leading the effort, published a <a href=\"https://make.wordpress.org/themes/2016/03/21/work-on-requirements-automation-update-1/\" target=\"_blank\">list of requirements</a> that might be good candidates for automated checks. Each item is now an issue on GitHub where contributors can discuss implementation and help build the checks. A few examples include &#8220;<a href=\"https://github.com/Otto42/theme-check/issues/133\" target=\"_blank\">Use the Customizer for implementing theme options</a>,&#8221; &#8220;<a href=\"https://github.com/Otto42/theme-check/issues/134\" target=\"_blank\">Dont include any plugins</a>,&#8221; and &#8220;<a href=\"https://github.com/Otto42/theme-check/issues/126\" target=\"_blank\">Dont include admin/feature pointers</a>.&#8221;</p>\n<p>During the most recent meeting, the team approved a <a href=\"https://make.wordpress.org/themes/2016/03/22/22-march-team-meeting/\" target=\"_blank\">list of 13 requirements</a> they are aiming to automate. They will need to write checks for each one and are inviting collaboration on GitHub.</p>\n<p>&#8220;It could be making a pull request, helping write the regex, or contributing ideas how to implement the check,&#8221; Pogson said. &#8220;Once the checks have been written we need help testing them for false positives.&#8221;</p>\n<p>Check out the <a href=\"https://github.com/Otto42/theme-check/issues\" target=\"_blank\">issues queue</a> for the Theme Check plugin if you want to help the team automate more checks.</p>\n<div id=\"epoch-width-sniffer\"></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 22 Mar 2016 22:30:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";a:10:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Tue, 12 Apr 2016 15:28:33 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:14:\"content-length\";s:6:\"219819\";s:10:\"connection\";s:5:\"close\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Tue, 12 Apr 2016 15:15:14 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:11:\"HIT lax 250\";s:13:\"accept-ranges\";s:5:\"bytes\";}s:5:\"build\";s:14:\"20160225174323\";}','no